(35, 346, 'تربوية', 'تربوية', 'الكثير من الاسر تعاني من تربية ابنائهم وتعاملهم مع المراهقين منهم بشكل خاص ويحتاجون للمساعدة وتعلم اساليب علمية وطرق تربوية حديثة', 'تربية الابناء\r\nطرق التعامل مع المراهفين', '45', 15, '1668014261.jpg', 1, NULL, NULL, NULL, '2022-11-09 23:17:41', '2022-11-09 23:17:41'),
(36, 346, 'أسرية', 'أسرية', 'يعاني بعض الشباب والشابات من صعوبة في اختبار شريك حياتهم او تكون اختياراتهم خاطئة\r\nيعاني الكثير من الازواج من مشاكل ويجدون صعوبة في حل خلافاتهم', 'اختيار شريك الحياة\r\nاسرار الزواج \r\nالخلافات الزوجية', '45', 15, '1668015327.jpg', 1, NULL, NULL, NULL, '2022-11-09 23:35:27', '2022-11-09 23:35:27'),
(37, 156, 'تربوية', 'تربوية', 'كل ما يتعلق في العملية التعليمية - تمكين المعلم والمدرب لتتعليم الفعال\r\nتحقق الاستشارة: تدريب على موضوع محدد', 'الادارة الصفية وضبط الطلبة - التحضير - استراتيجيات التعليم الحديث - الواجبات والتقييمات - التعامل مع الطلبة - فروق فردية - موهبين - ضعاف التحصيل الأكاديمي - التنسيق والاشراف التربوي - ادخال التكنولوجيا في التعليم - استخدام السبورة التفاعيلية - استخدام تطبيقات تفاعلية - استخدام تطبيقات أوفس في التعليم - الوورد - البوروبنت - الأكسل - .... - تحويل الواجبات والانشطة الدراسية الى العاب تعليمية ممتعة تستخدم خلال الحصة الدراسية', '45', 20, '1668061554.PNG', 1, NULL, NULL, NULL, '2022-11-10 12:25:54', '2022-11-15 10:19:28'),
(38, 33, 'تنمية بشرية', 'تنمية-بشرية', 'طرق وتمارين ذهنية وسلوكية من أجل الوصول الى النجاح والسعادة وتحقيق التوازن الفكري والعاطفي والنفسي والتغلب على المشاعر السلبية', 'تنمية الثقة بالنفس والتحرر من المخاوف المختلفة \r\nبرمجة العقل الباطن والتخلص من التفكير السلبية \r\nالتخلص من المشاعر السلبية كالخوف والقلق \r\nتحقيق السعادة والسلام الداخلي', '45', 35, '1668064700.png', 1, NULL, NULL, NULL, '2022-11-10 13:18:20', '2023-02-21 00:53:40'),
