(49, 783, 'بحث علمي', 'بحث-علمي', 'الاستشارة ستتيح فرصة التواصل معى كباحثة علمية للنقاش حول مشكلة ما فى الكتابة العلمية أو فكرة علمية بتخصصات الكيمياء الحيوية والطبية وأيضا تخصصات كيمياء معالجة وتنقية المياة. إذا كنت طالب ومهتم بالبحث العلمى أو اذا كنت خريج وتعمل بالبحث العلمى وتريد استشارة حول كيفية كتابة بحثك أو نشر مقالك فى أحد الدوريات العالمية فأنت هنا بالمكان الصحيح', 'مقترح بحثى \r\nالنقاش فى فكرة علمية \r\nكتابة أبحاث ومقالات \r\nمراجع علمية أو غيرها', '45', 10, '1668155846.jpg', 1, NULL, NULL, NULL, '2022-11-11 14:37:26', '2022-11-11 14:37:26'),
(50, 763, 'تربوية', 'تربوية', 'مشكلة ضعف التحصيل الدراسي تشخيصها واسبابها وطرق علاجها \r\nوتوضيح دور الاسرة والاخصائي والمعلم في حل المشكلة', 'الطالب المتأخر دراسيا', '45', 5, '1668191124.JPG', 1, NULL, NULL, NULL, '2022-11-12 00:25:24', '2022-11-12 00:25:24'),
(51, 763, 'أسرية', 'أسرية', 'تعريفها/تشخيصها /اسبابها /طرق علاجها / دور المدرسة والمرشد الطلابي والاخصائي في علاج المشكلة', 'صعوبات التعلم', '45', 10, '1668192124.jpg', 1, NULL, NULL, NULL, '2022-11-12 00:42:04', '2022-11-12 00:42:04'),
(52, 230, 'تربوية', 'تربوية', 'استشارات تربوية بكل ما يتعلق بالمؤسسات التربوية اداريًا، فنيًا (اساتذة، منسقين، طلاب، اهل) ، نحن في خدمتكم\r\nد. سحر باشا', 'ابحاث تربوية\r\n امور تتعلق بالطلاب تربويا، سلوكيا\r\nادارة الصف\r\nتحضير دروس\r\nاستراتيجيات تدريس\r\nتقويم واعداد امتحانات\r\nكيفية التعامل مع الطلاب\r\nالتنسيق المدرسي\r\nاساليب ادارية تربوية\r\nاعداد ابحاث اجازة، ماجيستير\r\nمساعدة الاهل على كيفية التعامل مع ابناذهم', '45', 0, '1668311509.jpg', 1, NULL, NULL, NULL, '2022-11-12 00:54:31', '2022-11-14 11:01:48'),
(53, 763, 'بحث علمي', 'بحث-علمي', 'ضعف التلاميذ في النحو وأسبابه: \r\nإن دراسة النحو ليست غاية في ذاتها، وإنما هى وسيلة لضبط الكلام وصحة المنطق والكتابة، ولذلك ينبغى الا ندرس منه إلا القدر الذى يعين على تحقيق هذه الغاية ومازاه عن ذلك فيترك للمتخصصين 0 \r\nولم يثر جدل حول أي فرع من فروع اللغة العربية، كما أثير حول تعليم النحو وكأن اللغة العربية ليست إلا مجموعة من القواعد التى تضبط علاقات الكلمات والجمل ببعضها، وتضبط أواخر الكلمات، وربما يرجع ذلك إلى الوزن الذي أعطى لدروس النحو في خطة الدراسة العامة، أو إلى المفهوم الخاطئ لطرق تعليمة أو إلى المفهوم الخاطئ لمعنى النحو.  \r\nوالنحو في اللغة العربية من أعقد المشاكل التربوية، إذ هو من الموضوعات التي يشتد نفور التلاميذ منها ويضيقون ذرعا بها، ويقاسون في سبيل تعلمها العنت من أنفسهم ومن المدرسين على السواء وقد أدت هذه الحال إلى شبه معاداة لاستخدام النحو فى الكلام، فاستبد الضعف بشأنها في التلاميذ ولم يعودوا يحتفون بأمرها، بل كثرا ما نجد ذلك سببا في كراهيتهم للغة العربية بجملتها ولاستهانة بها، وبمن يعملون في ميدانها\r\nوالواقع الذي لا شك فيه أن مستوى التلاميذ في اللغة العربية بصفة عامة والنحو بصفة خاصة، ينحدر انحدارا مزعجا سواء أكان ذلك ناشئا عن سياسة التوسع في التعليم، وما استتبعه من ضيق الأبنية وازدحام الفصول ونظام الفترات وعدم كفاية القوى البشرية عددا ونوعا أم كان ناشئا عن قصور الخطة ورداءة المناهج وعقم الكتب وغير ذلك من المقومات الأساسية للعملية التعليمية \r\n \r\nويمكن الوصول إلى هذا الحكم من الاطلاع على نماذج من أوراق الإجابة، أو الاستماع إلى كلمة يلقيها أحد التلاميذ في حقل، أو الاستماع إلى إجابة التلاميذ في زيارة أي فصل، وفي أية مدرسة، وفي أية مرحلة فستهولك كثرة الأخطاء النحوية التى سيقع فيها التلاميذ، وسوف تأس لما أل إليه مستوى اللغة العربية من التدهور والانهيار، وهذا ما أكده أحد المتخصصين في قولة : \" إن اللغة العربية تمر بأزمة خانقة تزداد يوما بعد يوم، ومن مظاهر هذه الأزمة ضعف كثير من الطلاب بجميع المراحل التعليمية من الابتدائية وحتى الجامعة في النحو، وما حذرت منه بنت الشاطئ في قولها : \" إن الظاهرة الخطيرة لأزمتنا اللغوية هى أن التلميذ كلما سار خطوة في تعلم اللغة ازداد جهلا بها، ونفورا منها وصدودا عنها، وقد يمضى في الطريق التعليمى إلى آخر الشوط، فيتخرج في الجامعة وهو لا يستطيع أن يكتب خطابا بسيطا بلغة قومية \"0 \r\nوقد ساعد على هذا الضعف ما نجده من البعد الملحوظ بين الاستعمالات التي تجرى على الألسنة لتحقيق المطالب اليومية وهذه القواعد نفسها، فلإنسان يقضي حاجاته ويتحدث إلى الأخرين، ويتحدثون إليه ويفههم ويفهمونه دونما حاجة إلى استعمال القواعد، ومن ثم يأتى التلميذ إلى المدرسة وليس لدية إحساس بحاجته إلى دراسة القواعد النحوية، فهى في نظرة تمثل لونا ثقافيا لاصلة بينه وبين فروع اللغة الأخرى، ولذا فالتلميذ ينقصه الدافع والإحساس بالحاجة إلى دراسة القواعد \r\nالنحوية 0 \r\nكما ساعد على هذا الضعف مانجده من الفهم الشائع لدى بعض معلمى النحو، من أن علم النحو هو علم يدرس لذاته، ولاصلة له بالتعبير الشفهى والكتابى، ومما زاد الأمر سوءا تقسيم اللغة العربية إلى فروع كل منها مستقل بذاته وكأنه لاصلة له بالفروع الأخرى، وبهذه الصورة يترقى التلميذ من صف إلى آخر ومن مرحلة إلى أخري، ومشكلة الضعف في استخدامه لقواعد النحو لا تفارقة، حتى ينتهى به المطاف، وقد يعود معلما للغة العربية، ويصبح مكلفا بتدريس مادة لا يفهمها، ولايعرف كيفية استخدامها 0 \r\nويمكن إيجاز أسباب ضعف التلاميذ في القواعد النحوية فيما يلى : \r\n•        ضعف المستوى اللغوى للتلميذ في المرحلة الابتدائية \r\n•        عدم معرفة التلميذ بشروط تطبيق القواعد النحوية 0 \r\n•        عدم وضوح الهدف من دراسة النحو لدى التلاميذ 0 \r\n•        اهتمام التلاميذ بحفظ القواعد النحوية محسب 0 \r\n•        استخدام مدرسى النحو للعامية اثناء الشرح 0 \r\n•        عدم ربط مدرسى النحو للقواعد بفروع اللغة العربية 0 \r\n•        عدم مراعاة مدرسى المواد الأخرى للقواعد النحوية 0 \r\n•        إهمال مدرسى النحو للتدريبات على القواعد النحوية 0 \r\n•        عدم كفاية الأمثلة التى يطرحها مدرسو النحو لتوضيح القاعدة 0 \r\n•        سوء عرض القواعد في كتب النحو 0 \r\n•        اعتماد طرق التقويم في النحو على الحفظ والاستظهار 0 \r\n•        عدم كفاية التدريبات على القواعد النحوية 0 \r\n•        تركيز طرق تدريس النحو على التقليد والمحاكاة 0 \r\n•        عدم الاهتمام بالأنشطة التى تشجع على الممارسة الصحيحة للقواعد النحوية 0 \r\n•        عدم الاستفادة من وسائل التقنية الحديثة فى ضبط المنطق إخراج الحروف من مخارجها الصحيحة 0 \r\n•        كثرة عدد التلاميذ في الفصول 0 \r\n•        عدم التزام وسائل الأعلام بقواعد اللغة الصحيحة 0 \r\n•        استخدام العامية في المنزل والبيئة المحيطة بالتلميذ 0 \r\n•   ضعف التلاميذ في المهارات الاساسية في النحو مثل (تحديد موقع الاسم الإعرابى، وتحديد بدفوع الفعل وتمييز إعراب المضارع وتمييز نوع المبنى والتميز بين أنواع المرفوعات من الأسماء، والتمييز بين أنواع المنصوبات من الأسماء، والتمييز بين أنواع المجرورات من الاسماء، والتمييز بين علامات الرقم الأصلية والفرعية والتمييز بين علاقات النصب الأصلية والفرعية', 'ضعف الطلاب في النحو\r\nالهمزات \r\nكيفية تعليم الطلاب القراءة والكتابة \r\nبرامج فردية وجماعية لذوي الهمم لتعليمهم القراءة و الكتابة', '45', 0, '1668197732.png', 1, NULL, NULL, NULL, '2022-11-12 02:15:32', '2022-11-14 11:00:40'),
(54, 321, 'تقنية وفنية', 'تقنية-وفنية', 'استشاره خاصة ببرنامج spss للحتلي البيانات والاحصاء', 'ما يخص تحليل البيانات والاستبيانات من خلال برنامج spss للتحليل الاحصائي', '45', 20, '1677416109.jpg', 1, NULL, NULL, NULL, '2022-11-13 02:18:53', '2023-02-26 18:55:09'),
(55, 321, 'نفسية', 'نفسية', 'برنامج علاجي بالموسيقي لكل حاله ويتضمن التعرف علي علاج الحالات والجلسات الخاصة بها', 'العلاج بالموسيقي \r\nالعلاج بالموسيقي واطفال التوحد \r\nالعلاج بالموسيقي واطفال فرط الحركه ونقص الانتباة \r\nالعلاج بالموسيقي ومرضي الفصام \r\nالعلاج بالموسيقي ومرضي الاكتئاب  \r\nالعلاج بالموسقي واطفال العنف الاسري \r\nالعلاج بالموسيقي ومرضي الزهايمر \r\nالعلاج بالموسيقي ومرضي السرطان \r\nحالات القلق واضطرابات النوم \r\nالعلاج بالموسيقي والعلاج الوظائفي لاطفال الشلل الدماغي', '45', 40, '1669906387.jpg', 1, NULL, NULL, NULL, '2022-11-13 02:30:44', '2022-12-01 20:53:07'),
(56, 129, 'تقنية وفنية', 'تقنية-وفنية', 'أقدم استشارات في برنامج التنسيقات وورد - والعروض التقديمية باوربوينت - والعمليات الحسابية اكسيل - وتصميم البرامج عن طريق الاكسيس - عملية نقل ونسخ الملفات بسهولة ورفعها على جوجل درايف - ارسال وتحميل ملفات من الواتس آب - تحويل ملفات الصور والصوت والفيديو لاستخدامها في العروض التقديمية - انشاء عروض تقديمية تعليمية للطلاب في المراحل التعليمية المختلفة ... ومهارات عديدة أخرى ..', 'المهارات الرقمية الأساسية \r\nإدارة الملفات \r\nبرنامج الوورد \r\nبرنامج الاكسيل \r\nبرنامج الباوربوينت\r\nبرنامج الأكسيس', '45', 5, '1668337693.png', 1, NULL, NULL, NULL, '2022-11-13 17:08:13', '2022-11-13 17:08:13'),
(57, 346, 'تنمية بشرية', 'تنمية-بشرية', 'يحتاج البعض لكيفية صياغة خطة شخصية\r\nبعاني البعض  من ضعف الثقة بالنفس\r\nيحتاج بعض المدربين الجدد لنصائح لدوراتهم التدريبية', 'التخطيط الشخصي\r\nتنمية الثقة بالنفس\r\nاستشارات للتدريب', '45', 10, '1668345685.jpg', 1, NULL, NULL, NULL, '2022-11-13 19:21:25', '2022-12-06 18:03:03'),
(58, 372, 'نفسية', 'نفسية', 'كيف تتعامل مع المسن  وكيفية الرعاية التمريضية فى المنزل', 'كيف تقدم الرعاية المطلوبة للمسن بالمنزل', '45', 10, '1668431937.jpg', 1, NULL, NULL, NULL, '2022-11-14 19:18:57', '2022-11-14 19:18:57'),
(60, 778, 'تنمية بشرية', 'تنمية-بشرية', 'بعد حجزك لهذه الإستشارة لدينا .. اذًا فأنت قد أخذت أولى خطوات التغيير.\r\nفسيتم بعدها مباشرةً التواصل معي أنا كوتش أحمد مقبول بشكل شخصي عبر الوتساب لتحديد ميعاد الإستشارة. والتي ستكون عبر تطبيق ZOOM أو أي وسيلة اتصال اخرى متاحة حسب راحة العميل..\r\n\r\nونضمن لك في هذة الإستشارة أن تلقي الدعم المناسب لأاني سأقوم بــ..\r\n1/الإستماع الي مشكلتك بشكل جيد وتحليلها.\r\n2/ إيجاد الحلول المناسبة لك وفق ظروفك \r\n4/ تطبيق أكثر من ثلاث سنوات من الخبرة معك\r\n3/ تدريبك من خلال التمارين العملية على كيفية تطبيقها \r\nلتكون بعد انتهاء الاستشارة تم حل مشكلتك بأمر الله تعالي.\r\n\r\n\r\nبادر في حجز استشارتك الآن', '1/كتابة السيرة الذاتية وتقييمها\r\n2/اجتياز مقابلة العمل\r\n3/تحديد المسار المهني \r\n4/كل ما يتعلق بتحديد الأهداف\r\n5/التخطيط الوظيفي والشخصي\r\n6/مواقع التوظيف مثل Linked In وغيرة وايجاد فرصة عمل\r\n7/تنمية الثقة بالنفس\r\n8/ استشارات تدريب للمدربين والمعلمين\r\n9/التفكير الزائد\r\n10/ العلاقات \r\n11/ الحقائب التدريبية\r\n\r\nوكل ما يتعلق بتنمية الذات وتطوير الأعمال والتنمية البشرية وتنمية العقل .', '45', 5, '1668604022.png', 1, NULL, NULL, NULL, '2022-11-16 18:59:07', '2023-03-20 15:56:01'),
(61, 237, 'تربوية', 'تربوية', 'كيفية تعلم حروف اللغة الغربية والقدرة على القراءة والكتابة والتحدث بأسرع وقت', 'كيفية تعلم حروف اللغة العربية', '45', 5, '1669069964.PNG', 1, NULL, NULL, NULL, '2022-11-18 05:24:46', '2022-11-22 04:32:44'),
(62, 662, 'إدارية ومالية', 'إدارية-ومالية', 'تعريف زيادة المبيعات \r\nنمو المبيعات أو زيادة المبيعات هو مقياس يقيس قدرة فريق المبيعات على زيادة الإيرادات خلال فترة زمنية محددة.\r\n\r\nبدون نمو الإيرادات، تتعرَّض الشركات لخطر تجاوز المنافسين والركود. نمو المبيعات هو مؤشر اِستراتيجي يستخدم في اِتخاذ القرار من قبل المديرين التنفيذيين ومجلس الإدارة، ويؤثِّر على صياغة وتنفيذ اِستراتيجية العمل.\r\n\r\nمن أفضل الطرق لكسب المزيد من المال في عملك هو بيع المزيد من منتجك أو خدمتك. هناك العديد من الطرق لزيادة المبيعات، اِعتماداً على أهداف الصناعة والسوق والأعمال. تتمثَّل إحدى الخطوات الأولى في تطوير اِستراتيجية والالِتزام به.ا', 'افكار تسويقية لزيادة المبيعات', '45', 10, '1668875311.jpg', 1, NULL, NULL, NULL, '2022-11-19 22:28:31', '2023-03-08 17:44:37'),
(63, 662, 'تنمية بشرية', 'تنمية-بشرية', 'يُعدُّ تطوير الذات مسألة نسبية؛ أي إنَّها تختلف من ناحية معناها من شخص إلى آخر، ولا يوجد استراتيجية موحدة يُلجأ إليها لقياسه، سناسعد على الاجابة  عن  هذا السؤال \"ما الذي يعنيه تطوير الذات؟\"؛ المصطلح يشير إلى حالة من التقدم، وإذا كان هذا هو المعنى الاصطلاحي يصبح السؤال الآتي هو في أيِّ مرحلة أنت من مراحل هذا التقدم؟\r\nالمراحل ألأربع لتطوير الذات:ألاكتشاف - التعلم - التطبيق - الهام ألأخرين.', 'المراحل الأربع لتطوير الذات', '45', 10, '1668876767.jpg', 1, NULL, NULL, NULL, '2022-11-19 22:52:47', '2023-03-08 17:44:52'),
(64, 514, 'إدارية ومالية', 'إدارية-ومالية', 'أن دور الاستشارات الإدارية والمالية مساعدة الشركة على حل المشاكل وتحسين الأداء في المقام الأول من خلال تحليل المشاكل وإيجاد الحلول ووضع الخطط لتحسين الأوضاع القائمة داخل الشركة، وبناء على ذلك نقدم لكم مجموعة من الاستشارات موضحة في قسم موضوعات الاستشارة:-', '* تحديد وتحليل الاحتياجات التدريبية.\r\n* تحليل فجوة المهارات skills gap analysis.\r\n* إعداد النظام الداخلي ولائحة الجزاءات.\r\n* إعداد الأنظمة الإدارية والمالية.\r\n* إعداد دراسات الجدوى الاقتصادية.\r\n* إعداد وتحليل القوائم المالية.\r\n* بناء دليل ونظام محاسبي.\r\n* مرافقة ريادي الاعمال في انشاء مشروعاتهم.', '45', 30, '1669143436.jpg', 1, NULL, NULL, NULL, '2022-11-21 02:19:32', '2022-11-23 00:58:42'),
(65, 966, 'أسرية', 'أسرية', 'من أكثر المشاكل التربوية شيوعاً التي يواجهها مقدمي الرعاية هي العناد لدى الأطفال\r\nما أسبابه؟\r\nكيف أتعامل معه؟\r\nوكيف أتجنب عناده؟', 'كيف أتعامل مع الطفل العنيد؟\r\nهل العناد مضر بالطفل؟', '45', 20, '1669023395.jpg', 1, NULL, NULL, NULL, '2022-11-21 15:36:35', '2022-12-13 22:20:31'),
(66, 514, 'تنمية بشرية', 'تنمية-بشرية', 'العائلة والعمل، الهوايات والأصدقاء، نرغب في تخصيص الوقت لكلّ منها، لكن...هناك عائق دائمٌ يمنعنا من الموازنة، وهو كيفية ترتيب هذه الرغبات أو المهام وكيفية تنظيم الوقت للقيام بها، هل سبق لك وتسائلت لماذا بعض الأشخاص لديهم الوقت الكافي لفعل كل ما يودونه؟؟؟', 'إدارة الوقت والضغوط وتحديد الأولويات', '45', 25, '1669062605.jpg', 1, NULL, NULL, NULL, '2022-11-22 02:30:05', '2022-11-22 02:30:05'),
(67, 237, 'تنمية بشرية', 'تنمية-بشرية', 'تعديل سلوك للأطفال والكبار', 'تعديل سلوك', '45', 5, '1669069006.jpg', 1, NULL, NULL, NULL, '2022-11-22 04:08:38', '2022-11-22 04:16:46'),
(68, 966, 'نفسية', 'نفسية', 'تقديم حلول لمشكلة نفسية معينة انت تختارها', 'مشكلة نفسية', '45', 25, '1669144270.png', 1, NULL, NULL, NULL, '2022-11-23 01:11:10', '2022-12-13 22:21:27'),
(69, 966, 'تربوية', 'تربوية', 'الطريقة الصحيحة لتعليم الاطفال اللغه الانجليزية من البداية مع المدربة المعتمدة الحاصلة على إجازة في تعليم اللغة الانجليزية مع خبرة ١٠ سنوات في مجال التعليم. والأهم من التعليم هو استيعاب الطفل ومراعاة مشاعره ومحاسنته  لكي تحصل على شخصية متميزة.كل طفل لديه شخصية مميزة أنت تظهرها فيه إن أحسنت التعامل معه.', 'تعليم اللغة الانجليزية للأطفال.\r\nطريقة فعالة لتعليم الاطفال اللغة الإنجليزية.', '45', 15, '1669200284.jpg', 1, NULL, NULL, NULL, '2022-11-23 11:23:17', '2022-12-13 22:29:36'),
(70, 859, 'تنمية بشرية', 'تنمية-بشرية', 'تحديد واختيار المسار الوظيفى\r\nادارة الاداء وتنمية المواهب داخل المنظمة\r\nتطوير الهيكل التنظيمى\r\nتطوير الوصف الوظيفى', 'طرق تحديد واختيار المسار المهنى - ادارة وتقييم الاداء وتنمية المواهب داخل المنظمة - ادارة صراعات العمل وتحويل بيئة العمل الى صحية ومنتجة-تطوير الهيكل التنظيمى للمنظمة فى ضوء تحقيق الاهداف قصيرة وطويلة الاجل- تطوير الوصف الوظيفى', '45', 5, '1669200277.jpg', 1, NULL, NULL, NULL, '2022-11-23 16:44:37', '2022-11-23 16:44:37'),
(72, 284, 'تنمية بشرية', 'تنمية-بشرية', 'كل منا يحدث له بعض المشاكل والتى تؤثر على كفاءته الانتاجية وعلاقته الاجتماعيه والاسريه بسبب افتقاره لبعض المهارات الحياتيه، نقدم المشوره لتحسن الحياه.', 'كيفية ادارة الضغوط - تحديد الاهداف - التواصل الفعال - ادارة الذات', '45', 5, '1669385507.jpg', 1, NULL, NULL, NULL, '2022-11-25 20:11:47', '2022-11-25 20:11:47'),
(73, 284, 'أسرية', 'أسرية', 'كل ما يخص الاسره من قبل البدايه وصولا بالمشكلات الخاصه بالابناء داخل الاسره', 'الخلافات الاسريه - التأهيل قبل الزواج - المشكلات الاسريه - ارشاد اسري- العلاقات الاسريه', '45', 5, '1669385693.jpg', 1, NULL, NULL, NULL, '2022-11-25 20:14:53', '2022-11-25 20:14:53'),
(74, 712, 'تقنية وفنية', 'تقنية-وفنية', 'كل ما يخص الدخول على الموقع  حتى الحصول على الشهادة', 'MICROSOFT EDUCATOR CENTER', '45', 5, '1669834958.PNG', 1, NULL, NULL, NULL, '2022-12-01 01:02:38', '2022-12-03 22:46:52'),
(75, 948, 'تقنية وفنية', 'تقنية-وفنية', 'سنثوم بشرح كامل المتطلبات التي يجب أن تتوافر معك لكي تصبح مبرمج ناجح', 'كيف تختار تخصصك البرمجي؟', '45', 5, '1676464261.jpeg', 1, NULL, NULL, NULL, '2023-02-15 18:31:01', '2023-02-15 18:31:01'),
(76, 321, 'إدارية ومالية', 'إدارية-ومالية', 'تفاصيل كتابه الخطه الاستراتيجيه والتنفيذية ومعايير الجوده ومعايير الفاعليه التعليميه وكيفيه تحكيمها', 'مهارات اداره الجوده في التعليم العالي وضع الخطه الاستراتيجيه والخطه التنفيذيه\r\nاداره الجوده \r\nجوائز  التميز الحكومي \r\nمعايير الجوده لى العملية التعليميه \r\nمعايير الفاعليه التعليميه والمؤسسي \r\nمعيار اداره ٫\' الجوده في الجامعات', '45', 30, '1677158343.jpeg', 1, NULL, NULL, NULL, '2023-02-23 19:19:03', '2023-02-23 19:19:03'),
(77, 662, 'تقنية وفنية', 'تقنية-وفنية', 'افضل و انجح طرق للتسويق الرقمي بتكنولوجيا رقمية عالية و حديثة.', 'التسويق الرقمي الحديث و المعاصر.', '45', 15, '1678276325.png', 1, NULL, NULL, NULL, '2023-03-08 17:52:05', '2023-03-08 17:52:05');
