INSERT INTO `contact_infos` (`id`, `logo`, `title_ar`, `title_en`, `phone`, `email`, `address_ar`, `address_en`, `longitude`, `latitude`, `description_ar`, `description_en`, `privacy_ar`, `privacy_en`, `terms_ar`, `agreements_ar`, `agreements_en`, `agreements_student_ar`, `agreements_student_en`, `terms_en`, `return_policy_ar`, `return_policy_en`, `cancellation_policy_ar`, `cancellation_policy_en`, `delivery_ar`, `delivery_en`, `certificate_price`, `live_certificate`, `version`, `favicon`, `created_at`, `updated_at`) VALUES
(1, '1663130103.png', 'منصة النمط', NULL, '00962795144553', 'info@alnamat.com', 'الاردن', 'Jordan', '6356', '635635', '<p dir=\"rtl\" style=\"text-align:center\">منصة تعليمية رقمية للتدريب والاستشارات&nbsp;</p>\r\n\r\n<p dir=\"rtl\" style=\"text-align:center\">&nbsp;على مستوى الوطن العربي</p>\r\n\r\n<p dir=\"rtl\"><strong>خدماتنا :</strong></p>\r\n\r\n<p dir=\"rtl\"><span style=\"font-size:14px\"><strong>1 - الدورات المسجلة</strong> </span>: وهي الدورات المسجلة الجاهزة على شكل مقاطع فيدو، هي مكتبة كبيرة تحتوي مئات من الدورات المسجلة الجاهزة،&nbsp; والتي تستطيع مشاهدتها &nbsp;بأي وقت ومن أي مكان وبلا حدود وتعتبر بوابة التعليم الذاتي أي أنك تستطيع أن تتدرب بنفسك. وتستطيع الحصول على هذه الخدمة من خلال عمل اشتراك</p>\r\n\r\n<p dir=\"rtl\">طريقة عمل اشتراك بالدورات المسجلة :</p>\r\n\r\n<ol dir=\"rtl\">\r\n	<li>قم بفتح حساب جديد مجاني ( حساب متدرب)</li>\r\n	<li>قم بتسجيل الدخول الى حسابك</li>\r\n	<li>من أعلى الصفحة الرئيسية اضغط على لوحة التحكم</li>\r\n	<li>من لوحة التحكم اضغط على الاشتراك بالدورات المسجلة</li>\r\n	<li>اختر فترة الاشتراك شهري أو سنوي ثم أتمم عملية الدفع</li>\r\n	<li>الان أنت جاهز للتدريب الذاتي، ارجع الى الصفحة الرئيسية وابدأ بحضور ومشاهدة مئات الدورات</li>\r\n</ol>\r\n\r\n<p dir=\"rtl\">&nbsp;</p>\r\n\r\n<p dir=\"rtl\"><span style=\"font-size:14px\"><strong>2 -</strong></span>&nbsp;<strong>الدورات المباشرة ( اونلاين )</strong> : هي الدورات التي تتم مباشرة بين المدرب وبين المتدربين بشكل متزامن والمعلن عنها على الصفحة الرئيسية لموقعنا الالكتروني، يوجد منها دورات مجانية ومنها دورات مدفوعة</p>\r\n\r\n<ul dir=\"rtl\">\r\n	<li>إذا كان لديك حساب معنا قم بتسجيل الدخول وإذا لم يكن لديك حساب قم بإنشاء حساب جديد</li>\r\n	<li>اذهب الى الصفحة الرئيسية للموقع واضغط على (الدورات الاونلاين)</li>\r\n	<li>اختر الدورة التي تريد التسجيل فيها ثم اضغط على زر (التسجيل في هذه الدورة)</li>\r\n	<li>إذا كانت الدورة مجانية وبعد الضغط على زر التسجيل في هذه الدورة تكون أنت الان جاهز وقد حجزت مقعدك وإذا كانت الدورة مدفوعة عليك إتمام عملية الدفع ثم ستكون أنت جاهز وحجزت مقعدك بالدورة</li>\r\n	<li>انتظر الى حين وصول وقت الدورة ثم قم بعمل تسجيل الدخول الى حسابك واذهب الى لوحة التحكم واضغط على دوراتي الاونلاين ثم اضغط على الدورة لتحصل على رابط الدخول الى المحاضرة</li>\r\n</ul>\r\n\r\n<p dir=\"rtl\">&nbsp;</p>\r\n\r\n<p dir=\"rtl\"><span style=\"font-size:14px\"><strong>3 -</strong></span>&nbsp;<strong>الحصول على شهادات رقمية (ملف بصيغة </strong><strong><span dir=\"LTR\">PDF</span></strong><strong> )</strong><span style=\"font-size:14px\">&nbsp;</span></p>\r\n\r\n<ul dir=\"rtl\">\r\n	<li>تستطيع الحصول على شهادة تدريب للدورات المسجلة والدورات التفاعلية</li>\r\n	<li>قم بعمل تسجيل الدخول واذهب الى لوحة التحكم</li>\r\n	<li>اختر شهادات الدورات المسجلة وسوف تظهر لديك الدورات المسجلة التي أتممت مشاهدتها</li>\r\n	<li>أو اختر شهادات الدورات الاونلاين وسوف تظهر لديك الدورات التي حضرتها&nbsp;</li>\r\n	<li>اضغط على الدورة وأتمم عملية الدفع ثم ارجع الى نفس الدورة وقم بتنزيل الشهادة فوراً على جهازك</li>\r\n</ul>\r\n\r\n<p dir=\"rtl\">&nbsp;</p>\r\n\r\n<p dir=\"rtl\"><span style=\"font-size:14px\"><strong>4- الاستشارات الخاصة &nbsp;(اونلاين)&nbsp;</strong></span></p>\r\n\r\n<p dir=\"rtl\">قم بانشاء حساب ثم ابحث بالاستشارات واحجز موعد&nbsp;</p>\r\n\r\n<p dir=\"rtl\">&nbsp;</p>\r\n\r\n<p dir=\"rtl\">&nbsp;</p>\r\n\r\n<p dir=\"rtl\" style=\"text-align:center\"><span dir=\"RTL\">منصة النمط&nbsp;</span></p>\r\n\r\n<p dir=\"rtl\" style=\"text-align:center\">تابعة لشركة النمط المتقدم للتدريب</p>\r\n\r\n<p dir=\"rtl\" style=\"text-align:center\">شركة اردنية&nbsp; ذات مسئولية محدودة&nbsp;</p>\r\n\r\n<p dir=\"rtl\" style=\"text-align:center\">مرخصة لدى وزارة الصناعة والتجارة - ترخيص رقم 22468</p>\r\n\r\n<p dir=\"rtl\" style=\"text-align:center\"><strong><span dir=\"RTL\">الاردن - عمان&nbsp;</span></strong></p>\r\n\r\n<p dir=\"rtl\" style=\"text-align:center\">info@alnamat.com&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;00962795144553&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<a href=\"http://www.elnamat.com\"><span dir=\"LTR\">www.elnamat.com</span></a></p>\r\n\r\n<p dir=\"rtl\" style=\"text-align:center\">&nbsp;</p>', NULL, '<p dir=\"RTL\"><strong>التزامات حسابك</strong></p>\r\n\r\n<p dir=\"RTL\">سياسة الخصوصية هذه توفر طريقة جمع البيانات الخاصة بك بالطريقة المستخدمة من قبل شركة النمط المتقدم للتدريب، عن طريق الدخول إلى الخدمات التي تقدمها شركة النمط المتقدم للتدريب إنك توافق على جمع واستخدام البيانات الخاصة بك عن طريق شركة النمط المتقدم للتدريب، وبعض مقدمي الخدمة طرف ثالث بالطريقة المنصوص عليها في سياسة الخصوصية هذه. إذا كنت لا توافق على سياسة الخصوصية هذه، يرجى عدم استخدام الموقع الالكتروني لشركة النمط المتقدم للتدريب. من خلال قبول سياسة الخصوصية أثناء التسجيل، يجب أن توافق صراحة على استخدامنا والكشف عن المعلومات الشخصية الخاصة بك وفقاً لسياسة الخصوصية هذه. يتم تضمينها في سياسة الخصوصية هذه و تخضع لشروط اتفاقية المستخدم<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\"><strong>حماية الخصوصية الخاصة بك مع</strong> <strong>شركة النمط المتقدم للتدريب</strong></p>\r\n\r\n<p dir=\"RTL\">تقدم شركة النمط المتقدم للتدريب خدمة تقديم الدورات المسجلة والمباشرة من خلال موقعها الالكتروني. نريدك أن تشعر بالراحة عند استخدام موقعنا و تشعر بالأمان عند مشاركتك المعلومات الخاصة بك معنا، و بالتالي نحن فخورون للغاية بالتزامنا لحماية خصوصيتك. يرجى مواصلة قرأة السياسة التالية لفهم كيف يتم التعامل مع المعلومات الشخصية الخاصة بك كما تمكنك من الإستفادة الكاملة من موقعنا<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\"><strong>ضمان الخصوصية الخاصة بك مع شركة النمط المتقدم للتدريب</strong></p>\r\n\r\n<p dir=\"RTL\">شركة النمط المتقدم للتدريب تلتزم بعدم بيع أو تأجير معلوماتك الشخصية لأي طرف ثالث (بإستثناء ماهو منصوص عليه في سياسة الخصوصية هذه) دون موافقتك. نحن و / أو المخولين مزودي الخدمة طرف ثالث المخولين لإستخدام المعلومات الشخصية التي قدمتها لنوفر لك الخدمات التي نقدمها<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\"><strong>الطرف الثالث &ndash; مزودي الخدمة</strong></p>\r\n\r\n<p dir=\"RTL\">نحن نوظف شركات أخرى و أفراد لأداء المهام نيابة عنا. ومن الأمثلة على ذلك مباشرة الطلبات، إرسال البريد الإلكتروني، تحليل البيانات، تقديم المساعدة والتسويق، تقديم نتائج البحث، تجهيز مدفوعات بطاقات الائتمان. لديهم إمكانية الوصول إلى المعلومات الشخصية اللازمة لأداء وظائفهم من أجل متابعة سير العمل.</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\"><strong>المعلومات التي يمكن جمعها منك</strong></p>\r\n\r\n<p dir=\"RTL\">شركة النمط المتقدم للتدريب تقوم يجمع المعلومات التي قدمت من خلالكم في جنباً إلى جنب مع المعلومات التي عرفناها عنك من خلال زيارة موقعنا واستخدامك لخدماتنا. نحن أيضاً نقوم بجمع المعلومات عن المعاملات التي تقوم بها بما في ذلك تفاصيل بطاقات الدفع المستخدمة. قد نقوم بجمع معلومات إضافية فيما يتعلق بمشاركتكم في أي عروض أو المسابقات التي نوفرها و المعلومات التي تقدمها تعطينا تغذية لإستكمال الملف الشخصي الخاص بك. نحن نراقب أيضاً أنماط حركة المرور للعملاء و استخدام الموقع، و التي تمكننا من تحسين الخدمة التي نقدمها. و سوف نقوم بجمع المعلومات الضرورية فقط وذات الصلة لنا لنقدم لك الخدمات المتاحة على الموقع<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">قد نقوم بجمع المعلومات الشخصية التالية عنك مثل<span dir=\"LTR\">:</span></p>\r\n\r\n<ul>\r\n	<li dir=\"RTL\">الإسم بما في ذلك الإسم الأول وإسم العائلة</li>\r\n	<li dir=\"RTL\">رقم الهاتف الجوال وتفاصيل الإتصال</li>\r\n	<li dir=\"RTL\">الملف الشخصي الديموغرافي ( مثل العمر، العنوان)</li>\r\n	<li dir=\"RTL\">البريد الالكتروني</li>\r\n	<li dir=\"RTL\">بيانات البنك الخاص بك</li>\r\n	<li dir=\"RTL\">بينات بطاقات الدفع الالكتروني</li>\r\n</ul>\r\n\r\n<p dir=\"RTL\">يمكنك إنهاء حسابك في أي وقت. ومع ذلك قد تبقى معلوماتك المخزنة في الأرشيف على خدماتنا حتى بعد الحذف أو إنهاء حسابك<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\"><strong>تفاصيل بطاقة الائتمان</strong></p>\r\n\r\n<p dir=\"RTL\">نحن لا نبقي أي تفاصيل بطاقة الائتمان في قاعدة البيانات المتوفرة لدينا أو السيرفر. من المهم بالنسبة لك الحماية ضد وصول غير المصرح لهم من خلال كلمة المرور الخاصة بك أو الكمبيوتر الخاص بك. تأكد من تسجيل الخروج عند الانتهاء من استخدام جهاز كمبيوتر أو أي جهاز تقوم باستخدامه للوصول الى موقعنا الالكتروني.</p>\r\n\r\n<p dir=\"RTL\"><strong>استخداماتنا لمعلوماتك</strong></p>\r\n\r\n<p dir=\"RTL\">نحن نستخدم معلوماتك الشخصية ومعلومات الاتصال في<span dir=\"LTR\">:</span></p>\r\n\r\n<ul>\r\n	<li dir=\"RTL\">التواصل معكم كلما كان ذلك ضرورياً</li>\r\n	<li dir=\"RTL\">تزويد الطلبات / الخدمات المطلوبة من قبلك</li>\r\n	<li dir=\"RTL\">الاتصال بكم لعمل مسح أو استفتاء</li>\r\n	<li dir=\"RTL\">لإعلامك بأي شيء جديد أو مهم</li>\r\n	<li dir=\"RTL\">لإرسال إعلانات ترويجية من الرعاة المعلنين لدينا أو مسابقات</li>\r\n</ul>\r\n\r\n<p dir=\"RTL\"><strong>من الذي يسمح له استخدام الموقع الالكتروني لشركة النمط المتقدم للتدريب؟</strong></p>\r\n\r\n<p dir=\"RTL\">شركة النمط المتقدم للتدريب لا تسمح باستخدام موقعها وخدماتها إذا كنت دون سن 18 عاما، قد تتصفح موقع شركة النمط المتقدم للتدريب ولكن لا يمكنك الاشتراك واستخدام خدماتنا دون وصاية أحد الوالدين<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\"><strong>المعلومات التي يمكنك الوصول إليها</strong></p>\r\n\r\n<p dir=\"RTL\">جميع المعلومات المتاحة على الموقع والتي تشمل الدورات المسجلة على المنصة وذلك بعد إتمام عملية الاشتراك والدفع، بحيث تستطيع مشاهدة الدورات ولكن بدون تحميلها على جهازك الخاص.</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\"><strong>متى يتم الإفصاح عن المعلومات الخاصة بك</strong></p>\r\n\r\n<p dir=\"RTL\">لن نستخدم معلوماتك الشخصية لأي غرض آخر سوى إتمام العمل معك. نحن لا نؤجر أو نبيع المعلومات الشخصية الخاصة بك، ولن نكشف عن أي معلومات شخصية إلى أي طرف ثالث إلا إذا<span dir=\"LTR\">:</span></p>\r\n\r\n<ul>\r\n	<li dir=\"RTL\">أن يكون لدينا إذن منك</li>\r\n	<li dir=\"RTL\">لتوفير المنتجات والخدمات التي طلبتها</li>\r\n	<li dir=\"RTL\">للمساعدة في تحقيق ومنع إتخاذ إجراءات تتعلق بأنشطة غير مشروعة وغير قانونية، والمشتبه بهم بالاحتيال، خطراً على سلامة أو أمن أي شخص، انتهاكات شروط استخدام شركة النمط المتقدم للتدريب أو للدفاع ضد المطالبات القانونية<span dir=\"LTR\">.</span></li>\r\n	<li dir=\"RTL\">ظروف خاصة مثل الامتثال لأوامر الإستدعاء، أوامر المحكمة، طلبات / أمر من السلطة القانونية أو وكالات إنفاذ القانون التي تتطلب مثل هذا الكشف<span dir=\"LTR\">.</span></li>\r\n</ul>\r\n\r\n<p dir=\"RTL\"><strong>ماهي الخيارات المتاحة لك بخصوص جمع واستخدام وتوزيع المعلومات الخاصة بك؟</strong></p>\r\n\r\n<p dir=\"RTL\">تزويد المعلومات الشخصية طوعية تماماً. ويمكنك عدم اتاحة بياناتك في التسويق/ الترويج/النشرات الإخبارية<span dir=\"LTR\">. </span>تحتفظ شركة النمط المتقدم للتدريب لنفسها بحق أن ترسل لك بعض الاتصالات والخدمات ذات الصلة، والتي تعتبر جزء من حساب شركة النمط المتقدم للتدريب الخاص بك مع سهولة إلغاء الإشتراك. تستطيع القيام بتحديث المعلومات الخاصة بك و تغيير إعدادات حسابك في أي وقت<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">تستطيع بأي وقت الغاء حسابك وبياناتك من الموقع، ومع ذلك قد تبقى معلوماتك المخزنة في الأرشيف على خدماتنا حتى بعد الحذف أو إنهاء حسابك<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">إذا كنا نخطط لإستخدام معلوماتك الشخصية لأية أغراض تجارية، سنقوم بإعلامك في الوقت في الوقت الذي نقوم بجمع هذه المعلومات و نسمح لك لإختيار عدم المشاركة بمعلوماتك التي تستخدم لهذه الأغراض<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\"><strong>الحماية</strong></p>\r\n\r\n<p dir=\"RTL\">رغم أننا سوف نعمل على الحفاظ على سرية معلوماتك الشخصية، لايمكن أن يكون الارسال الذي يتم بواسطة شبكة الإنترنت أن يكون آمن تماماً. باستخدام هذا الموقع، فإنك توافق على أننا لا نتحمل أية مسؤولية عن الإفصاح عن المعلومات الخاصة بك بسبب أخطاء في الإرسال أو أعمال غير مصرح بها لأطراف ثالثة<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\"><strong>الوصول أو تغيير معلومات التعريف الشخصية الخاصة بك</strong></p>\r\n\r\n<p dir=\"RTL\">لحماية الخصوصية والأمن، سوف نتحقق من هويتك قبل منح الوصول أو إجراء تغييرات على معلومات التعريف الشخصية. إذا كت قد سجلت ملفك الشخصي على شركة النمط المتقدم للتدريب، يطلب اسم المستخدم الخاص بك وكلمة المرور من أجل الوصول إلى معلومات ملفك الشخصي<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">نحن نحتفظ بالحق في تغيير أو تحديث سياستنا في أي وقت. مثل هذه التغييرات يجب أن تكون فعالة فور إرسالها على هذا الموقع. يمكن تقديم وجهات نظركم، إقتراحاتكم إن وجدت عن طريق تقديم ملاحظاتك باستخدام نموذج&nbsp;اتصل بنا.</p>', '<div>\r\n<p>Your account obligations<br />\r\nThis privacy policy provides the method for collecting your data in the manner used by Advanced Pattern Training Company, by entering the services provided by Advanced Pattern Training Company, you consent to the collection and use of your data by Advanced Pattern Training Company, and some third party service providers in the manner set forth in this Privacy Policy. If you do not agree to this Privacy Policy, please do not use the Advanced Style Training Company&#39;s website. By accepting the Privacy Policy during registration, you expressly consent to our use and disclosure of your personal information in accordance with this Privacy Policy. They are included in this Privacy Policy and are subject to the terms of the User Agreement.<br />\r\nProtect your privacy with Advanced Style Training Company<br />\r\nThe Advanced Style Training Company offers the service of providing registered and direct courses through its website. We want you to feel comfortable using our site and feel safe sharing your information with us, so we are very proud of our commitment to protecting your privacy. Please continue to read the following policy to understand how your personal information is handled and to enable you to take full advantage of our site.<br />\r\nEnsure your privacy with Advanced Style Training Company<br />\r\nAdvanced Style Training Company is committed not to sell or rent your personal information to any third party (except as provided in this Privacy Policy) without your consent. We and/or authorized third party service providers are authorized to use the personal information you provide to provide you with our services.<br />\r\nThird Party - Service Providers<br />\r\nWe employ other companies and individuals to perform tasks on our behalf. Examples include directing orders, sending email, analyzing data, providing marketing assistance, providing search results, and processing credit card payments. They have access to personal information necessary to perform their jobs in order to follow the workflow.</p>\r\n\r\n<p><br />\r\nInformation that may be collected from you<br />\r\nAdvanced Style Training Company collects the information provided by you in conjunction with the information we know about you by visiting our website and using our services. We also collect information about the transactions you make, including details of the payment cards used. We may collect additional information in connection with your participation in any offers or contests that we offer and the information you provide gives us a feed to complete your profile. We also monitor customer traffic and site usage patterns, which enable us to improve our service. We will only collect information that is necessary and relevant for us to provide you with the services available on the Site.<br />\r\nWe may collect the following personal information about you such as:<br />\r\n&bull; Name including first and last name<br />\r\n&bull; Mobile phone number and contact details<br />\r\n&bull; Demographic profile (eg age, address)<br />\r\n&bull;&nbsp;&nbsp; &nbsp;E-mail<br />\r\n&bull; Your bank data<br />\r\n&bull; Evidence of electronic payment cards<br />\r\nYou can terminate your account at any time. However, your information stored in archives on our services may remain even after deletion or termination of your account.<br />\r\nCredit Card Details<br />\r\nWe do not keep any credit card details in our database or server. It is important for you to protect against unauthorized access through your password or your computer. Be sure to sign out when you have finished using a computer or other device you use to access our website.<br />\r\nOur uses of your information<br />\r\nWe use your personal and contact information to:<br />\r\n&bull; Communicate with you whenever necessary<br />\r\n&bull; Providing the requests / services requested by you<br />\r\n&bull; Contact you to conduct a survey or poll<br />\r\n&bull; To notify you of anything new or important<br />\r\n&bull; To send you promotional advertisements from our advertisers or contests<br />\r\nWho is allowed to use the Advanced Mode Training Company&#39;s website?<br />\r\nAdvanced Style Training Inc. does not allow the use of its website and services If you are under 18 years of age, you may browse the Advanced Style Training Corporation website but you cannot sign up and use our Services without parental guardianship.<br />\r\nInformation you can access<br />\r\nAll the information available on the site, which includes the courses registered on the platform, after completing the subscription and payment process, so that you can view the courses, but without downloading them to your own device.</p>\r\n\r\n<p>When is your information disclosed?<br />\r\nWe will not use your personal information for any purpose other than to complete business with you. We do not rent or sell your personal information, and we will not disclose any personal information to any third party unless:<br />\r\n&bull; To have your permission<br />\r\n&bull; To provide the products and services you requested<br />\r\n&bull; To assist in the investigation and prevention of actions relating to illegal and illegal activities, suspected fraud, a threat to the safety or security of any person, violations of the Advanced Mode Training Company Terms of Use or to defend against legal claims.<br />\r\n&bull; Special circumstances such as compliance with subpoenas, court orders, requests/order from a legal authority or law enforcement agencies that require such disclosure.<br />\r\nWhat choices are available to you regarding the collection, use and distribution of your information?<br />\r\nProviding personal information is completely voluntary. You may not make your data available in marketing/promotional/newsletters. Advanced Training Mode Company reserves the right to send you certain communications and related services, which are part of your Advanced Training Mode Company account with the ease of unsubscribing. You may update your information and change your account settings at any time.<br />\r\nYou may at any time cancel your account and data from the site, however your information stored in the archive on our services may remain even after deletion or termination of your account.<br />\r\nIf we plan to use your personal information</p>\r\n</div>', '<p dir=\"rtl\" style=\"text-align: center;\"><span style=\"font-size:18px\">منصة تعليمية للدورات التدريبية&nbsp;<br />\r\nالدورات المسجلة&nbsp;<br />\r\nالدورات التفاعلية (اونلاين)&nbsp;</span></p>\r\n\r\n<p dir=\"rtl\"><br />\r\n<span style=\"font-size:18px\">لماذا معهد النمط؟</span></p>\r\n\r\n<p dir=\"rtl\"><span style=\"font-size:14px\">1-&nbsp;&nbsp; &nbsp;فتح الحساب على موقع معهد النمط مجاني.&nbsp;<br />\r\n2-&nbsp;&nbsp; &nbsp;دخل شهري مستمر ( passive income &nbsp;) : المدربين يحصلون على 60% من عائدات المشتركين (الأرباح) وذلك بناء على &nbsp;عدد دقائق المشاهدات على دورات كل مدرب على حذا للدورات المسجلة. والمدرب يحصل على 85% من رسوم التسجيل للدورات التفاعلية (اونلاين)&nbsp;<br />\r\n3-&nbsp;&nbsp; &nbsp;المرونة وسهولة الاستخدام: لديك شاشة تحكم كاملة (لوحة التحكم) وتستطيع أن تتحكم بدوراتك، إضافة دورات وحذف دورات وتعديل البروفايل وبيانات البنك، أنت المسيطر على بياناتك بالكامل.&nbsp;<br />\r\n4-&nbsp;&nbsp; &nbsp;الشفافية والمصداقية: أنت تستطيع أن تراقب وتتابع عدد المشاهدات التي تتم على دوراتك، ورصيدك، وأرباحك.<br />\r\n5-&nbsp;&nbsp; &nbsp;حقوق الملكية: جميع دوراتك التي تنشرها على المنصة تعود حقوق الملكية لك أنت وليس للمعهد، تستطيع التعديل على عملك أو حذفه من الموقع بأي وقت تشاء.&nbsp;<br />\r\n6-&nbsp;&nbsp; &nbsp;غير حصري: الاتفاقية معنا هي اتفاقية غير حصرية أي بمعنى أنك تستطيع أن تنشر عملك على المواقع الأخرى&nbsp;<br />\r\n7-&nbsp;&nbsp; &nbsp;الحرية المطلقة: أي بمعنى انه لا يوجد شروط صعبة لكي تنشر دوراتك معنا، تستطيع تصميم وتسجيل دوراتك بالمحتوى والمنهج والمواضيع التي تريدها أنت وبالطريقة التي تناسبك، شروطنا بسيطة جداً: أن لا تقل مدة الدورة عن ساعتين، ولا تزيد عن 10 ساعات وأن تكون الدورة من ضمن الاختصاصات الموجودة لدينا، وأن تكون الدورة ذات قيمة ومنفعة عالية.&nbsp;<br />\r\n8-&nbsp;&nbsp; &nbsp;الاستفادة الخاصة من المشتركين بموقع المعهد، أنت تستطيع أن تنشئ بروفايل خاص بك على موقعنا الالكتروني، وسيكون البروفايل متاح لجميع زوار الموقع، وبالتالي تستطيع أن تضع بالبروفايل أعمالك الأخرى، وأن تشجع المشتركين بالموقع على زيارة شغلك الخاص أو موقعك الالكتروني، وتحصل على ربح خاص بك دون أي عمولة لنا.&nbsp;<br />\r\n9-&nbsp;&nbsp; &nbsp;توفير الخدمة الذاتية، تستطيع أن تقوم بنفسك باستخدام موقعنا الالكتروني دون الرجوع الينا، أنت بنفسك تقوم بفتح الحساب ونشر الدورات على الموقع. &nbsp;<br />\r\n10-&nbsp;&nbsp; &nbsp;إمكانية تقديم دورات تفاعلية (اونلاين)&nbsp;<br />\r\n11-&nbsp;&nbsp; &nbsp;الحصول على شهادة خبرة&nbsp;<br />\r\n12-&nbsp;&nbsp; &nbsp;الحصول على شهادة مدرب معتمد&nbsp;</span></p>\r\n\r\n<p dir=\"rtl\"><span style=\"font-size:18px\">طريقة العمل</span></p>\r\n\r\n<p dir=\"rtl\"><span style=\"font-size:14px\">1-&nbsp;&nbsp; &nbsp;قم بفتح حساب مدرب على موقعنا الالكتروني www.elnamat.com<br />\r\n2-&nbsp;&nbsp; &nbsp;قم بتسجيل دوراتك على شكل مقاطع فيديو ( الدورة تحتوي مجموعة دروس تعليمية وكل درس يكون مقطع فيديو) ويمكن استخدام تطبيقات معينة لتسجيل دورتك التدريبية وصناعة الفيديو، مثل تطبيق الزووم &nbsp; &nbsp; &nbsp;Zoom Cloud Meeting<br />\r\n3-&nbsp;&nbsp; &nbsp;افتح موقعنا الالكتروني وقم بتسجيل الدخول الى حسابك ثم اذهب الى لوحة التحكم ثم الى الدورات ثم إضافة دورة جديدة، قم بتعبئة بيانات الدورة وقم بتحميل الفيديوهات ( الدروس) التي سجلتها قبل ذلك.&nbsp;<br />\r\n4-&nbsp;&nbsp; &nbsp;انتظر أرباحك&nbsp;</span></p>\r\n\r\n<p dir=\"rtl\"><span style=\"font-size:18px\">الشروط</span><br />\r\n<span style=\"font-size:14px\">1-&nbsp;&nbsp; &nbsp;يجب أن يكون المحتوى الذي تقدمه حصري بك وذو فائدة وقيمة عالية للمشتركين، حيث تخضع كل دورة الى تقييم من طرف الطلاب المشتركين بالموقع، الدورات التي تقييمها مرتفع ستكون لها الاولوية بمحركات البحث ومحرك البحث الخاص بالمنصة.&nbsp;<br />\r\n2-&nbsp;&nbsp; &nbsp;يجب أن يكون موضوع الدورة من ضمن الاختصاصات المتوفرة على موقعنا الالكتروني .&nbsp;<br />\r\n3-&nbsp;&nbsp; &nbsp;يجب أن لا تقل مدة الدورة (مجموع الفيديوهات الخاصة بنفس الدورة ) عن ساعتين ولا تزيد عن 10 ساعات، باستثناء قسم (دورات للأطفال) فيمكن أن تكون مدة الدورة أي مدة تريدها بحيث لا تقل عن نصف ساعة. ويجب أن لا تقل مدة كل درس (فيديو) عن 10 دقائق باستثناء أول درس (المقدمة)&nbsp;<br />\r\n4-&nbsp;&nbsp; &nbsp;يجب أن لا يزيد حجم كل فيديو عن &nbsp;180 MB&nbsp;<br />\r\n5-&nbsp;&nbsp; &nbsp;يجب أن يكون نوع الفيديو الذي تحمله على المنصة أحد الأنواع (الامتدادات) التالية: .MP4,.FLV,.ogg,.webm<br />\r\n6-&nbsp;&nbsp; &nbsp;يجب أن لا تحتوي الدورة على الترويج أو الاشارة الى المواقع أو الشركات الاخرى.&nbsp;</span></p>\r\n\r\n<p dir=\"rtl\"><br />\r\n<span style=\"font-size:18px\">الارشادات</span></p>\r\n\r\n<p dir=\"rtl\"><span style=\"font-size:14px\">1.&nbsp;&nbsp; &nbsp;احرص على الالتزام بموضوع الدورة ولا تخرج عن الموضوع، ولا تتكلم بمواضيع جانبية وخصوصاً مواضيع متعلقة بالسياسة أو العنصرية أو الطائفية أو الدعوة لحزب أو تنظيم معين، .... الخ. سيتم رفض أو حذف أي دورة فيها كلام إضافي غير موضوع الدورة.&nbsp;<br />\r\n2.&nbsp;&nbsp; &nbsp;في بداية الدورة (بالدرس الأول) بالدقيقة الأولى أعط نبذه عن نفسك وعن أهمية الدورة من أجل جذب الطلاب لمشاهدة الدورة الخاص بك. أول دقيقة مهمة جداً لأنّ الطالب سوف يقرر أن يشاهد دورتك أو لا يشاهدها. &nbsp;<br />\r\n3.&nbsp;&nbsp; &nbsp;حاول أن يكون حجم مقاطع الفيديو أقل ما يمكن من أجل سهولة وسرعة التحميل ومن أجل أن يستطيع الطالب مشاهدة الفيديو بدون تقطع أو بدون تأخير ( لأن ذلك سوف يجعل الطالب اغلاق الفيديو وتخسر مشاهدة الطالب وقد يكتب تعليق سيء) ولذلك ننصحك باستخدام برمجيات معينة من أجل تسجيل فيديوهات دورتك بأقل حجم ممكن للملف الأفضل أن يكون حجم الملف أقل من 150 MB &nbsp; حتى تضمن نجاح دورتك. &nbsp;<br />\r\n4.&nbsp;&nbsp; &nbsp;الشرح باللغة العربية فقط ( باستثناء دورات اللغات) ويجوز أن تكون شرائح العرض باللغة الإنجليزية، اشرح باللهجة العادية البسيطة&nbsp;<br />\r\n5.&nbsp;&nbsp; &nbsp;بالنسبة للدورات المسجلة لا يوجد سعر للدورة، ولكن المتدربين يدفعون مبلغ شهري للاشتراك بالمنصة مقابل مشاهدة جميع الدورات، والمدرب يربح من خلال عدد دقائق المشاهدات. أما الدورات التفاعلية فيقوم المدرب بتحديد السعر و وقت وموعد الدورة ويحصل على عائد 85% من رسوم التسجيل بالدورة.&nbsp;<br />\r\n6.&nbsp;&nbsp; &nbsp;لمزيد من الارشادات ادخل على لوحة التحكم في الاسفل اضغط على فيديوهات ارشادية والتي تحتوي على مجموعة فيديوهات لمعرفة كيفية تسجيل الدروس التعليمية، وتصغير حجم الملفات، وكيفية نشر الدورات على المنصة ومهارات أخرى عديدة.&nbsp;</span></p>\r\n\r\n<p dir=\"rtl\"><span style=\"font-size:18px\">الدخول الى الحساب ولوحة التحكم&nbsp;</span><br />\r\n<span style=\"font-size:14px\">من الشاشة الرئيسية في الأعلى اضغط على (تسجيل الدخول)&nbsp;<br />\r\nقم بإدخال بريدك الالكتروني وكلمة السر واضغط على الزر ( تسجيل الدخول)&nbsp;</span></p>\r\n\r\n<p dir=\"rtl\"><span style=\"font-size:14px\">من خلال الأوامر الموجودة من الشاشة من اليمين تستطيع التحكم بصفحتك وهي كما يلي :&nbsp;</span></p>\r\n\r\n<p dir=\"rtl\"><span style=\"font-size:14px\">الذهاب للموقع: يرسلك الى الشاشة الرئيسية لموقعنا الالكتروني.<br />\r\n&nbsp;الرئيسية: يرسلك الى الشاشة الرئيسية للوحة التحكم الخاصة بك.<br />\r\nحسابي: تستطيع تغيير كلمة المرور، الغاء الحاسب، ادخال البيانات الشخصية (البروفايل) &nbsp;ورفع المستندات والشهادات، يجب عليك رفع المستندات والشهادات للتحقق من هويتك كشرط أساسي من أجل تحويل أرباحك على البنك.<br />\r\n&nbsp;معلومات البنك: ادخل بيانات البنك الذي تريد أن تستلم عليه أرباحك سواء كان حساب البنك باسمك (وهذا أفضل) أو باسم شخص آخر.&nbsp;<br />\r\nمعلومات western union : قم بتعبئة البيانات في هذه الشاشة اذا لم يكن لديك حساب بالبنك (اترك بيانات البنك فارغة وقم بتعبئة البيانات الخاصة بالتحويل من خلال western union)<br />\r\nالدورات المسجلة: إضافة دورات جديدة، التعديل على الدورات القديمة، الغاء الدورات.<br />\r\nالدورات التفاعلية: إضافة عرض لدورة تفاعلية (اونلاين)&nbsp;<br />\r\nأرباحي : يتم احتساب الأرباح كل شهر، وهنا تستطيع متابعة أرباحك الشهرية، وعندما يتم تحويل الأرباح الى حسابك بالبنك يتم تصفير الأرباح ( إعادة الأرباح الى الصفر برصيد المحفظة ) من أجل إعادة احتساب المشاهدات والارباح من جديد.&nbsp;<br />\r\nتحويلات البنك: أرشيف من أجل رصد جميع الحركات (التحويلات البنكية) والتي تتم من شركة النمط الى حسابك بالبنك الموجود (حسب بيانات البنك التي أدخلتها على حسابك بموقعنا).&nbsp;<br />\r\nالمشاهدات: لمتابعة عدد دقائق المشاهدات التي تتم على دوراتك، سوف تتجمع المشاهدات حتى تصل قيمة أرباحها الى 100 دولار، ثم بعد اجراء عملية تحويل المبلغ الى حسابك بالبنك سيتم تصفير المشاهدات ( جعلها صفر لجميع دوراتك) حتى يتم إعادة رصد المشاهدات من جديد لاحتساب الأرباح الجديدة، تتم هذه الدورة ابتداء من بداية عملك معنا الى كل عملية تحويل الى البنك ثم نرجع بالاحتساب من جديد من تاريخ التحويل الى تاريخ التحويل الآخر.&nbsp;<br />\r\nاتفاقية المدرب: الاتفاقية مع شركة النمط المتقدم للتدريب، يجب عليك الاطلاع على الاتفاقية بشكل مستمر لملاحظة أي تعديلات قد تتم على الاتفاقية، استمرارك بالعمل معنا يعني موافقتك على الاتفاقية والتعديلات التي تتم عليها، سيتم وضع تاريخ آخر تعديل بنهاية الاتفاقية.&nbsp;<br />\r\nإرشادات المدرب: للاطلاع على الارشادات والتعليمات هذه والتي تساعدك على تطوير وتحسين عملك معنا وزيادة أرباحك.&nbsp;<br />\r\nفيديوهات ارشادية: &nbsp;مجموعة فيديوهات تعليمية للمدرب من أجل فهم طريقة العمل وتنمية مهارات المدرب&nbsp;<br />\r\nالشهادات: للحصول على شهادة الخبرة وشهادة مدرب معتمد &nbsp;</span></p>\r\n\r\n<p dir=\"rtl\">&nbsp;</p>\r\n\r\n<p dir=\"rtl\"><span style=\"font-size:18px\">أنواع المدربين في معهد النمط</span></p>\r\n\r\n<p dir=\"rtl\"><br />\r\n<span style=\"font-size:14px\">المدرب المبتديء : هو المدرب الذي قام بنشر دورة واحدة &nbsp;(مقبولة) على المنصة أو أكثر&nbsp;<br />\r\nالمدرب المتعاون : هو المدرب الذي قام بنشر 3 دورات &nbsp;(مقبولة) على المنصة أو أكثر&nbsp;<br />\r\nالمدرب المعتمد : هو المدرب الذي قام بنشر 5 دورات (مقبولة) على المنصة أو أكثر وقام بتقديم دورتين تفاعليتين على الأقل&nbsp;</span></p>\r\n\r\n<p dir=\"rtl\"><span style=\"font-size:14px\">المميزات التي يمنحها &nbsp;معهد النمط للمدرب المبتديء:&nbsp;<br />\r\n1-&nbsp;&nbsp; &nbsp;إمكانية المشاركة في تقديم الدورات التفاعلية (اونلاين) والحصول على &nbsp;نسبة ربح 85% من رسوم الدورات أو الحصول على نسبة 85% من رسوم الشهادات في حال كانت الدورة مجاناً.&nbsp;<br />\r\nالمميزات التي يمنحها &nbsp;معهد النمط للمدرب المتعاون:&nbsp;<br />\r\n1.&nbsp;&nbsp; &nbsp;مميزات المدرب المبتدئ&nbsp;<br />\r\n2.&nbsp;&nbsp; &nbsp;أولوية ظهور اسم المدرب والدورات التي قام بنشرها على الموقع من قسم (المدربين) &nbsp;<br />\r\n3.&nbsp;&nbsp; &nbsp;شهادة خبرة&nbsp;<br />\r\nالمميزات التي يمنحها &nbsp;معهد النمط للمدرب المعتمد:&nbsp;<br />\r\n1-&nbsp;&nbsp; &nbsp;مميزات المدرب المتعاون&nbsp;<br />\r\n2-&nbsp;&nbsp; &nbsp;شهادة مدرب معتمد&nbsp;</span></p>\r\n\r\n<p dir=\"rtl\"><span style=\"font-size:14px\">تابعنا على صفحة الفيسبوك&nbsp;<br />\r\nhttps://web.facebook.com/alnamattadreeb</span></p>\r\n\r\n<p dir=\"rtl\"><span style=\"font-size:14px\">مع تحيات&nbsp;<br />\r\nإدارة المنصة&nbsp;</span><br />\r\n&nbsp;</p>', '<p dir=\"RTL\" style=\"text-align: center;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>اتفاقية المدرب مع شركة النمط المتقدم للتدريب</strong></p>\r\n\r\n<p dir=\"RTL\" style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">يرجى قراءة ما يلي بعناية، شروط الخدمة هذه، هي اتفاقية ملزمة (&quot;الاتفاقية&quot;) بينك أنت كمدرب وبين شركة النمط المتقدم للتدريب التي مقرها في الأردن.&nbsp;&nbsp;</p>\r\n\r\n<p dir=\"RTL\">قد ترد كلمة (أنت أو المدرب) لتعبّر عنك أنت كمدرب يمتلك محتوى حصري تعليمي خاص به ويكون على شكل مقاطع فيديو أو محتوى نصّي أو صور ويشار اليه هنا بكلمة (العمل) أو (دورة) لنشره على الموقع الالكتروني لشركة النمط المتقدم للتدريب والذي يشار اليه هنا بكلمة (المنصة) أو كلمة (منصتنا) أو كلمة (نحن). كلمة المشترك تشير الى الشخص الذي يقوم بعمل حساب كمشترك على المنصة من أجل مشاهدة العمل بأي وقت ومن أي مكان بالعالم وبلا حدود، المشترك يدفع مبلغ شهري أو سنوي يتم تحديده من طرف المنصة، وقد تقوم المنصة بعمل خصومات على مبلغ الاشتراك الشهري أو السنوي، أو قد تتيح المنصة للمشترك فترة تجريبية مجانية.</p>\r\n\r\n<p dir=\"RTL\">إذا أنت قمت بإنشاء حساب على المنصة، فهذا إقرار منك أنك توافق على شروط هذه الاتفاقية جميعها.</p>\r\n\r\n<p dir=\"RTL\">أنت لك الحق في انشاء حساب مجاني على المنصة، ونشر عملك على المنصة والحصول على أرباح حسب عدد دقائق المشاهدات التي تتم على عملك المنشور على المنصة وعلى أرباح لدوراتك التي تعطيها بشكل متزامن من خلال المنصة، وعلى أرباح للاستشارات التي تعطيها من خلال المنصة، ولك الحق في نشر عملك بأي وقت وإزالة عملك بأي وقت، ولك الحق بمتابعة رصيد أرباحك ومعرفة عدد دقائق المشاهدات التي تتم على عملك الخاص، ومتابعة بياناتك وأرباحك على المنصة من خلال لوحة التحكم الخاصة بك بكل وضوح وشفافية، ولك الحق بأن تحافظ المنصة على سرية بياناتك وعدم استخدامها بغير محل هذه الاتفاقية. ولك الحق بنشر دوراتك على المواقع الأخرى لأن هذه الاتفاقية غير حصرية. ولك الحق بجميع حقوق الملكية الفكرية لعملك وبالتالي المنصة ليست لها الحق بإجراء أي تغيير على العمل أو بنشره بمواقع أخرى دون موافقتك. اذا طلبت بنشر عملك على قناة اليوتيوب التابعة للمنصة و وافقت على ذلك تصبح حقوق الملكية لهذا العمل لمصلحة المنصة فقط.</p>\r\n\r\n<p dir=\"RTL\">يتم توزيع الأرباح (عائدات المشتركين من الاشتراك الشهري والسنوي في الدورات المسجلة) وبعد خصم مصاريف التحصيل على أساس 40% للمنصة و60% يتم توزيعهم على جميع المدربين في المنصة على أساس عدد دقائق المشاهدات لكل عمل لكل مدرب على حِذا. أمّا بالنسبة للدورات المتزامنة أو الاستشارات أو الحقائب التدريبية التي تعطيها أنت بنفسك فسوف يتم توزيع العائدات منها وبعد خصم مصاريف التحصيل على أساس 15% للمنصة &nbsp;و85% لك أنت.</p>\r\n\r\n<p dir=\"RTL\">المنصة تتيح لك مراقبة عدد المشاهدات على العمل الذي تنشره على المنصة ومتابعة الأرباح، سيتم رصد أرباحك وتجميعها وعندما تصل الى 100 دولار أو أكثر سيتم تحويلها الى حسابك المصرفي الذي تحدده أنت على المنصة، وإذا كان المبلغ المستحق أقل من 100 دولار، سيتم رصد المبلغ الى المواعيد القادمة للتحويل، حيث أننا نقوم بتحويل الأرباح مرة واحدة كل شهر. وباعتبار أن الاشتراك بالمنصة بعملة الدولار الامريكي فان المدرب يقبل باستلام المبلغ على الحساب المصرفي الذي يحدده بالمنصة سواء بنفس العملة أو بعمله أخرى وبسعر الصرف الذي يحدده البنك، وكما يقبل المدرب أي خصومات يخصمها البنك أو الضرائب الحكومية المفروضة على المبلغ إن وجدت.</p>\r\n\r\n<p dir=\"RTL\">أنت تقبل بتحويل أرباحك على الحساب البنكي الذي تحدده أنت بالمنصة سواءً كان الحساب باسمك أو باسم أي شخص آخر، وإذا وجدنا صعوبة أو قيود لتحويل المبلغ على الحساب البنكي، سوف نقوم بالتحويل من خلال (<span dir=\"LTR\">Western Union</span>) أو أي طريقة أخرى مناسبة بعد خصم تكاليف وعمولات التحويل من رصيد أرباحك.</p>\r\n\r\n<p dir=\"RTL\">إنّ حقوق الملكية الفكرية للعمل الخاص بك هو بالكامل لك باستثناء تنازلك عن حق المنصة في إتاحة (نشر) عملك للمشتركين بالمنصة، وتنازلك عن حق المنصة في إتاحة جزء من عملك على جميع مواقع التواصل الاجتماعي الخاصة بنا كالفيسبوك والتويتروقناة اليوتيوب والانستقرام بالاضافة الى بياناتك الشخصية التي تقوم أنت بإدخالها على المنصة بما فيهم صورتك الشخصية. المنصة تتيح للمشتركين بالمنصة مشاهدة العمل من المنصة فقط ولا تتيح لهم عملية تحميل العمل على أجهزتهم، نحن سوف نعمل على حماية عملك حسب امكانياتنا المتاحة ومع ذلك قد يقوم أحد الأشخاص أو أي طرف ثالث بتسجيل عملك ويكون هذا الشخص هو المسؤول عن هذه المخالفة القانونية. أما عملك الذي توافق على نشره على قناتنا باليوتيوب فتكون حقوق الملكية الفكرية للمنصة. لا تعتبر المنصة هي صانعة المحتوى وبالتالي لا تتحمّل الحقوق القانونية أو المسئوليات المترتبة على محتوى العمل. المنصة تتيح لك نشر العمل الخاص بك وإتاحة مشاهدته للمشتركين بالمنصة حول العالم بالإضافة الى أنّ المنصة تتيح اصدار شهادات للمشتركين للدورات المسجلة التي يتم مشاهدتها من على المنصة ضمن رسوم معينة تحددها المنصة، وهذه الرسوم تكون بالكامل من حق المنصة فقط.</p>\r\n\r\n<p dir=\"RTL\">أنت تعتبر المؤلف لعملك (صانع المحتوى) وأنت تعتبر الناشر القانوني لعملك وبالتالي أنت تمتلك حقوق ومسئولية محتوى العمل الذي تنشره على المنصة بالكامل؛ أنت تتحمل جميع المسؤوليات المرتبطة بمحتوى عملك المنشور على المنصة؛ وتتعهد وتؤكد أنه لا يوجد جانب من محتوى عملك ينتهك حقوق شخص أو جهة أو كيان آخر. أنت تتحمل أية مسئولية تتعلق بحقوق الملكية الفكرية العائدة لقيام المنصة بإتاحة العمل للمشتركين حول العالم، وتلتزم بالتعويض عن كل ضرر يلحق بالمنصة من جراء قيام طرف ثالث بالمطالبة بأي مبالغ أو أضرار تتعلق بحق المنصة في إتاحة مشاهدة العمل للمشتركين حول العالم.</p>\r\n\r\n<p dir=\"RTL\">يجب أن يخضع العمل الذي تنشره على المنصة للشروط الاربعة التالية:</p>\r\n\r\n<ol>\r\n	<li dir=\"RTL\" style=\"text-align: right;\">ضمن الاختصاصات المتوفرة على المنصة وذو قيمة للمشتركين وذلك بناءً على تقديرنا الخاص أو بناء على تقييم المشتركين.</li>\r\n	<li dir=\"RTL\" style=\"text-align: right;\">لا يخالف القانون المحلي أو الدولي ولا يخالف الشريعة الإسلامية.</li>\r\n	<li dir=\"RTL\" style=\"text-align: right;\">لا يقل مدة العمل عن ساعة ونصف &nbsp;(لكل دورة تدريبية) ولا يزيد عن عشر ساعات.</li>\r\n	<li dir=\"RTL\" style=\"text-align: right;\">أن يكون العمل حصري بك وغير منقول كلياً أو جزئياً من جهات أو أشخاص آخرين.</li>\r\n</ol>\r\n\r\n<p dir=\"RTL\">يحق للمنصة إزالة أي عمل من المنصة إذا كان العمل يخالف احدى الشروط الأربعة سابقة الذكر، أو شروط هذه الاتفاقية، أو أي جهة ثالثة من ناحية قانونية، أو إذا كان العمل رديء ولا يوجد عليه مشاهدات حسب تقدير المنصة. إذا تم اكتشاف أن العمل أو جزء منه ليس من حق المدرب، فيحق للمنصة بمطالبة المدرب بجميع المبالغ التي حصل عليها من هذا العمل، وحجز جميع المبالغ المعلقة والتي لم يتم تحويلها بعد، وأيضاً تقوم المنصة بتحميل كافة المسئولية القانونية على المدرب.</p>\r\n\r\n<p dir=\"RTL\">أنت مسئول عن صحة جميع البيانات التي تدخلها على المنصة، وأنت مسئول عن الحفاظ على سرية حسابك وبياناتك والحفاظ على كلمة السر للدخول الى حسابك، وإذا تم اختراق حسابك أو سرقته من طرف شخص أخر فنحن غير مسئولين عن ذلك، ويجب عليك ابلاغنا فوراً لمساعدتك على استرداد حسابك. وننصحك بتغيير كلمة السر الخاصة بك كل فترة معينة وعدم إعطاء كلمة السر لأي شخص آخر، وننصحك بالقيام بعمل تسجيل الخروج من حسابك بعد إتمام عملك على المنصة مباشرة. نحن غير مسئولين في حال قام شخص بتسجيل عملك لكي ينتفع منه بنشره على المواقع الأخرى أو بأي طريقة أخرى، وسيبقى لك الحق القانوني بمطالبة أي شخص قام بنسخ عملك، ونحن سوف نساعدك في ذلك.</p>\r\n\r\n<p dir=\"RTL\">&nbsp;يحق للمنصة التغيير على هذه الشروط (الاتفاقية) بأي وقت، وبحيث تكون هذه الشروط (الاتفاقية) متاحة دائماً للمدرب على صفحته الخاصة (لوحة التحكم)، وسوف يتم وضع تاريخ آخر تعديل بنهاية الاتفاقية حتى يستطيع المدرب أن يتابع التغييرات المحتملة على هذه الاتفاقية، ويحق للمدرب أن يقوم بإلغاء نشر جميع أعماله من المنصة إذا لم تناسبه الشروط الجديدة أو التغييرات الجديدة على هذه الاتفاقية، وإذا استمر المدرب بالنشر فهذا يعني انه موافق على الاستمرار بالشروط والتغييرات الجديدة. سوف نعمل جاهدين بأن لا نغيّر بالشروط الا إذا اضطررنا لذلك فقط.</p>\r\n\r\n<p dir=\"RTL\">ظروف القوة القهرية، لن تتحمل المنصة أي مسؤولية عن أي خسارة أو تأخير بسبب الحريق، أو الكوارث الطبيعية، أو فشل في النظام المصرفي، أو انقطاع الكهرباء، أو مشاكل في الاتصالات السلكية واللاسلكية، أو الحروب، أو الإضرابات، أو اندلاع أعمال شغب، أو هجمات الكترونية، أو فشل في اداء البنوك التابعة، أو عطل فني للمنصة، أو أي حوادث أو أحداث ليس لدينا القدرة الكافية على التحكم فيها<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">مدة الاتفاقية بينك وبين المنصة تبدأ بمجرد أن تقوم بإنشاء حساب على المنصة، وتنتهي بإزالة أو تعليق حسابك سواء كان ذلك بإرادتنا أو بإرادتك أنت، وتستطيع بأي وقت إزالة عملك من المنصة، أو اغلاق حسابك بالكامل.&nbsp; وإذا قمت بإغلاق حسابك بالمنصة فسوف تفقد رصيدك من الأرباح الموجود بالمنصة والذي لم يتم تحويله، ولكن سوف نحتفظ بهذا الرصيد للمستقبل، إذا قررت إعادة تفعيل حسابك، يجب عليك أن تتواصل معنا وتخبرنا في ذلك، إذا وافقنا على إعادة التفعيل، سنقوم بتفعيل حسابك وسوف تكمّل معنا على رصيدك السابق، وإذا لم نوافق على التفعيل فسوف تخسر رصيدك ولا يحق لك المطالبة به بأي حال من الأحوال. &nbsp;</p>\r\n\r\n<p dir=\"RTL\">كل نزاع ينشأ حول تفسير أو تنفيذ شروط هذه الاتفاقية يكون من اختصاص محاكم دولة الاردن، ويكون القانون الاردني هو القانون الذي يحكم هذه الاتفاقية.</p>\r\n\r\n<p dir=\"RTL\">&nbsp;تاريخ آخر تعديل: 5/11/2022</p>', NULL, '<p style=\"text-align:right\">&nbsp;</p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:18px\"><strong><span dir=\"RTL\">شروط الاشتراك واستخدام الموقع الالكتروني لمنصة شركة النمط المتقدم للتدريب</span></strong></span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:18px\"><strong><span dir=\"RTL\">الشروط والأحكام </span></strong></span></p>\r\n\r\n<p style=\"text-align:right\">&nbsp;</p>\r\n\r\n<ul>\r\n	<li dir=\"RTL\" style=\"text-align:right\">تُلزمك هذه الاتفاقية (الشروط والأحكام) أنت أو الشركة التي تمثلها (&quot;أنت&quot; أو &quot;الخاص بك&quot;) بالشروط والأحكام المنصوص عليها هنا فيما يتعلق باستخدامك لـ &quot; الموقع الالكتروني لشركة النمط المتقدم للتدريب &quot; أو &quot; المنصة <span dir=\"LTR\">&quot;</span> أو &quot;الشركة&quot;، جميع المحتويات المعروضة على المنصة (يشار إليها مجتمعة باسم&quot; منتجاتنا أو خدماتنا&quot;). باستخدام أي من منتجات أو خدمات المنصة، فإنك توافق على الالتزام ببنود وشروط هذه الاتفاقية. إذا كنت لا توافق على كل أو جزء من بنود وشروط هذه الاتفاقية، فلا تستخدم منتجات الشركة؛ استمرار استخدامك للمنصة بعد نشر التغييرات على هذه السياسة سيعتبر موافقتك على هذه التغييرات.</li>\r\n</ul>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<ul>\r\n	<li dir=\"rtl\" style=\"text-align:right\">المنصة تقدّم مجموعة من المنتجات وهي: مشاهدة جميع الدورات المسجلة على المنصة بلا حدود مقابل مبلغ 15 دولار أمريكي شهري وقد تقوم المنصة بتحديد مبلغ أقل كعروض ترويجية لتشجيع عدد أكبر من المشتركين ولفترات محدودة، وأيضا عروض أخرى وخصومات على الاشتراك السنوي. للمنصة الحق بتغيير الأسعار بأي وقت، ولك الحق بإلغاء تجديد الاشتراك أو الغاء الحساب بالكامل بأي وقت. أيضاً المنصة توفّر شهادات حضور لهذه الدورات التي قمت بحضورها برسوم إضافية، وكما تتيح المنصة أيضاً حضور الدورات المباشرة (الاون لاين) حسب الأسعار المعلن عنها على المنصة. المنصة هي موقع الكتروني ومنصة رقمية متخصصة في التدريب والتعليم وعرض المحتويات والمصنفات الصوتية المرئية التعليمية والتثقيفية سابقة التصوير، ودورات تدريبية متزامنة.</li>\r\n	<li dir=\"RTL\" style=\"text-align:right\">تستطيع اتمام الاشتراك وعملية الدفع اذا كان لديك بطاقة بنكية من نوع فيزا كارد أو ماستر كارد صادرة من أحدى الدول التالية فقط : الاردن ، السعودية ، قطر ، البحرين ، الكويت، سلطنة عمان، الامارات العربية المتحدة، مصر ، فلسطين ، تونس ، المغرب ، العراق.</li>\r\n</ul>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<ul>\r\n	<li dir=\"RTL\" style=\"text-align:right\">تحتفظ المنصة بالحق في مراجعة هذه الشروط وفقًا لتقديرها الخاص في أي وقت عن طريق نشر التغييرات على موقعها الإلكتروني. استمرار استخدامك للمنتجات على المنصة يعني أنك تقبل هذه التغييرات. يجب عليك زيارة الموقع بانتظام للتأكد من أنك على دراية بأحدث نسخة من الشروط.</li>\r\n</ul>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<ul>\r\n	<li dir=\"RTL\" style=\"text-align:right\">يجوز للمنصة تعديل المنتجات و / أو الخدمات أو التوقف عن توفرها في أي وقت وفقًا لتقديرها الخاص وكما يجوز للمنصة تغيير سعر الاشتراك الشهري أو السنوي بأي وقت، والمشترك يستطيع الاستمرار بتجديد الاشتراك على السعر الجديد أو الغاء تجديد الاشتراك بأي وقت.</li>\r\n</ul>\r\n\r\n<p style=\"text-align:right\">&nbsp;</p>\r\n\r\n<ul>\r\n	<li dir=\"RTL\" style=\"text-align:right\">يحق لك مشاهدة جميع المنتجات (وهي الدورات التدريبية المسجلة المسبقة التصوير) المنشورة على المنصة بأي وقت وبلا حدود، كما يحق لك بإلغاء تجديد الاشتراك بالمنصة بأي وقت، وكما يحق لك بطلب شهادات إكمال الحضور للدورات التي قمت بمشاهدتها برسوم إضافية غير رسوم الاشتراك الشهرية أو السنوية. كما يحق لك أن تقوم بالتسجيل بالدورات الاون لاين حسب رغبتك وضمن رسوم إضافية غير الاشتراك الشهري أو السنوي.</li>\r\n</ul>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<ul>\r\n	<li dir=\"RTL\" style=\"text-align:right\">أنت وحدك المسؤول عن كيفية الوصول واستخدام جميع الخدمات الموجودة على المنصة، إذا اخترت الوصول إلى أو استخدام المنتجات التي تتضمن دفع رسوم ووافقت على الدفع، فستكون مسؤولاً عن دفع تلك الرسوم وجميع الضرائب المرتبطة بهذا الوصول أو الاستخدام. إذا قدمت معلومات بطاقة ائتمان أو معلومات طريقة دفع أخرى لدفع هذه الرسوم، فأنت مخول بموجبه بتقديم هذه المعلومات وتفوض المنصة بموجب هذا الخصم من بطاقتك الائتمانية لدفع الرسوم عند استحقاقها، الرسوم تسحب بشكل شهري أو سنوي حسب خطة التسجيل الخاص بك بشكل تلقائي، والرسوم المسحوبة غير مستردة بأي حال من الأحوال. &nbsp;&nbsp;</li>\r\n</ul>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<ul>\r\n	<li dir=\"RTL\" style=\"text-align:right\">يجب أن يكون كل استخدامك ووصولك وأنشطتك الأخرى المتعلقة بالمنصة والمنتجات متوافقة مع جميع القوانين واللوائح المعمول بها، بما في ذلك، على سبيل المثال لا الحصر، القوانين المتعلقة بحقوق النشر واستخدام الملكية الفكرية الأخرى، وسياسة الخصوصية<span dir=\"LTR\">.</span></li>\r\n</ul>\r\n\r\n<p style=\"text-align:right\">&nbsp;</p>\r\n\r\n<ul>\r\n	<li dir=\"RTL\" style=\"text-align:right\">حقوق الطبع والنشر والحقوق الملكية الفكرية للمحتوى محفوظ للمنصة، ولا يجوز لك إعادة استخدامه أو نشره سواء لأغراض شخصية أو تعليمية أو تجارية، بغير الاستخدام المنصوص عليه في هذه الشروط.</li>\r\n</ul>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<ul>\r\n	<li dir=\"RTL\" style=\"text-align:right\">فيما يتعلق باستخدامك للمنتجات، يجب عليك عدم تقديم معلومات غير صحيحة، ويجب عليك أن لا تعمل أي عمل يقوم بإيقاع الضرر على المنصة بأي شكل من الاشكال، كالاستخدام الخاطئ، أو نشر الفيروسات المخربة، أو القرصنة للمنصة وغير ذلك، او تسجيل الكورسات المنشورة على المنصة وإعادة نشرها على الانترنت أو إعادة نشرها لأشخاص اخرين، وغير ذلك من الأمور التي تسبب الضرر للمنصة.</li>\r\n</ul>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<ul>\r\n	<li dir=\"RTL\" style=\"text-align:right\">المنصة هي مجرد موقع الكتروني بينك أنت وبين المدربين. نحن لا نوظف المدربين ولا نتحمل المسؤولية عن أي تفاعلات بينك وبين المدربين. نحن لسنا مسؤولين عن النزاعات أو المطالبات أو الخسائر أو الأضرار من أي نوع التي قد تنشأ عن أو تتعلق بسلوكك أنت أو سلوك المدربين.</li>\r\n</ul>\r\n\r\n<p style=\"text-align:right\">&nbsp;</p>\r\n\r\n<ul>\r\n	<li dir=\"RTL\" style=\"text-align:right\">المنصة غير مسئولة عن المحتوى المنشور على المنصة بأي شكل من الاشكال، نحن لا نتحكم بالمحتوى، نحن منصة الكترونية تجمع بينك وبين المدربين اللذين ينشرون الدورات التعليمية على المنصة.</li>\r\n</ul>\r\n\r\n<p style=\"text-align:right\">&nbsp;</p>\r\n\r\n<ul>\r\n	<li dir=\"RTL\" style=\"text-align:right\">يجب عليك أن تكتب اسمك بدقة (يفضّل أن تكتب اسمك كما هو بجواز سفرك) من أجل ان يتم طباعة اسمك على الشهادات للدورات التي قمت بإكمال مشاهدتها، وبمجرد أنك قمت بعمل الاشتراك لا تستطيع أن تغير اسمك بعد ذلك.</li>\r\n</ul>\r\n\r\n<p style=\"text-align:right\">&nbsp;</p>\r\n\r\n<p style=\"text-align:right\">&nbsp;</p>\r\n\r\n<ul>\r\n	<li dir=\"RTL\" style=\"text-align:right\">إذا حصل أي عطل في المنصة وتوقفت عن تقديم خدماتها بمدة تزيد عن 15 يوماً، ستقوم المنصة بمنحك شهر مجاني، ولا تتحمل المنصة الأعطال الخارجة عن ارادتها.</li>\r\n</ul>\r\n\r\n<p style=\"text-align:right\">&nbsp;</p>\r\n\r\n<ul>\r\n	<li dir=\"RTL\" style=\"text-align:right\">يجب أن يتجاوز عمرك 18 عامًا، أو إذا لم يكن الأمر كذلك، فلن تستخدم المنتجات إلا بمشاركة وإشراف وموافقة أحد الوالدين أو الوصي القانوني.</li>\r\n</ul>\r\n\r\n<p style=\"text-align:right\">&nbsp;</p>\r\n\r\n<ul>\r\n	<li dir=\"RTL\" style=\"text-align:right\">أنت المسئول عن التسجيل بالمنصة من أجل استخدام المنتجات المنشورة عليها، وحماية حسابك وكلمة المرور، ويجب عليك أن لا تعطي بيانات حسابك لأي شخص أخر، واذا حصل اختراق لحسابك من طرف اخر، فأنت المسئول عن ذلك وعليك ابلاغنا فوراً.</li>\r\n</ul>\r\n\r\n<p style=\"text-align:right\">&nbsp;</p>\r\n\r\n<ul>\r\n	<li dir=\"RTL\" style=\"text-align:right\">خلال استخدامك المنصة أنت تقر أن المعلومات الواردة في استمارة التسجيل صحيحة، بشرط ان تكون هذه المعلومات مطلوبة، وأنت المسئول عن أية خسائر قد تنشأ عن أية معلومات خاطئة او معلومات غير كافية وفي تلك الحالات يتم انهاء الاشتراك. أنت وحدك المسؤول عن كافة الأفكار والآراء والبيانات الشخصية التي تذكرها أثناء استخدامك المنصة وكذلك مسئولا عن كافة المعلومات الشخصية المرسلة، وإن المنصة لن تكون مسؤولة بأي شكل من الأشكال عن تلك البيانات، أو عن الولوج الى أي خدمات مقدمة عبرها يكون غير مصرح بها أو بأي طريقة أخرى غير تلك المحددة بواسطتها، وعدم تغيير البرمجيات بأي طريقة، وتعويض المنصة عن كافة الخسائر المادية والأدبية.</li>\r\n</ul>\r\n\r\n<p style=\"text-align:right\">&nbsp;</p>\r\n\r\n<ul>\r\n	<li dir=\"RTL\" style=\"text-align:right\">أنت توافق على دفع رسوم الاشتراك بالمنصة، او رسوم الدورات الاون لاين التي ترغب بحضورها، أو رسوم الشهادات التي تطلبها، وتفوضنا بموجبه بشحن هذه المبالغ من بطاقتك الائتمانية أو غيرها من وسائل الدفع. سنخصم من بطاقتك الائتمانية أو وسائل الدفع الأخرى جميع المبالغ المستحقة، بالنسبة للاشتراك الشهري أو السنوي سيتم سحب المبلغ من بطاقتك بشكل تلقائي عند موعد الاستحقاق الشهري أو السنوي.</li>\r\n</ul>\r\n\r\n<p style=\"text-align:right\">&nbsp;</p>\r\n\r\n<ul>\r\n	<li dir=\"RTL\" style=\"text-align:right\">ظروف القوة القهرية: لن تتحمل المنصة أي مسؤولية عن أي خسارة او تأخير بسبب الحريق، أو الكوارث الطبيعية، أو فشل في النظام المصرفي، أو انقطاع الكهرباء، أو مشاكل في الاتصالات السلكية واللاسلكية، أو الحروب، أو الإضرابات، أو اندلاع اعمال شغب، أو هجمات إرهابية، أو فشل في اداء البنوك التابعة، أو أي حوادث أخرى ليس لدينها القدرة على التحكم فيها<span dir=\"LTR\">.</span></li>\r\n</ul>\r\n\r\n<p style=\"text-align:right\">&nbsp;</p>\r\n\r\n<ul>\r\n	<li dir=\"RTL\" style=\"text-align:right\">تقدم المنصة شهادات إكمال رقمية، للبرامج المسجلة (الدورات المسجلة) أو الدورات المباشرة تثبت من خلالها إكمالك مشاهدتك لمحتوى الدورة وهذه الشهادات لا تمثل أي جهة خارجية ولا تصدّق من أي جهة أخرى سوى تصديق المنصة.</li>\r\n</ul>\r\n\r\n<p style=\"text-align:right\">&nbsp;</p>\r\n\r\n<ul>\r\n	<li dir=\"RTL\" style=\"text-align:right\">يجوز أن تقوم المنصة بشكل مؤقت بتوقيف أو التوقف تماما عن تشغيل النظام في أي وقت ولن يكون عليها أية مسؤوليات تجاه المستخدمين او أي طرف ثالث بسبب التوقيف المؤقت او التوقف الكامل لتشغيل النظام<span dir=\"LTR\">.</span> يجوز أن تكون المنصة غير متاحة في بعض الاوقات للسماح بعمليات الصيانة والتحديث وبالرغم من اننا سوف نسعى لإبلاغ المستخدمين مسبقاً بعدم توفر أي خدمة مذكورة، الا ان ذلك لا يمكن ضمانه ونحتفظ بحق تعديل او سحب الخدمة في أي وقت<span dir=\"LTR\">.</span></li>\r\n</ul>\r\n\r\n<p style=\"text-align:right\">&nbsp;</p>\r\n\r\n<ul>\r\n	<li dir=\"RTL\" style=\"text-align:right\">سياسة الارجاع: نحن نقدم خدمة مشاهدة الدورات المسجلة أو حضور الدورات المباشرة، وهذه الخدمات لا يمكن ارجاعها بأي حال من الأحوال.</li>\r\n</ul>\r\n\r\n<p style=\"text-align:right\">&nbsp;</p>\r\n\r\n<ul>\r\n	<li dir=\"RTL\" style=\"text-align:right\">سياسة الإلغاء: بالنسبة الى خدمة الاشتراك الشهري أو السنوي لا تستطيع الغاء الاشتراك أو إزالة الحساب بالكامل ولكنك تستطيع الغاء تجديد الاشتراك بأي وقت، إذا قمت بإلغاء تجديد الاشتراك فلا يتم استرداد المبلغ عن الفترة المتبقية للاشتراك سواء الشهري أو السنوي، يجب عليك أن تعرف بأن المبلغ المدفوع لا يسترد بأي حال من الأحوال، ولكن عندما تلغي تجديد الاشتراك سوف لا نسحب مبلغ الاشتراك عن الفترة القادمة ولكن تبقى الفترة الحالية فعالة الى حين انتهاء المدة. بياناتك في المنصة عند الغاء تجديد الاشتراك تبقى لدينا بالأرشيف وتستطيع إعادة تجديد الاشتراك بأي وقت. أما بالنسبة الى خدمة الاشتراك في الكورسات المباشرة (الاون لاين)، يتم دفع رسوم الاشتراك مقدماً من أجل حجز مقعد والتسجيل في الدورة، وفي حال أراد المستخدم استرجاع المبلغ يستطيع أن يقدم طلب من خلال التواصل معنا، بشرط أن يقدم الطلب قبل موعد بداية الدورة، وفي هذه الحالة سيتم ارجاع المبلغ الى الحساب المصرفي للمستخدم خلال 21 يوما ويخصم من المبلغ عمولات التحويل المصرفية.</li>\r\n</ul>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<ul>\r\n	<li dir=\"RTL\" style=\"text-align:right\">أنت تقبل بأن نتواصل معك وارسال الرسائل أو الاشعارات على بريدك الالكتروني أو من خلال الاشعارات على المنصة، وأيضا يمكنك بأي وقت أن تتواصل معنا على البريد الالكتروني التالي:</li>\r\n</ul>\r\n\r\n<p style=\"text-align:right\">&nbsp;</p>\r\n\r\n<p dir=\"rtl\" style=\"text-align:center\">info@alnamat.com</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p style=\"text-align:right\">&nbsp;</p>\r\n\r\n<ul>\r\n	<li dir=\"RTL\" style=\"text-align:right\">أنت توافق على جميع الشروط والاحكام مع المقدمة، وأي نزاع يحصل يتم حله من خلال المحاكم الاردنية.</li>\r\n</ul>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\" style=\"text-align:center\">انتهت الشروط والأحكام</p>\r\n\r\n<p style=\"text-align:right\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p style=\"text-align:right\">&nbsp;</p>', NULL, NULL, '<p dir=\"rtl\">&nbsp;نحن نقدّم خدمة مشاهدة الدورات المسجلة أو حضور الدورات المباشرة، وهذه الخدمات لا يمكن ارجاعها بأي حال من الأحوال.</p>', '<p>We offer the service of watching recorded courses or attending live courses, and these services cannot be returned in any way.</p>', '<p dir=\"RTL\">بالنسبة الى خدمة الاشتراك الشهري أو السنوي لا تستطيع الغاء الاشتراك أو إزالة الحساب بالكامل ولكنك تستطيع الغاء تجديد الاشتراك بأي وقت، إذا قمت بإلغاء تجديد الاشتراك فلا يتم استرداد المبلغ عن الفترة المتبقية للاشتراك سواء الشهري أو السنوي، يجب عليك أن تعرف بأن المبلغ المدفوع لا يسترد بأي حال من الأحوال، ولكن عندما تلغي تجديد الاشتراك سوف لا نسحب مبلغ الاشتراك عن الفترة القادمة ولكن تبقى الفترة الحالية فعالة الى حين انتهاء المدة. بياناتك في المنصة عند الغاء تجديد الاشتراك تبقى لدينا بالأرشيف وتستطيع إعادة تجديد الاشتراك بأي وقت.</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">أما بالنسبة الى خدمة الاشتراك في الكورسات المباشرة (الاون لاين)، يتم دفع رسوم الاشتراك مقدماً من أجل حجز مقعد والتسجيل في الدورة، وفي حال أراد المستخدم استرجاع المبلغ يستطيع أن يقدم طلب من خلال التواصل معنا، بشرط أن يقدم الطلب قبل موعد بداية الدورة، وفي هذه الحالة سيتم ارجاع المبلغ الى الحساب المصرفي للمستخدم خلال 21 يوما ويخصم من المبلغ عمولات التحويل المصرفية.</p>', '<p>With regard to the monthly or annual subscription service, you cannot cancel the subscription or remove the account completely, but you can cancel the subscription renewal at any time. In any case, but when you cancel the subscription renewal, we will not withdraw the subscription amount for the next period, but the current period will remain effective until the end of the period. Your data on the platform when canceling the subscription renewal remains with us in the archive and you can renew the subscription at any time.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>As for the subscription service for direct (online) courses, the subscription fee is paid in advance in order to reserve a seat and register for the course, and if the user wants to recover the amount, he can submit a request by contacting us, provided that the request is submitted before the start of the course, In this case, the amount will be returned to the user&#39;s bank account within 21 days, and bank transfer commissions will be deducted from the amount.</p>', '<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">&nbsp;نحن نقدم خدمة مشاهدة الدورات المسجلة أو حضور الدورات المباشرة، ولا يوجد شيء يتم توصيله الى عنوان المستخدم، خدمة الدورات المسجلة تكون وصلت الى المستخدم بمجرد مشاهدتها من منصة النمط، وخدمة الدورات المباشرة تكون وصلت الى المستخدم بمجرد حضورها من خلال وسائل الاتصال المختلفة والتي تتيح الاجتماعات عن بعد مثل تطبيق الزووم.&nbsp; &nbsp;</p>', '<p>&nbsp;</p>\r\n\r\n<p>&nbsp; We offer the service of watching the recorded sessions or attending the live sessions, and nothing is delivered to the user&rsquo;s address, the service of the recorded sessions is reached to the user as soon as they are viewed from our website, and the service of the direct sessions is reached to the user as soon as she attends through the various means of communication that allow meetings remotely such as the Zoom app<span dir=\"RTL\">.</span></p>', 10, 10, 1, '1647498879.jpeg', NULL, '2023-03-07 11:20:53');
