(26, 33, 22, 177, NULL, 'التغلب على المشاعر السلبية', 'Overcoming negative feelings', 'كيف تتغلب على الخوف والقلق والتوتر والاكتئاب والوسواس', 'سوف تتعلم في هذه الدورة كيف تستطيع أن تغير تفكيرك السلبي وكيف تتخلص من جميع المشاعر السلبية مثل الخوف والقلق والتوتر والاكتئاب والوسواس وأيضاً سوف تتعلم بهذه الدورة كيف تقوي ثقتك بنفسك وتزيد من قوة شخصيتك', 'لا شيء', NULL, NULL, '2023-02-22', '1673796336.png', 'التغلب-على-المشاعر-السلبية', 1, 0, 0, 'التفكير السلبي، حسني المستريحي، الخوف، القلق، التوتر، الاكتئاب، الصحة النفسية', NULL, '2022-08-08 13:08:22', '2023-02-23 02:35:35'),
(34, 33, 22, 172, NULL, 'طرق التغلب على الخوف', 'Ways to overcome fear', 'كيف تتحرر من جميع مخاوفك', 'حقيقة الخوف، أنواع الخوف، اسباب الخوف، القواعد الذهبية للتخلص من الخوف، التخلص من الخوف ومن جميع أنواع المخاوف المختلفة', 'لا شيء', NULL, NULL, '2023-02-22', '20220811064924.png', 'طرق-التغلب-على-الخوف', 1, 0, 1, 'الخوف، لا تخف، حسني المستريحي، التخلص من الخوف، التغلب على الخوف، طرق كسر حاجز الخوف، التحرر من الخوف، طرق التحرر من المخاوف المختلفة', NULL, '2022-08-11 11:49:24', '2023-02-23 02:54:11'),
(35, 33, 27, 182, NULL, 'تنمية الثقة بالنفس', 'Develop self-confidence', 'كيف تزيد من الثقة بالنفس وقوة الشخصية وتتحرر من مخاوفك', 'أسب وأعراض تدني الثقة بالنفس، تمارين لزيادة الثقة بالنفس، وطرق تنمية الثقة بالنفس', 'لا شيء', NULL, NULL, '2023-02-22', '1673927674.png', 'تنمية-الثقة-بالنفس', 1, 0, 0, 'الثقة بالنفس، تنمية الثقة بالنفس، زيادة الثقة بالنفس، تنمية الشخصية القوية، تنمية الشخصية، حسني المستريحي', NULL, '2022-08-12 09:28:46', '2023-02-23 02:56:03'),
