(69, 319, 15, 251, NULL, 'كيفية انشاء وتسجيل الفيديوهات التعليمية بطريقة احترافية', NULL, 'انشاء الفيدوهات بطرق احترافية', 'تتعرف في هذه الدورة على كيفية تسجيل الشاشة - اضافة المؤثرات الصوتية والمقدمات لعمل فيديو وكيفية انشاء فيديو تفاعلى', 'كمبيوتر - برنامج كمتازيا', NULL, NULL, '2022-09-01', '20220901175428.jpg', 'كيفية-انشاء-وتسجيل-الفيديوهات-التعليمية-بطريقة-احترافية', 1, 0, 0, 'تسجيل الشاشة - مقدمة الفيديو - فيديو تفاعلى - المؤثرات الصوتية - وادوات الشرح اثناء العرض بالفيدو التعليمي', NULL, '2022-09-01 22:54:28', '2022-10-07 08:27:05'),
(71, 336, 22, 176, NULL, 'التحرر من المشاعر السلبية', NULL, 'دورة متكاملة تحتوي على أقوى تقنيات التحرر من المشاعر السّلبيّة (خوف، حزن، غضب..)،حيث يلتمس الإنسان نتائج مباشرة بعد التطبيق.', 'تحتوي هذه الدورة على شرح مفصل عن كيفية خلق المشاعر السَّلبيّة و الايجابية، و تأثير ذلك على الجسم. هذا الكورس لا يحتوي على توكيدات إيجابية و تنويم إيحائي و جلسات تخيلات، بل هو منظومة علمية و عملية تطبيقية تنقلك من دوامة المشاعر السّلبيّة إلى الإستقرار النفسي و الراحة النفسية...غايتنا ليس إعطائك تحفيزا أو دفعة معنوية ترفع معنوياتك بل غايتنا هو إعطائك طرق و أسلوب حياة جديد تسير عليه أينما كنت حتى تعيش في سلام داخلي مهما كانت الظروف الخارجية، هذه الدورة ليست موجهة للذين يعانون من المشاعر السلبية أو المعالجين النفسيين فحسب، بل موجهة لكل شخص بالغ عاقل حتى يدير حياته النفسية بالطريقة الصحيحة. للحصول على نتيجة قوية يجب تطبيق تقنيات التحرر يوميا، تطبيق تقنية سيدونا مرتين او ثلاث مرات، ثم تطبيق جلسة الصمت مرة او مرتين، ثم تطبيق آخر تقنية في هذه الدورة، بعد حوالي شهر من التطبيق بإذن الله سوف تشعر بالسعادة تلقائيا و دون سبب واضح.', 'السن يكون 14 سنة فما فوق.', NULL, NULL, '2022-09-03', '20220903042021.jpg', 'التحرر-من-المشاعر-السلبية', 1, 0, 0, 'الخوف ، المشاعر السلبية ، الحزن ، التعلق ، التحرر ، الراحة النفسية ، السعادة ، الاكتئاب ، الغضب ، التوتر ، التنمية البشرية ، القلق ، تطوير الذات ، المتعة ، السلام الداخلي ، السلام النفسي', NULL, '2022-09-03 09:20:21', '2022-09-03 13:10:04'),
(79, 248, 18, 208, NULL, '4cs', NULL, 'مهارات القرن الواحد والعشرين المهمة للاندماج بسوق العمل', 'تشمل الدورة على 4 محاضرات عن 4cs أو مهارات القرون الواحد والعشرين المهمة للشباب للاندماج في سوق العمل وتشمل مهارات التواصل والتعاون والابداع والتفكير الناقد', 'لاشيء', NULL, NULL, '2022-09-07', '20220907105430.jpg', '4cs', 1, 0, 1, 'تطوير الذات ،  تدريب ، مهارات سوق العمل', NULL, '2022-09-07 15:54:30', '2022-09-19 20:07:41'),
(84, 321, 27, 186, NULL, 'المهارات التسع وعشرون للقيادة وصناع القرار', 'The twenty nine skills for leadership and decision makers', 'تتحدث الدورة عن المهارات التسع وعشرون للقيادة ونتناول المهارات الادارية والفنيه والانسانية والاجتماعية والشخصية', 'ان يتعرف المتدرب على المهارات الادارية من إدارة وقت واجتماعات ومهارات تخطيط . ان ينمي المتدرب مهاراته الذاتية وقدراته العقلية ويتعرف على طرق ضبط النفس . ان يكتشف المتدرب أهم المهارات الفنية . أن يفهم المتدرب ذاته والاخرين من خلال التعرف على المهارات الانسانية وطرق حل النزاع والاتصال وبناء جماعات العمل . ان يدعم المتدرب المهارات الشخصية من امانة وصدق وشجاعة وثقة بالنفس .', 'الحضور الكامل للدورة', NULL, NULL, '2023-02-23', '20220908161820.jpg', 'المهارات-التسع-وعشرون-للقيادة-وصناع-القرار', 1, 0, 0, 'القيادة والمهارات الاداريه- المهارات الشخصية - المهارات الذاتية - المهارات الفنية', NULL, '2022-09-08 21:18:20', '2023-02-23 18:57:08'),
