(127, 546, 27, 186, NULL, 'دبلومة اعداد القادة', NULL, 'دبلومة اعداد القادة تم اعدادها لاكساب جميع المشاركين المهارات القيادية واعداهم اداريا وتنمية مهاراتهم وخبراتهم فى ضوء احدث وسائل التطوير العلمية وكذلك تزويدهم بكيفية اعداد خطة واضحة ليصبحوا متخصصين فى مجالاتهم.', 'تعتبر القيادة من أهم المحاور التي ترتكز عليها مختلف الشركات والمنظمات سواء كانت عامة أو خاصة، وهي عبارة عن الأنشطة التي يمارسها المسؤول الإداري على الأفراد العاملين في تنظيمٍ معين، والتي تتمثل في إصدار الأوامر، والتأثير عليهم لتحفيزهم على العمل، هذا بالإضافة إلى توجيههم نحو تحقيق الأهداف المرجوة.', 'الدورة لا تتطلب اعدادات مسبقة غير ان يكون الدارس راغب فى تحول دوره من الدور التابع الى الدور القيادى سواء كان على مستوى المؤسسات او المستوى الشخصى', NULL, NULL, '2022-09-22', '1663858986.jpg', 'دبلومة-اعداد-القادة', 1, 0, 0, 'التنمية البشرية - القيادة - القادة - القائد الفعال - فن التأثير', NULL, '2022-09-17 01:28:55', '2022-09-22 20:03:06'),
