(215, 546, 35, 262, NULL, 'دبلوم ادارة الموارد البشرية', NULL, 'فى هذا البرنامج نقدم مادة علمية قوية لعلم ادارة الموارد البشرية و التعرف على تخصصاته المختلفة', 'ستهدف هذه الدبلومة بصورة أساسية تأهيل الراغبين في العمل في مجال إدارة الموارد البشرية والعاملين بالفعل في هذا المجال ةأصحاب المشروعات الصغيرة وإكسابهم الخبرات العملية والأكاديمية التي تؤهلهم للعمل في هذا المجال بنجاح. كذلك صقل خبرات ومهارات مسئولي ومديري الموارد البشرية وشئون الموظفين وتزويدهم بالخبرات التخصصية اللازمة. حيث أصبحت وظيفة الموارد البشرية هي عصب الحياة داخل المؤسسات والشركات والتي تتحمل مسئولية إدارة أهم مورد أو ثروة تمتلكها أي شركة وهي مواردها البشرية ، وسيتم في هذا البرنامج التدريبي شرح وظائف ومهام إدارة الموارد البشرية تفصيليا مع التطبيق العملي لبعض هذه الوظائف مثل الإستقطاب والإختيار وتطوير الموظفين وإعداد هيكل الرواتب والأجور وإعداد خطط التدريب والتطوير للموظفين.', 'لا يشترط حضور برامج سابقة لها', NULL, NULL, '2022-09-29', '20220929191656.png', 'دبلوم-ادارة-الموارد-البشرية', 1, 0, 0, 'ادارة الموارد البشرية، محمد الكمار ، تطوير ، كلام اتش ار ، الموارد البشرية ، الادارة ، التدريب و التطوير ،', NULL, '2022-09-30 00:16:56', '2022-11-03 22:09:57'),
(217, 763, 18, 199, NULL, 'برنامج القراءة والكتابة', NULL, 'برنامج يهم طلاب الصفوف الاولي والصفوف العليا من ضعاف القراءة والكتابة', 'برنامج خاص للطلاب الضعاف في القراءة والكتابة يتضمن تعاريف مهمة لصوت الحرف وشكل الحرف والكلمة والجملة وتعريف مهارات التحدث وكيف تطبقها مع طلابك وابنائكوخاصة الضعاف بالقراءة والكتابة', 'لا توجد', NULL, NULL, '2022-09-30', '20220930040048.JPG', 'برنامج-القراءة-والكتابة', 1, 0, 0, 'مفهوم القراءة / اهميتها / مكوناتها /الوعي الصوتي /اهميته مستوياته /الطريقة الصوتية /كيفية تطبيقها /', NULL, '2022-09-30 09:00:48', '2022-10-03 13:54:51'),
(220, 239, 12, 110, NULL, 'سلامة اللغة العربيّة', NULL, 'هل تُريد امتلاك لغة من دون أغلاط إملائية بقواعد عامة وسهلة؟', 'تهدف هذه الدورة إلى التعريف على اللغة بشكل عام واللغة العربية بشكل خاص والتعريف بالقواعد العامة للغة العربيّة لكتابة محتوى خالٍ من الشوائب والاحراج عند النشر. ستتعرف من خلال هذه الدورة على كيفية استخدام المصطلحات والحروف والكتابة الصحيحة بشكل إحترافي. الفئة المستهدفة هي كل معشر الكُتاب ومحبي الثقافة واللغة العربية والإعلاميين ومديرو الأكادميات وموظفي الدوائر وخريجي الجامعات ومن لديهم شك في ركاكة لغتهم', 'القليل من التركيز وتدوين الملاحظات', NULL, NULL, '2022-10-01', '20220930130120.jpg', 'سلامة-اللغة-العربية', 1, 0, 0, 'اللغة العربيّة، للكتابة السليمة الخالية من الأغلاط.', NULL, '2022-09-30 18:01:20', '2022-10-01 09:48:34'),
(226, 783, 27, 187, NULL, 'مهارات التواصل الفعال (Effective Public Speaking)', NULL, 'دورة تدريبية عن مهارات التواصل الفعال', 'دورة مهارات التواصل الفعال ستساعدك كثيراً على تطوير مهارات التحدث أمام الجمهور وعدد كبير من الأشخاص كما ستزودك بفنون الرد على الأسئلة الغير متوقعة من الحضور وكيفية التصرف حين نسيان شي ما قمت بتحضيره ولم تستطيع تذكره والأهم أن هذه الدورة ستساعدك فى تخطى حاجز الخوف من مقابلة الجمهور أو التحدث أمام العامة', 'معرفة اللغة العربية', NULL, NULL, '2022-10-26', '20220930151747.jpeg', 'مهارات-التواصل-الفعال-effective-public-speaking', 1, 0, 0, 'التنمية البشرية، تطوير الذات، مهارات العرض والاتصال، مهارات النجاح الحياتية', NULL, '2022-09-30 20:17:47', '2022-10-26 11:09:13'),
(230, 546, 27, 182, NULL, 'عيشها صح (معا لحياة أفضل) - المستوى الاول', NULL, 'دورة عيشها صح التدريبية هدفها تنمية المهارات الشخصية لتمكن الفرد من انجاز اهدافه و بلوغ مستوى النجاح الشخصى و العملى المرغوب', 'هذا البرنامج التدريبيى واحد من ضمن برامج التنمية البشرية و الذاتية و التى تهدف الى تزويد المتدرب بالمهارات الشخصية اللازمة لتحقيق الاهداف و الوصول الى مراتب النجاح العليا . و نظرا لكثرة الموضوعات و تنوعها راعينا ان تكون الدورة على عدة مستويات و هنا نقدم المستوى الاول المكون من 8 لقاءات تدريبية على ثمان مهارات شخصية تضعك على اول خطوات التفوق', 'لا يشترط حضور برامج سابقة لها', NULL, NULL, '2022-10-01', '20220930201334.png', 'عيشها-صح-معا-لحياة-أفضل-المستوى-الاول', 1, 0, 0, 'التنمية البشرية - القيادة - القادة - القائد الفعال - فن التأثير ، محمد الكمار ، التطوير', NULL, '2022-10-01 01:13:34', '2022-10-03 11:00:20'),
(240, 787, 27, 188, NULL, 'برنامج النقلة', NULL, 'الانتقال من التفكير السلبي الى التفكير الايجابي', 'برنامج الانتقالة  transfer program ----------------------------------- الانتقال من التفكير السلبي إلى التفكير الايجابي إذا كنت تريد أن تطور من نفسك وترتقي بفكرك اذا كنت تعاني من عدم الثقة بأفكارك اذا كنت تفكر بشئ وتفعل شئ اخر اذا كنت تنوي فعل شئ واحد افكارك تسعى لشئ آخر اذا كنت لا تشعر بالراحة والسلام  اذا كنت ممن يعانون من عدم السيطرة على أفكارهم اذا كنت لا تدري ما تريد أو انك تريد شي وتفعل عكسه اذا كنت ترغب في الحصول على عمل جيد أو وظيفة معينة ولا تستطيع الوصول لها بالرغم من انك متمكن في مجالك اذا كنت ترغب في الزواج ولكن دون جدوى  اذا كنت دائما تقابل نفس النمط من البشر في حياتك  -__\'__\'\'\'__\'____\'\' فانت تحتاج هذه الدورة انصحك باتخاذ القرار الآن لأن الموضوع جد مهم ويستحق لكي تنعم بحياة أفضل لابد وأن تستثمر في نفسك أولا لكي تجني ثمارها يافعة ونافعة لك ولغيرك __________\'\'\'\' اليكم محاور الدورة المحور الأول 🥇 كن حاضراً كن هنا والآن ويحتوي على عدة نقاط المحور الثاني  الفرق بين العقل الواعي واللاواعي وكيفية استخدامهما المحور الثالث كيفية رسم خريطة ذهنية المحور الرابع النقلة إلى كيفية تثبيت برنامج التفكير الإيجابي', 'الاجابة عن الاسئلة فى التعليقات', NULL, NULL, '2022-10-01', '20221001193557.png', 'برنامج-النقلة', 1, 0, 0, 'تنمية بشرية ,  صحة نفسية , استشارات اسرية , TOT', NULL, '2022-10-02 00:35:57', '2022-10-22 12:12:58'),
