(260, 230, 29, 273, NULL, 'الفلسفة اليونانية (سقراط، أفلاطون، أرسطو)', NULL, 'الفسلفة اليونانية', 'شرح الفسلفة اليواني من نشأتها إلى فلاسفتها، أفكار كل منهم، يمكن لطلاب الثانوي، طلاب كلية التربية والأساتذة المتدربين الإطلاع على هذه الدورات، إذافة إلى طلاب العلوم التربوية والتربية الحضانية والتربية المختصة', 'لا شيء', NULL, NULL, '2022-10-11', '20221011073354.jpg', 'الفلسفة-اليونانية-سقراط-أفلاطون-أرسطو', 1, 0, 0, 'أفلاطون، أرسطو، الفلسفة اليونانية، سقراط، العالم المثالي، العالم المادي', NULL, '2022-10-11 12:33:54', '2022-10-21 11:36:09'),
(275, 778, 27, 200, NULL, 'مهارات اجتياز مقابلة العمل (Interview Skills)', NULL, 'دورة تدريبية في كيفية انواع مُقابلات العمل وكيفية اجتياز المٌقابلة.', 'تعريف الدورة:\r\nمهارات مقابلة العمل هو دورة تدريبية تتناول الأنواع المختلفة من المقابلات وكيفية الاستعداد لإجراء مقابلة العمل، والمقابلات الشخصية وآدابها، والأسئلة الأكثر شيوعاً خلال المقابلة حول القطاعات المختلفة كـ التسويق والمبيعات والوظائف الإدارية والفنية وكيفية التعامل مع الأسئلة الصعبة ومقابلات الطلاب وحديثي التخرج، بالإضافة إلى مهارات المقابلة الشخصية وكيفيّة إجراء مقابلة عمل ناجحة .\r\n\r\nتعتبر مقابلة العمل أو المقابلة الشخصية الجسر الحرج الذي يفصل ما بين التقدم للوظيفة والنجاح في الحصول عليها، والذي يجب عبوره من أجل تنفيذ استراتيجية بحث عن عمل مُعدّة بشكل جيد، ولتحقيق ذلك يتطلّب من الفرد أن يتحلّى بمهارات مقابلة العمل ونقوم في هذا المساق بعرض أمثلةٍ على أسئلة مقابلة عمل وأجوبتها لتتمكّن من الرجوع إليها في أي وقت.\r\n\r\nوتتمثل القاعدة الأساسية لإجراء مقابلة عمل ناجحة أو مقابلة شخصية جيدة في القدرة على إقناع مدير التوظيف بقدرتك على التميّز بين الحشود، وإمكانياتك في تحقيق كل من النتائج الملموسة وغير الملموسة للشركة مما يساهم في تحسين نتائج الأداء لديها. ويتشكل نموذج مقابلة العمل من عدة أسئلةٍ متكررة سنقوم بذكر بعضٍ منها خلال مساق مهارات مقابلة العمل.\r\nمع التنافسية العالية في سوق العمل، يهدف هذا المساق إلى مساعدتك على الإعداد لـ مقابلات العمل بنجاح وإكسابك مهارات المقابلة الشخصية حتى تتمكن من الحصول على عوائد مُجزية لما تستثمر من الوقت والجهد في بحثك عن عمل. ولأننا عانينا جميعاً من البحث عن عمل، نودّ أن نشارككم بكل ما نعلم حول فن إجراء مقابلات عمل فعّالة وأمثلةٍ على أسئلة مقابلة عمل وأجوبتها .\r\n\r\nكما سـ نشارككم بالنصائح والمشورة وآراء أصحاب العمل في كيفية بناء الثقة أثناء تواصلك مع الشخص الذي يُجري المقابلة وستتعلم كيف تقوم بإثبات نفسك كـ الشخص الأمثل لتلك الوظيفة من خلال مزيج من الشخصية الفريدة والخبرات والاهتمامات والكفاءات الملائمة للوظيفة، وستتعرّف على الأسئلة المختلفة خلال المقابلة بحسب اختلاف القطاع فمثلاً مقابلة عمل في مدرسة تختلف عنها في شركة.\r\n\r\nأهداف الدورة:\r\nصقل طلاقة المشاركين في مهارات مقابلة العمل. تمكينهم من الحصول على فهم أفضل حول الإجابات على أسئلة مقابلة العمل التي يسعى أصحاب العمل حالياً لسماعها من المتقدّمين للوظيفة والمرتبطة بالكفاءة والمواقف والآداب والسلوك العام الذي يظهر خلال المقابلة، حيث يعمل ذلك على بناء أساس قوي لتقدّم مسارهم الوظيفي.\r\n\r\nمحتوى الدورة:\r\n1مقدمة وتعريف الدورة\r\n2انواع مقابلات العمل وكيفية الاستعداد لها \r\n3كيفية التهيئة لمقابلة العمل\r\n4كيفية التعامل داخل مقابله العمل\r\n5كيفية انهاء مقابلة العمل \r\n6الأسئلة الأكثر شيوعًا وكيفية الرد عليها\r\n7اسئلة تستطيع ان تسالها لمن يجري معك المقابلة \r\n8طرق التخلص من التوتر الذي يواجهك أثناء مقابله العمل\r\n\r\nعن المُدرب:\r\nد/ احمد مقبول\r\nمدرب ومحاضر معتمد من المركز الدبلوماسي وA.L.A Academy\r\nاخصائي إدارة اعمال واستشاري تنمية الموارد البشريةمعتمد من المركز الدبلوماسي.\r\nالمدير التنفيذي لدى فريق سشات للتدريب والإستشارات.\r\nمدرب لدى المركز الثقافي البريطاني.\r\nمدرب لدي ATI.\r\nمدرب لدى معهد النمط.\r\nمدرب لدى إتحاد حلم مصر.\r\nالمُتحدث الرسمي السابق لدى وحدة التضامن الاجتماعي بجامعة سوهاج.\r\nمقدم مؤتمرات ومحاضر لدى الهلال الأحمر المصري.\r\nمدير التسويق السابق لدى ARMT.\r\nخبرة أكثر من ثلاث سنوات بمجال التدريب وتطوير مهارات الشباب.\r\nدرب أكثر من 3000  شخص علي مستوي مصر وبعض البُلدان العربية في مختلف الأعمار.\r\nقدم العديد من المؤتمرات والندوات داخل جامعة سوهاج.\r\nأجرى عدة لقاءات تليفزيونة وصحفية.\r\nكاتب صحفي لدى جريدة أناقة فكر.\r\n\r\nنتمني لك جوله سعيدة مع هذة الدورة\r\nشكرًا لك.', 'لا شيء', NULL, NULL, '2022-10-19', '20221013010550.png', 'مهارات-اجتياز-مقابلة-العمل-interview-skills', 1, 0, 0, 'تنمية بشرية، تطوير ذات، مقابلة عمل، مهارات اجتياز مقابلة العمل، اجتياز الانترفيو، الانترفيو، طرق الرد على الأسئلة، الإستعداد لمقابلة اعمل', NULL, '2022-10-13 06:05:50', '2022-10-19 23:37:03'),
(314, 296, 35, 262, NULL, 'مدحل العملية الادارية - المديرين الجدد', NULL, 'مدخل أساسي للمديرين الجدد للتعرف على العملية الأدارية وأنماطها الشهيرة', 'الفئة المستهدقة : المديرين الجدد \r\nالمحتويات الرئيسية :\r\nالمحور الأول - مفهوم ونعريف الادارة - المكونات الرئيسية للعملية  الإدارية\r\nالمحور الثاني - التخطيط - التنظيم - القيادة - المتابعة\r\nالمحور الثالث - أنماط الإدارة الشهيرة', 'فكرة اساسية عن ادارة الاعمال او ترشيح لتولي منصب اداري', NULL, NULL, '2022-10-13', '20221013184744.jpg', 'مدحل-العملية-الادارية-المديرين-الجدد', 1, 0, 0, '#المديرين_الجدد\r\n#ادارة_الأعمال\r\n#مدخل_للادارة\r\n#تطوير_الاداء_الاداري', NULL, '2022-10-13 23:47:44', '2022-10-14 00:17:43'),
(326, 283, 9, 206, NULL, 'القواعد المرورية', NULL, 'السلامةالمرورية والمنع حوادث المرور', 'السلامة المرورية تهدف لحماية الطريق العام من وقوع الحوادث المرورية ،من عناصرها سلامة المركبة وسلامة الطريق والعنصر البشري-----تستهدف جميع الفئات العمرية', 'لاشيئ', NULL, NULL, '2022-11-05', '1667683087.png', 'القواعد-المرورية', 1, 0, 0, 'السلامة المرورية،القيادة الأمنة،الحوادث المرورية،الطريق الأمن', NULL, '2022-10-15 02:52:31', '2022-11-06 02:18:07');
