(353, 156, 18, 202, NULL, 'استخدام برمجيات تكنولوجية تفاعلية في التعليم والتدريب', 'Using interactive Technology programs in Education', 'أدوات التدريس الفعالINSERT INTO `courses` (`id`, `userId`, `categoryId`, `subCategoryId`, `languageId`, `title`, `title_ar`, `short_detail`, `detail`, `requirement`, `price`, `discount_price`, `date`, `image`, `slug`, `status`, `certificate_pay`, `continue_watching`, `meta_key`, `meta_desc`, `created_at`, `updated_at`) VALUES
(441, 514, 35, 265, NULL, 'دراسة الجدوى وتقييم المشروعات الصغيرة', 'Feasibility study and evaluation of small projects', 'دورة تدريبية مهنية متخصصة في دراسة الجدوى الاقتصادية وتقييم المشروعات الصغيرة لاتخاذ القرارات.', 'يدور هذا البرنامج حول \"دراسة الجدوى وتقييم المشروعات الصغيرة\"\r\nوسيتم عرضه من خلال الوحدة الأتية:\r\nالوحدة التدريبية الأولى: دراسة الجدوى\r\nالوحدة التدريبية الثانية: المشروعات الصغيرة\r\n\r\nأهداف الدورة:\r\n•	أن يتعرف المتدرب  على دراسة الجدوى\r\n•	أن يلم المتدرب بالادارة الماليه للمشروع \r\n•	أن يعي المتدرب بالجدوى التسويقية \r\n•	أن يدرك المتدرب الجدوى الفنية للمشروع.\r\n•	أن يتعرف المتدرب على الجدوى المالية للمشروع\r\n•	أن يدرك المتدرب أساليب تسديد القروض.\r\n•	أن يلم المتدرب بمعلومات مهمة عن المشروعات الصغيرة\r\n•	أن يتعرف المتدرب على كيف تبدأ مشروعك الصغير.\r\n•	أن يلم المتدرب بعوامل نجاح المشروع\r\n•	أن يدرك المتدرب دورة حياة المشروع. \r\n\r\nالمستهدفون من البرنامج\r\n	رجال الأعمال والعاملين على المشروعات الصغيرة \r\n	كل من يهتم بإدارة المشروعات', 'الاهتمام والمتابعة', NULL, NULL, '2023-03-09', '20230309210623.jpg', 'دراسة-الجدوى-وتقييم-المشروعات-الصغيرة', 3, 0, 0, 'جدوى اقتصادية، دراسة جدوى، مشروعات صغيرة، تقييم المشروعات', NULL, '2023-03-10 03:06:23', '2023-03-11 19:51:16'),
(442, 2, 1, 2, NULL, 'دوره تصميم جرافيك', 'دوره تصميم جرافيك', 'دوره تصميم جرافيك', 'دوره تصميم جرافيك', 'دوره تصميم جرافيك', NULL, NULL, '2023-03-10', '20230310134959.jpeg', 'دوره-تصميم-جرافيك', 0, 0, 0, 'دوره تصميم جرافيك', NULL, '2023-03-10 19:49:59', '2023-03-12 05:06:28'),
(444, 1979, 18, 202, NULL, 'مستويات التدريس عن بعد - أونلاين عبر الإنترنت', 'online education', 'مستويات التدريس عن بعد وما يخص كل مستوى من هذه المستويات والبرامج المستخدمة فيه', 'إلى زملائي وزميلاتي من المعلمين والمعلمات ممن يقومون بالتدريس أونلاين للطلاب والمتدربين، هذه المحاضرة التدريبية توضح لنا مستويات التدريس عن بعد وما يخص كل مستوى من هذه المستويات والبرامج المستخدمة فيه.', 'هاتف ذكي أو لابتوب أو جهاز مكتبي وإنترنت', NULL, NULL, '2023-03-12', '20230312215737.png', 'مستويات-التدريس-عن-بعد-أونلاين-عبر-الإنترنت', 3, 0, 0, 'التدريس أونلاين التدريس عن بعد', NULL, '2023-03-13 02:57:37', '2023-03-15 20:43:59'),
(445, 1979, 18, 202, NULL, 'إنشاء وتخصيص الملف التجاري باستخدام واتساب للأعمال', 'whatsapp', 'إنشاء وتخصيص الملف التجاري للمعلمين والمدربين باستخدام واتساب للأعمال', 'هذا التدريب يوضح طريقة عمل ملف تجاري  للمعلم والمدرب ليكون أكثر احترافية في التدريس أونلاين\r\nويحتوي على تخصيص الملف التجاري من الاسم والشعار والروابط وجدول المواعيد \r\nوعمل المجموعات والتحكم في خصائصها وعمل التصنيفات وإداراتها \r\nوغير ذلك\r\nنستهدف المهلمين والمدربين وأصحاب الأنشطة التعليمية التجارية والمجانية', 'جهاز هاتف ذكي على الأقل ويفضل لابتوب أو جهاز مكتبي أيضا مع اتصال إنترنت', NULL, NULL, '2023-03-12', '20230312215923.png', 'إنشاء-وتخصيص-الملف-التجاري-باستخدام-واتساب-للأعمال', 3, 0, 0, 'واتساب، ملف تجاري،', NULL, '2023-03-13 02:59:23', '2023-03-15 20:43:37'),
(446, 129, 15, 250, NULL, 'أساسيات التعامل مع البرامج المكتبية ( وورد - إكسيل - باوربوينت )', 'Microsoft Office ( Word - Excel - PowerPoint )', 'كيف تجيد التعامل مع برامج الوورد والإكسيل والباوربوينت', 'الفئة المستهدفة ( جميع الأعمار - وكل المهتمين بادخال البيانات واعمال السكرتارية وإدارة الملفات) \r\nتحتوي الدورة على دروس في كيفية التعامل مع برامج الوورد والاكسيل والباوربوينت .\r\nبرنامج الوورد :- \r\nاجراء العمليات التنسيقية - ادراج الجداول  - ادراج الصور والرسومات التوضيحية - الطباعة - حماية المستند - الهوامش واعدادات الصفحة - تحويل ملف الوورد لصيغة pdf -  الاستبدال وتبديل حالة أحرف اللغة الإنجليزية - اهم الاختصارات في البرنامج .\r\nبرنامج الإكسيل :-\r\n كيفية انشاء العمليات الحسابية -استخدام الدوال المختلفة في تحليل البيانات - شرح قاعدة if البسيطة والمركبة ومشتقات الدالة - التنسيق الشرطي - حماية المستند - تعقب التغييرات - الرسم البياني .\r\nبرنامج الباوربوينت :-\r\nكيفية التخطيط والتحضير لإنشاء عرض تقديمي - الأدوات المساعدة وكيفية استخدام الانترنت في تحضير هذه الأدوات- التحكم في خلفية العرض  بطرق عديدة - إضافة التأثيرات المختلفة على جميع أجزاء العرض - اضافة ملف صوت والتحكم فيه - اضافة ملف فيديو والتحكم فيه - تنفيذ حلقة مستمرة من العرض - تحويل العرض الى ملف فيديو  - عمل فكرة تعليمية باستخدام الإرتباط التشعبي.', 'فقط التعامل مع نظام تشغيل النوافذ Windows', NULL, NULL, '2023-03-14', '20230314093555.jpg', 'أساسيات-التعامل-مع-البرامج-المكتبية-وورد-إكسيل-باوربوينت', 1, 0, 0, 'وورد ، مايكروسوفت وورد ، اكسيل ، مايكروسوفت اكسيل ،باوربوينت ، مايكروسوفت باوربوينت ، مايكروسوفت أوفيس ، الرخصة الدولية للحاسب الآلي .\r\nWord , Microsoft Word , Excel , Microsoft Excel ,PowerPoint , Microsoft PowerPoint , Microsoft Office , ICDL', NULL, '2023-03-14 14:35:55', '2023-03-20 12:23:30'),
(448, 321, 18, 199, NULL, 'تدريب المدربين', 'TOT', 'تهدف هذه الجلسة الي تنمية معارف ومهارات واتجاهات المشاركين تجاه التدريب واكتساب المهارات والمعارف اللازمة لان يصبح مدرب محترف', 'تهدف هذه الجلسة الي تنمية معارف ومهارات واتجاهات المشاركين تجاه التدريب واكتساب المهارات والمعارف اللازمة لان يصبح مدرب محترف\r\nالتعرف  علي مفهوم التدريب ومكوناته \r\n التعرف علي اهداف التدريب \r\n مفهوم الحقيبة التدريبية \r\n الفرق بين التعليم والتدريب والتعلم \r\n سمات المدرب الناجح \r\nانواع المدربين وسمات المدرب الناجح\r\n المراحل التي يمر بها المدرب\r\n التدريب كمحترف\r\n اذابة الجليد\r\nالمهارة \r\nمهارة الاتصال للمدرب ومعوقات الاتصال\r\n مهارة الانصات \r\nمهارة العرض والتقديم \r\nالفئه المستهدفة اساتذه الجامعات والمعلمين والمدربين والباحثين في التدريب', 'حضور الدورة بالكامل', NULL, NULL, '2023-03-16', '20230316213635.jpg', 'تدريب-المدربين', 1, 0, 0, 'تدريب المدربين- انواع المدربين والمتدربين - الحقيبة التدريبية - سمات المدرب الناجح', NULL, '2023-03-17 02:36:35', '2023-03-17 15:21:04'),
(449, 1572, 15, 135, NULL, 'لغة html5 المستوى الثاني', 'html5 intermediate', 'نتعلم في هذه الدورة كيف نضيف على صفحة الويب  روابط تشعبية وصور وجداول باستخدام لغة الhtml5 ،وكيفية انشاء نماذج متخصصة  بكل عناصرها ومحتوياتها لتمكننا من التفاعل مع المستخدمين والحصول على البيانات اللازمة بطرق احترافية وامنة  .', 'كما نعلم اليوم لا نستطيع الاستغناء عن الإنترنت ولا عن صفحات الويب في جميع مجالات حياتنا. وتعتبر لغة HTML 5 أساسية لأي اصفحةويب ، كما أنها تعتبر لغة سهلة وبسيطة للتعلم. فكان لا بد لنا. من تخصيص هذه الدورة بعد تخصيصنا دورة اساسيات لغة html5 لنتحدث بنوع من التخصص في ميزات هذه اللغة نظرا لأهميتها', 'يتقن اساسيات لغة html5  \r\nحضور دورة اساسيات لغة html5  المتوفرة على منصة النمط في قسم الدورات المسجلة.', NULL, NULL, '2023-03-20', '20230318134136.png', 'لغة-html5-المستوى-الثاني', 1, 0, 0, 'html5, برمجة،تصميم صفحات الويب،جداول  html5،html,نماذج الhtml5 ,htmk5 tables,html5 forms,html5 images ,html5 links،تصميم مواقع الويب web design', NULL, '2023-03-18 18:41:36', '2023-03-20 12:21:52');
