(2, 66, '2023-03-18 09:13:09', 'hamada', NULL, 'hamadaali221133@gmail.com', '$2y$10$WxV4cIpLAkHrutg6QYFyQ.e1E62syHkkbD.z4mFB64V.77cwxyofK', NULL, NULL, NULL, NULL, NULL, '2022-03-15', '345678999998', '1628835827.jpeg', NULL, 'ergergerffffff', '<p dir=\"RTL\">الدكتور حسني المستريحي&nbsp;</p>\r\n\r\n<p dir=\"RTL\">باحث ومدرب في التنمية البشرية والصحة النفسية&nbsp;</p>\r\n\r\n<p dir=\"RTL\">استاذ جامعي&nbsp;</p>\r\n\r\n<p dir=\"RTL\">رئيس هيئة مديرين&nbsp;</p>\r\n\r\n<p dir=\"RTL\">مؤلف&nbsp;</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">قام بتأليف عدة كتب هي :&nbsp;</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>', NULL, 1, 0, 1, 1, NULL, 'instructor', NULL, NULL, 0, NULL, '57.1657945286.png', '', '1657945286.png', '19.1657945347.png', '73.1657945347.png', '35.1657945347.jpg', '51.1661327170.pdf', 1, NULL, NULL, NULL, '2023-03-18 09:13:09'),
(33, 101, '2023-03-22 12:34:29', 'الدكتور حسني المستريحي', NULL, 'dr.husni777@gmail.com', '$2y$10$uyOBMUqW4n0/As9ZpIHQ.e.niUTVIQf7tA2NyD7bHSD7sW/y20sN.', NULL, NULL, NULL, NULL, NULL, NULL, '00966580981640', '1665594843.jpeg', NULL, 'أردني', '<p dir=\"RTL\">الدكتور حسني المستريحي&nbsp;</p>\r\n\r\n<p dir=\"RTL\">باحث ومدرب في التنمية البشرية والصحة النفسية&nbsp;</p>\r\n\r\n<p dir=\"RTL\">استاذ جامعي&nbsp;</p>\r\n\r\n<p dir=\"RTL\">رئيس هيئة مديرين&nbsp;</p>\r\n\r\n<p dir=\"RTL\">مؤلف&nbsp;</p>\r\n\r\n<p dir=\"RTL\">قام بتأليف عدة كتب هي :&nbsp;</p>\r\n\r\n<p dir=\"RTL\">كتاب ( لا تخف )&nbsp;</p>\r\n\r\n<p dir=\"RTL\">يرشدك الكتاب الى طرق التغلب على المخاوف المختلفة وكسر حاجز الخوف&nbsp;</p>\r\n\r\n<p dir=\"RTL\">رابط شراء الكتاب نسخة رقمية بصيغة PDF</p>\r\n\r\n<p dir=\"RTL\"><a href=\"https://www.smashwords.com/books/view/1112136\"><span dir=\"LTR\">https://www.smashwords.com/books/view/1112136</span></a></p>\r\n\r\n<p dir=\"RTL\">كتاب (من الشغف الى الهدف )&nbsp;</p>\r\n\r\n<p dir=\"RTL\">يرشدك الكتاب طريقة تحديد موهبتك وشغفك وكيفية استثمارهم لتحقيق النجاح&nbsp;</p>\r\n\r\n<p dir=\"RTL\">رابط شراء الكتاب نسخة رقمية بصيغة PDF</p>\r\n\r\n<p dir=\"RTL\"><a href=\"https://www.smashwords.com/books/view/1010475\"><span dir=\"LTR\">https://www.smashwords.com/books/view/1010475</span></a></p>\r\n\r\n<p dir=\"RTL\">كتاب ( حالتي النفسية سيئة جدا )&nbsp;</p>\r\n\r\n<p dir=\"RTL\">يرشدك الكتاب عن طرق التخلص من الحالة النفسية السيئة والوصول الى السعادة والسلام الداخلي&nbsp;</p>\r\n\r\n<p dir=\"RTL\">رابط شراء الكتاب نسخة رقمية بصيغة PDF</p>\r\n\r\n<p dir=\"RTL\"><a href=\"https://www.smashwords.com/books/view/1066148\"><span dir=\"LTR\">https://www.smashwords.com/books/view/1066148</span></a></p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>', NULL, 1, 0, 1, 1, NULL, 'instructor', NULL, NULL, 0, NULL, '40.1661263559.jpg', NULL, '1661263736.jpg', '90.1665139412.jpg', '21.1665139412.jpg', '46.1666065711.tif', '99.1661264082.pdf', 1, NULL, NULL, '2022-08-02 09:34:12', '2023-03-22 12:34:29'),
