(101, 188, '2022-08-14 10:13:45', 'احمد علاءالدين محمد على', NULL, 'ahmed4alaa@gmail.com', '$2y$10$ys34e2ivOzmN4Ju1M4nq7.CM79VDhVLQf9pVrPzB/zfPw9WnUjFI2', NULL, NULL, NULL, NULL, NULL, NULL, '01000631030', '1660453113.jpg', NULL, 'مصري', 'بطاقة تعريف المدرب احمد علاءالدين \r\n•	دبلوم ادارة الاعمال –  كلية التجارة – جامعة جنوب الوادي 2021 - 2022\r\n•	حاصل علي ليسانس الاعلام قسم العلاقات العامة والإعلام السياحي لعام 2006\r\n•	خبرة عملية في ادارة المستشفيات والرعاية الصحية لأكثر من 14 عام\r\n•	بدأ مشواره في عالم التدريب منذ العام 2012\r\n•	مدرب معتمد من العديد من الجهات الحكومية والدولية:\r\no	 جامعة كامبريدج البريطانية\r\no	وزارة التربية والتعليم \r\no	د. طارق السويدان \r\no	د. ابراهيم الفقي\r\no	د. سليمان العلي\r\no	د. محمد ابو فرحة\r\no	ايديو ماستر\r\no	بيسيرت اكاديمي امريكا\r\no	الفنية العالمية للتدريب ليبيا\r\n•	المدير العام والمتحدث الرسمي لمؤتم الشباب للتأهيل لسوق العمل بقنا ٢٠١٧\r\n•	مدرب تابع لأسرة ادمن بجامعة القاهرة\r\n•	سفير شباب مصر\r\n•	مدرب في المجالات الآتية \r\no	ادارة الاعمال\r\no	الموارد البشرية\r\no	خدمة العملاء \r\no	ريادة الاعمال\r\no	ادارة المنشآت الصحية\r\no	نظم وادارة الجودة\r\n•	مشارك في العديد من مؤسسات المجتمع المدني :\r\no	مؤسسة القادة للعلوم الادارية والتنمية\r\no	الاتحاد الدولي للتعاون الاقتصادي والسياسي بالمملكة المتحدة\r\no	مدرب اقليمي تابع لهيئة قصور الثقافة المصرية', NULL, 0, 0, 1, 1, NULL, 'instructor', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '63.1660453257.pdf', 1, NULL, NULL, '2022-08-14 09:52:57', '2022-08-14 10:13:45'),
