(111, 188, '2022-08-14 17:48:34', 'اسراء الصاوي', NULL, 'asraalsawy@gmail.com', '$2y$10$JFpSKELhKpiFJLmq8.k4met0KC1ap7bS2Wo9pQsqmZAzxCbYsjW5a', NULL, NULL, NULL, NULL, NULL, NULL, '01000290329', '1660480959.jpg', NULL, 'مصرية', 'أنا صانعة محتوي بتقنية storytelling أقدم محتوي رقمي بالحكي في المجال التربوي والتعليمي .\r\n\r\nمن خلال الدمي والرسوم المتحركة أقدم عدد من الخدمات:\r\n- كمسرحة المناهج وإنتاج حلقات إرشادية.\r\n- إنتاج فيديوهات ترويجية وتسويقية\r\n- إنتاج دورات وكورسات تدريبية\r\n- استشارات نفسية وتربوية\r\n\r\nكما أقدم عدد من خدماتي المصغرة :\r\n\r\n- الكتابة إذا كانت سيناريو أو مقالات أو نصوص\r\n- تحرير النصوص والتحرير والتدقيق الإملائي\r\n- التصميم ومونتاج الفيديو\r\n- تصميمات السويشال ميديا\r\n- التفريغ الصوتي\r\n- إدارة السويشال ميديا\r\n\r\nخبرة 11 سنوات في مجال الميديا والتدريب ولدي عدد من المهارات التسويقية والإدارية\r\nخدماتي', NULL, 0, 0, 1, 1, NULL, 'instructor', NULL, NULL, 0, NULL, NULL, NULL, '1660481036.jpg', NULL, NULL, '33.1660481161.jpg', '84.1660481206.pdf', 1, NULL, NULL, '2022-08-14 17:32:42', '2022-08-14 17:48:34'),
