(154, 111, '2022-08-29 20:03:17', 'زينب سمير سيف الدين', NULL, 'zynabsaifaldeen66@gmail.com', '$2y$10$.fx9C0qEVaY9hsDJgN3eNe2Z1dHpb4slC0UXOR0zY./i3AlZOLqfW', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'مدربة معتمدة دوليًا في عالم التدريب، وأستاذة في التعليم الثانوي خبرة عشر سنوات.  حاصلة على ماجستير من الجامعة اللبنانية في اللغة العربية وآدابها،  وعلى كفاءاة من قبل كلية التربية في الارشاد والتوجيه وكيفية إعداد مدرسين.', NULL, 0, 0, 0, 1, NULL, 'instructor', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, '2022-08-17 03:42:50', '2022-08-29 20:03:17'),
(155, 188, '2022-08-17 04:16:50', 'أسماء عطا عبد الوهاب', NULL, 'asmaahedab1986@gmail.com', '$2y$10$Q2uq63Dt5TLn1cknLJKUqeR7Hkkyayk1tp9hbiUdFrmM/j0VCgS/i', NULL, NULL, NULL, NULL, NULL, NULL, '0021093828329', NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 1, NULL, 'instructor', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, '2022-08-17 04:16:25', '2022-08-17 04:16:50'),
(156, 208, '2023-03-22 10:03:42', 'د.حسام حمد المستريحي', NULL, 'elmestarihi1@gmail.com', '$2y$10$P9zgLCqzW/iKIU340DR7RuotbinbQNqtIwUo10Yyv9U2irlHSKzTm', NULL, NULL, NULL, NULL, NULL, NULL, '55546832', '1677477491.PNG', NULL, 'اردني', '<p>خبير تربوي ومتخصص بادخال التكنولوجيا في مجالات التعليم والادارة</p>\r\n\r\n<p>حاصل على بكالوريس حاسوب ودبلوم عام تربية ودبلوم خاص تربية ودبلوم لغة انجليزية&nbsp;وماجستير&nbsp;ادارة ادارة الاعمال MBA&nbsp;ودكتوراه في التعليم الالكتروني والتعلم عن بعد.</p>\r\n\r\n<p>حاصل على شهادات محلية ودولية في التدريب المعتمد وتحكيم الربوت ومشارك في مؤتمرات محلية ودولية، عضو معتمد في مؤسسات محلية ودولية واهمها جمعية الربوت العربية ولجنة التعليم الالكتروني في دولة قطر ومنظمة الرخصة الدولية لقيادة الحاسوب.</p>\r\n\r\n<p>مؤلف للعديد من الكتب في مجال الكمبيوتر والارشفة الالكترونية ومناهج التربية.</p>\r\n\r\n<p>عملت مبرمج ومعلم ومنسق ومدرب ومدير لادارة عدة مراكز دولية.</p>\r\n\r\n<p>elmestarihi1@gmail.com</p>', NULL, 1, 0, 1, 1, NULL, 'instructor', NULL, NULL, 0, NULL, NULL, NULL, NULL, '98.1661246231.pdf', '34.1661245643.pdf', '34.1661245643.pdf', '55.1661245704.pdf', 1, NULL, NULL, '2022-08-17 11:50:21', '2023-03-22 10:03:42'),
