(158, 96, '2022-09-29 16:35:48', 'سيناء حميدرشيد', NULL, 'hameedsena@gmail.com', '$2y$10$D4u/WemK/HbHR9gS7wELruvfBeURCNhW2IQtk1SyGd5Ad8KSSH5ha', NULL, NULL, NULL, NULL, NULL, NULL, '07706265648', '1661957654.jpg', NULL, 'العراق', 'م.م سيناء حميد رشيد/مدرس مساعد علم نفس تربوي /مكان العمل كلية التربية للعلوم الانسانية قسم العلوم التربوية والنفسية/جامعة تكريت/حصلت على شهادة البكلوريوس /جامعة بغداد/كلية الآداب ثم حصلت على الماجستير علم نفس تربوي من جامعة تكريت ثم درست دكتوراة في جامعة تكريت في مرحلة البحث .لدي اشتراك في دورة انعاش العقل وتسريع الحفظ \r\nاعمل في الجامعة منذ 17عام تقريبا الهويات القراءة وتعلم لغات جديدة', NULL, 0, 0, 1, 1, NULL, 'instructor', NULL, NULL, 0, NULL, '82.1661847956.jpg', NULL, '1661847956.jpg', NULL, '82.1661848127.jpg', '3.1661848127.jpg', '12.1661957814.pdf', 1, NULL, NULL, '2022-08-18 12:32:13', '2022-09-29 16:35:48'),
