(164, 111, '2023-01-01 22:37:30', 'نجوى سليمان صبح', NULL, 'najwassobh@gmail.com', '$2y$10$ru50ZIp9t5TBDkv5heC0JuGAmsh8WBIJNNEXOgAGcsM/bZZ9VuuaO', NULL, NULL, NULL, NULL, NULL, NULL, '03464162', '1660848735.jpg', NULL, 'لبنانية', 'بدأت عملي كمعلمة مع اطفال متلازمة داون، ثم مع ذوي الصعوبات التعليمية، أما الآن فأنا معلمة لغة عربية لصفوف الحلقة الأولى ومنسقة  للغة العربية لصفوف الروضات وكذلك مدربة وحاصلة على شهادات تدريب.\r\nدربت معلمات واهالي في عدة مراكز ومدارس في لبنان كما دربت عن بعد.\r\nكما أني أنشأت صفحتي الخاصة على فايس بوك باسم *معا نُعلّم ونتعلّم \r\nhttps://www.facebook.com/nssobh\r\nأعمل مع الأطفال لمساعدتهم ودعمهم في اكتساب الحرف وصولا للقراءة والكتابة.\r\nحاصلة على شهادة إجازة تعليمة وعلى دبلوم في التربية المختصة.\r\nبدأت العمل على برنامج لتبسيط فكرة الحرف لدى الأطفال.', NULL, 0, 0, 1, 1, NULL, 'instructor', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '75.1660848867.docx', 1, NULL, NULL, '2022-08-18 23:12:33', '2023-01-01 22:37:30'),
