(212, 188, '2022-10-24 21:14:40', 'ايمن محمد امين بكري', NULL, 'aiman2000b@gmail.com', '$2y$10$DSJ5FTYScUGX/32V4NLWg.CPKTiFrZzqDa/sUdSMJkn4lQ32dNKbC', NULL, NULL, NULL, NULL, NULL, NULL, '01553556899', NULL, NULL, 'مصري', 'أيمن بكري مدرب دولي معتمد في  التنمية البشرية وعمل لدي كثير من المؤسسات الخاصه في اكتشاف المتدربين وتنمية ذاتهم بشكل احترافي من عام ٢٠١٥-٢٠١٨. كما قام بالتدريب داخل بعض الوزارات بجمهورية مصر العربية مثل وزارة الشباب والرياضة وكان من فريق مدربي موقع مصرتعمل الذي تضمن تدريب اكثر من ٢٠ مليون شاب داخل وخارج مصر .حصل أيمن بكري على اعتماد شركه مايكروسوفت للتدريب من خلال وزارة الشباب والرياضه مصر لمدة عامين من ٢٠١٩ - ٢٠٢١. كما حصل على اعتماد اكثر من ٣٢ جهة تدريبية حول العالم  \r\n استطاع أيمن بكري ان يضع فلسفه تدريبية للمتدربين و هي تشخيصهم بإكتشافه موهبتهم الفطرية و امدادهم بالأدوات اللازمه لهم . ليستطيعوا ان يتمكنوا من السعي في هدفهم ويسجلوا نجاحاتهم المبدئية .قام أيمن بكري بتدريب عدد يفوق ٢٠٠٠ متدرب بعد اكتشاف موهبتهم الفطرية و اندمجوا بسوق العمل من خلال ريادة الاعمال والعمل الحر كما درب اكثر من ١١ الف متدرب داخل مصر و خارجها \r\n\r\nالمواد التدريبية التي قام بتدريبها \r\n\r\nريادة الاعمال -المهارات الحياتية و الوظيفية-العمل الحر - التسويق والمبيعات - خدمة العملاء - الموارد البشرية - اللايف كوتش', NULL, 0, 0, 1, 1, NULL, 'instructor', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, '2022-08-23 19:04:54', '2022-10-24 21:14:40'),
