(283, 188, '2023-03-13 01:47:17', 'احمد شعبان السيدعلي', NULL, 'ahmedshaabanelsayed@gmail.com', '$2y$10$i8V/1Q4QdojcT9CtSM7GMe3BmhA0o7gy7aYGTdnEh3B75LPq7firu', NULL, NULL, NULL, NULL, NULL, NULL, '01277746667', '1661899482.JPG', NULL, 'مصري', 'لواء دكتور/احمد شعبان السيد علي،،دكتوراه في القانون العام-كلية الحقوق-جامعة الأسكندرية...خبيرأمني في مجال الطرق والسلامة المرورية...من جمهورية مصر العربية', NULL, 0, 0, 1, 1, NULL, 'instructor', NULL, NULL, 0, NULL, NULL, NULL, NULL, '77.1665181286.mp4', NULL, NULL, '23.1665184075.pdf', 1, NULL, NULL, '2022-08-27 14:07:07', '2023-03-13 01:47:17'),
(284, 188, '2023-02-23 00:10:14', 'د. فوزيه فايز صديق الدخاخني', NULL, 'fawziafayez753@gmail.com', '$2y$10$VNJd9rxlTROdOY5IJZ8zVuEInmS79rtJ1kJOT0tKp6Ceg6R5FomO2', NULL, NULL, NULL, NULL, NULL, NULL, '01558253083', '1672155200.jpg', NULL, 'مصريه', '<p>د/ فوزيه الدخاخني<br />\r\nمدرس مساعد بالجامعه الامريكيه العالميه&nbsp;<br />\r\nكاتبه ومدربة تنمية موارد بشريه معتمد من المؤسسه الدبلوماسيه لسفراء السلام حول العالم<br />\r\nعضو في منظمة العفو الدوليه<br />\r\nماجستير خدمه اجتماعيه من جامعة الاسكندريه<br />\r\nدكتوراه مهني مصغر في التنميه البشريه<br />\r\nماجستير مهني مصغر إدارة أعمال<br />\r\nماجستير مهني مصغر علم نفس&nbsp;<br />\r\nحاصله على كأس العالم للمبدعين العرب بلندن٢٠٢٠كافضل مدرب تنمية موارد بشريه في مجال التحفيز&nbsp;<br />\r\nتم تكريمي من السفير السابق للسودان محمد نصر الدين كرائده مصريه مميزه٢٠١٨<br />\r\nتم تكريمي من معهد فالكون والجمعية الافريقيه كشخص مؤثر دوليا ومحليا٢٠٢٠<br />\r\nشاركت في مؤتمرات مثل مؤتمر افضل كوتش ومدرب&nbsp;<br />\r\nمؤتمر بناء انسان٢٠٣٠<br />\r\nقدمت العديد من الدورات التدريبية في مبادرة سند ومبادرة نعم نستطيع تبع اليمن<br />\r\nوبعض الأكاديميات اونلاين&nbsp;<br />\r\nولي عدة مؤلفات&nbsp;<br />\r\nجسور الاوهام&nbsp;<br />\r\nدع الصبح يتنفس&nbsp;<br />\r\nثلاثية الشوق المحترق&nbsp;<br />\r\nخد الورد<br />\r\nالشارده&nbsp;<br />\r\nالخريف الموجع</p>', NULL, 0, 0, 1, 1, NULL, 'instructor', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, '2022-08-27 14:53:01', '2023-02-23 00:10:14'),
