(344, 188, '2022-09-01 17:20:04', 'أسماء رياض أنور', NULL, 'asmaariad99@gmail.com', '$2y$10$SpysmG1cBIuK5DCjbuj8Yeuk6PgZVlzJ9gPx3BYGy.PefQM4vUwYS', NULL, NULL, NULL, NULL, NULL, NULL, '01271803140', '1662034522.jpg', NULL, 'مصرية', 'ليسانس آداب _ قسم علم نفس _ جامعة الإسكندرية \r\nحاصلة على تمهيدي ماجستير كلية الآداب _ جامعة طنطا \r\nباحثة ماجستير _ جامعة طنطا \r\nعضو في الجمعية المصرية المعالجين النفسيين \r\nعضو في رابطة الأخصائيين النفسيين \r\nعضو في الجمعية العلمية للصحة النفسية \r\nعضو في الجمعية المصرية للعلاج المعرفي والسلوكي\r\nمدرب دولي معتمد من المجموعة الدولية للتعليم الذكي _ تركيا \r\nحاصلة على دورة في العلاج المعرفي والسلوكية الإضرابات الشخصية من مركز البحوث والدراسات النفسية _ كلية الآداب جامعة القاهرة \r\nحاصلة على دورة العلاج باللعب من مركز بي برفكت للطب النفسي \r\nحاصلة على دورة تأهيل تربوي _ كلية التربية _ جامعة الإسكندرية \r\nمتدرب في مستشفى بنها للطب النفسي وعلاج الإدمان ( الأمانة العامة للصحة النفسية) \r\nحاصلة على دورة في العلاج المعرفي والسلوكية للتخلص من السلوكيات الإنسانية _ من الجمعية المصرية المعالجين النفسيين \r\nاخصائي نفسي إكلينيكي \r\nأخصائي علاج نفسي وسلوكيا وإرشاد اسري', NULL, 0, 0, 1, 1, NULL, 'instructor', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, '2022-09-01 16:58:59', '2022-09-01 17:20:04'),
