(367, 111, '2022-09-14 16:48:11', 'Fatina.FAO', NULL, 'fatina.el.omar@outlook.com', '$2y$10$7kuWyq8A.N15DLO.XDoUZ.tQ10q.0NALFxIEeEemGhEujV8U9WS7K', NULL, NULL, NULL, NULL, NULL, NULL, '0096171779091', NULL, NULL, 'لبنانية', 'سلام عليكم \r\n\r\nاسمي فاتنة حائزة على إجازة جامعية في المعلوماتية الإدارية و متخصصة في مجال تصميم و تطوير المواقع الالكترونية ،  لدي خبرة طويلة مع الكومبيوتر عملت في عدة وظائف تعليمية وادارية. اعمل حاليا ك freelancer و كمعلمة في مركز الغد تعليمي ، احب الكتابة و خاصة العلمية و التكنولوجية لذلك اتجهت لكتابة المقالات و المحتوى مع عدة مواقع اونلاين \r\n\r\nبالاضافة الى انني مصممة جرافيك موهوبة ومبدعة لذلك حظيت بتدريب وعمل في مجال التصميم الجرافيكي من مرسي كورب\r\nمن اهم مبادئي ان الاحترام و الصدق .\r\n\r\nاذا احتجت لاي استفسار لا تتردد في التواصل معي ساكون سعيدة لمساعدتك في اي وقت.', NULL, 0, 0, 1, 1, NULL, 'instructor', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, '2022-09-03 03:10:11', '2022-09-14 16:48:11'),
(368, 156, '2022-09-03 04:40:05', 'أسماء محمد قاسم', NULL, 'as2322001@gmail.com', '$2y$10$oP9ylXIkzyoV4.XBKoWEGe4WCrHsA9WBabloN7oChhTGqcuky86oS', NULL, NULL, NULL, NULL, NULL, NULL, '00972599564450', NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 1, NULL, 'instructor', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, '2022-09-03 04:39:40', '2022-09-03 04:40:05'),
(369, 96, '2022-09-27 21:21:49', 'Mohamad Qassim', NULL, 'mohamadq972@gmail.com', '$2y$10$2Cy2i5D4ryBo/xkHQAc/0.K0D/XYvTtOoFKipSLiEOCmMa7CzdWUe', NULL, NULL, NULL, NULL, NULL, NULL, '07722559793', '1662164000.jpeg', NULL, 'العراق', 'محمد قاسم زبون\r\nخريج الاكادمية الدولية لتصميم الازياء \r\nلدي شهادة ماجستير في (الهوت كوتر) الازياء الراقية\r\nوايضاً مستشار مظهر واناقة\r\nوشهادة مشاركة في الدورة ٢٤من الدار العراقية للازياء\r\nوعضو في نقابة الفنانين العراقيين', NULL, 0, 0, 1, 1, NULL, 'instructor', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, '2022-09-03 04:46:45', '2022-09-27 21:21:49'),
(370, 188, '2022-09-08 09:13:35', 'م. أيمن السيد أحمد اللويزي', NULL, 'aymanellwayze@gmail.com', '$2y$10$EtMXHZvAgiGT3ak5Xnf96uh1hd2WdBQFfOvt6HJFPHFS57rm5vUNG', NULL, NULL, NULL, NULL, NULL, NULL, '01555511184', '1662488819.JPG', NULL, 'مصري', 'م. أيمن السيد اللويزي \r\nالمدير العام لشركة اللويزي للخدمات الزراعيه\r\nخبير وإستشاري لاندسكيب وشبكات ري\r\nأخصائي تدريب أول بالإداره المركزيه للتدريب بديوان عام وزارة الزراعه بالدقي\r\nصاحب رؤية خاصة في التدريب بتعتمد علي التدريب بالممارسة و التطبيق العملي في نطاق حقيقي\r\nتنفيذما يزيدعن 100 دورة ندريبية بالشراكة مع عدد كبير من كليات الزراعة', NULL, 0, 0, 1, 1, NULL, 'instructor', NULL, NULL, 0, NULL, '46.1662489050.jpg', NULL, '1662489050.jpg', NULL, NULL, NULL, NULL, 1, NULL, NULL, '2022-09-03 09:41:28', '2022-09-08 09:13:35'),
(371, 156, '2023-02-18 17:09:25', 'جهاد نعيم عبد الرحمن قمحية', NULL, 'jihadqam@gmail.com', '$2y$10$pblKsbhMrK6iPossfQSEm.iYNVlEaPyWze6gxBERUJx.vUGJGKCtS', NULL, NULL, NULL, NULL, NULL, NULL, '00972599377662', NULL, NULL, 'فلسطينية', 'مرشدة تربوية \r\nمدربة حساب ذهني \r\nمدربة معتمدة من المركز العالمي الكندي \r\nكوتش من الاكاديمية الدولية لفن الكوتشينج ابمغرب \r\nمدربة تعديل سلوك من اكاديمية الوسط للتدريب الالكتروتي \r\nدبلوم ابداع والابتكار', NULL, 0, 0, 1, 1, NULL, 'instructor', NULL, NULL, 0, NULL, '94.1663998272.jpg', NULL, '1663998272.jpg', NULL, '87.1663998657.jpg', '9.1663998657.jpg', '34.1663999031.jpg', 1, NULL, NULL, '2022-09-03 10:02:13', '2023-02-18 17:09:25'),
