(546, 188, '2023-03-09 16:51:03', 'Mohamed Hassan Hussein Alkammar', NULL, 'mohamed.alkammar@gmail.com', '$2y$10$BXW3p9hZefSqL6cChgtBcuPuOx705tMxWj3a0rS/qdvKvtadQ2k.W', NULL, NULL, NULL, NULL, NULL, NULL, '01004702206', '1663858876.jpg', NULL, 'مصرى', 'الدكتور محمد حسن الكمار\r\nدكتوراة فى تطوير ادارة الموارد البشرية\r\nد. الدكتوراة المهنية فى ادارة الاعمال \r\nحاصل على ماجستير الأعمال الدولية\r\nحاصل على الماجستير المهنى فى التحكيم التجارى الدولى \r\nرئيس قسم ادارة الموارد البشرية باحدى شركات العالمية\r\nمحاضر ومدرب فى مجال ادارة  الموارد البشرية والمهارات الادارية\r\nمستشار ادارة الموارد البشرية\r\nمستشار تحكيم تجارى دولى فى مجال الاستثمار\r\nقام بالتدريب لاكثر من 10000 ساعة تدريبية منذ عام 2010 و حتى الان \r\nقام بالتدريب لدى العديد من شركات التدريب مثل اياك و المركز الثقافى المصرى و كامبريدج و نيوهريزون و شركة بترومنت و ماسترى أكاديمى\r\nمؤسس احدى شركات التدريب المصرية\r\nقام بتدريب العاملين لشركات كثيرة مثل ايكسون موبيل العراق و عجيبة للبترول و شركة المراعى و شركة فودافون و شركة مدار و غيرها من الشركات\r\nيوتيوبر (صاحب قناة على اليوتيوب فى موضوعات الادارة و التدريب و التطوير)\r\nمؤلف كتاب \"ادارة الاداء من النظرية للتطبيق\" - تحت الطبع', NULL, 0, 0, 1, 1, NULL, 'instructor', NULL, NULL, 0, NULL, '1.1663021164.png', NULL, '1663021164.jpeg', NULL, NULL, NULL, '47.1663021481.pdf', 1, NULL, NULL, '2022-09-12 14:18:49', '2023-03-09 16:51:03'),
