(641, 188, '2022-10-01 07:21:35', 'Hany Elmehy', NULL, 'hanyelmehy825@gmail.com', '$2y$10$lIQB6gloe/YE0W.jdXha7.TIikDmTP7lh.HTI9nfW02ezsWR.Udoq', NULL, NULL, NULL, NULL, NULL, NULL, '00201550133234', '1663326796.jpeg', NULL, 'مصرى', 'هانى الميهى 👈أ / الدرسات الاعلاميه و السياسية . حاصل على بكالوريوس اداب قسم اعلام تخصص دراسات اعلاميه و سياسيه جامعه طنطا 👈مقدم برنامج مرئي و اذاعى وكاتب صحفى واعلامى 👈عضو عامل بالنقابه العامه للصحافه والإعلام . 👈مؤلف كتاب فريده والعالم الاخر 👈محاضر كيف تتخلص منً جلد الذات الاتصال الذاتي بين الفرد ونفسه الاتصال الروحاني هي علاقة الانسان بربه ازاي تشوف كل أزماتك و أمورك بشكل مختلف تماما . 👈مدير مكتب طنطا لجريده صوت الناس الحر . 👈عضو عامل بالمنظمة المصريه لتقص الحقائق . مستشار خاص التخطيط والتنفيذ الاعلامى للصحافه الإلكترونيه والسوشيال ميديا . مواليد ١٩٨١ مصر – الغربية - طنطا', NULL, 0, 0, 1, 1, NULL, 'instructor', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '65.1663326585.jpeg', 1, NULL, NULL, '2022-09-16 15:54:15', '2022-10-01 07:21:35'),
