(760, 111, '2023-02-26 00:58:33', 'Fatima Abdallah', NULL, 'fatima.18.f.m.a@gmail.com', '$2y$10$k7QfBrDlGTOHAIcDdrYbvOhVI3LA6EWl.xyoZl45F71IqV6dqhd5u', NULL, NULL, NULL, NULL, NULL, NULL, '71395798', '1664121393.jpeg', NULL, 'لبنانية', 'اسمي فاطمة، عمري 22 سنة، خريجة الجامعة اللبنانية(كلية التربية)، اختصاص تربية الطفولة المبكرة(لغة انكليزية) لدي خبرةسنتين من اعطاء دروس خاصة في مختلف المواد، استطيع ايصال الافكار والدروس بطريقتي. من هواياتي القراءة، الكتابة والسباحة. كما أحب تعلم اللغات. أريد الوصول  وتحقيق أهدافي، وهذه احدى الخطوات: أن أعطي دورات ودروس بطريقة مبتكرة وتحضيرها بكل ما لدي من طاقة(عند قيامي بعمل ما، أعطيه كل ما لدي) لتصل اليكم و تفيدكم. أتمنى أن يعجبكم المحتوى.\r\nMy name is Fatima, I am 22 years old. I have a certificate in Early Childhood Education (English) from the Lebanese University. I have 2 years of experience in giving private lessons and agenda in different subjects. I can deliver information and lessons in a my way. I like to read, write and swim. As I also like learning different languages. I want to go far and achieve my goals and this is one of the steps: to give courses and lessons in a creative way giving it all I have)because when I Do something, I do it with all my heart and energy) to reach you and benefit you in the best way possible. I wish you like my content.', NULL, 0, 0, 1, 1, NULL, 'instructor', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, '38.1664118008.jpeg', NULL, 1, NULL, NULL, '2022-09-25 17:24:53', '2023-02-26 00:58:33'),
