(778, 188, '2023-03-20 15:58:51', 'احمد مقبول', NULL, 'ahmed2032001mohamed@gmail.com', '$2y$10$yjnjysCRboEvycOr57manerOGuql0xvfRRcgctRuDsU24Z6JqRbP6', NULL, NULL, NULL, NULL, NULL, NULL, '201229864148+', '1668604082.png', NULL, 'مصري', '<p><strong><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:12px\"><span style=\"color:#000000\">احمد مقبول&nbsp;</span></span></span></strong><strong><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:12px\"><span style=\"color:#000000\">مدرب دولي معتمد في مجال التطوير المهني والموارد البشرية وادراة الأعمال</span></span></span></strong></p>\r\n\r\n<p><strong><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:12px\"><span style=\"color:#000000\">مدرب معتمد من المركز الدبلوماسي واكاديمية دكتور احمد لطيف والبورد الألماني.</span></span></span></strong></p>\r\n\r\n<p><strong><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:12px\"><span style=\"color:#000000\">يعمل في مجال </span></span></span></strong></p>\r\n\r\n<p><strong><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:12px\"><span style=\"color:#000000\">&gt; التطوير و&nbsp;الإدارة</span></span></span></strong></p>\r\n\r\n<p><strong><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:12px\"><span style=\"color:#000000\">&gt; التنمية البشرية</span></span></span></strong></p>\r\n\r\n<p><strong><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:12px\"><span style=\"color:#000000\">&gt; التعليم والتدريب </span></span></span></strong></p>\r\n\r\n<p><strong><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:12px\"><span style=\"color:#000000\">► ملخص المؤهلات </span></span></span></strong></p>\r\n\r\n<p><strong><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:12px\"><span style=\"color:#000000\">&gt;&gt; بدأت القصة منذ 3 سنوات شغلتُ عدة مناصب في إدارة وتطوير المشاريع في مختلف المنظمات الحكومية وغير الحكومية والشركات الخاصة.</span></span></span></strong></p>\r\n\r\n<p><strong><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:12px\"><span style=\"color:#000000\">مدرب مستقل منذ عام 2019 حتى الآن ، عمل بالاشتراك مع (جامعة سوهاج - فريق تنموين بلس -البورد الألماني -TPD-وحدة التضامن الاجتماعي بجامعة سوهاج - شركة بلان بي -اتحاد حلم مصر-معهد النمط المتقدم للتدريب- المركز الثقافي البريطاني -&nbsp; فريق كوتش أميرة مميش - ATI - فريق SESHAT)</span></span></span></strong></p>\r\n\r\n<p><strong><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:12px\"><span style=\"color:#000000\">تقديم دورات تدريبية ومحاضرات لأكثر من 3000 شخص من مختلف الأعمار علي مستوى مصر وبعض البلدان العربية. </span></span></span></strong></p>\r\n\r\n<p><strong><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:12px\"><span style=\"color:#000000\">حاصل على ماجستير مهني في ادارة الأعمال وآخر في الموارد البشرية من المركز الدبلوماسي. تقديم أكثر من عشر مواضيع لدورات تدريبية مختلفة في تطوير الذات والتطوير المهني.</span></span></span></strong></p>\r\n\r\n<p><strong><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:12px\"><span style=\"color:#000000\">اجريت عدة لقاءات تليفزيونية وصحفية مثل قناة مودة وجريدة اناقة فكر.</span></span></span></strong></p>\r\n\r\n<p><strong><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:12px\"><span style=\"color:#000000\">تم تكريمي&nbsp;من قبل وحدة التضامن الاجتماعي كأفضل عضو عام 2022 </span></span></span></strong></p>\r\n\r\n<p><strong><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:12px\"><span style=\"color:#000000\">تم تكريمي من بنك التطوع المصري كأفضل عضو عام 2022 </span></span></span></strong></p>\r\n\r\n<p><strong><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:12px\"><span style=\"color:#000000\">للتواصل: </span></span></span></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:12px\"><span style=\"color:#000000\">Mobile: +201229864148 </span></span></span></strong></p>\r\n\r\n<p><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:12px\"><span style=\"color:#000000\"><strong>Email: ahmed2032001mohamed@gmail.co</strong>m</span></span></span></p>', NULL, 0, 0, 1, 1, NULL, 'instructor', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '9.1664546830.pdf', 1, NULL, NULL, '2022-09-28 03:57:26', '2023-03-20 15:58:51'),
