(795, 101, '2023-01-31 01:36:48', 'منال حسن محمد العدوان', NULL, 'manalaladwan7@gmail.com', '$2y$10$tIfeO/WI/nkFpq6TVgDXqOjxNZKR1Mt65xF7cZfyee.Yw1vTd1cXe', NULL, NULL, NULL, NULL, NULL, NULL, '0796665474', '1667075048.jpg', NULL, 'الأردنية', '<p style=\"text-align: right;\">مدرب معتمد من الوطنية للتشغيل والتدريب التابعة لوزارة العمل الأردنية، والأكاديمية العالمية للتدريب والتطوير ( GATD ) ، والجمعية الدولية لتطوير الأفراد والأداء (IAPPD) ، بعد حصولي على دورة دورة تمكين المدربين ( EOT ) Empowering Of Trainer بواقع ( 72 ) ساعة تدريبية ، بالإضافة إلى عملي في مجال الإدارة والموارد البشرية في وزارة الصحة الأردنية منذ 12سنة ولا زلت على رأس العمل في مديرية تنمية القوى البشرية ، باحثة دكتوراه حاليا في إدارة الموارد البشرية في جامعة العلوم الماليزية ( USM) واحمل شهادة الماجستير في إدارة الاعمال ( القيادة التحويلية ,والأداء الابتكاري ) وشهادة البكالوريوس والدبلوم في نظم المعلومات الإدارية ومتطوع مع عدة جهات ، اهتم بالموارد البشرية والتنمية البشرية ودورات التدريبية الخاصة في تطوير الذات والتنمية البشرية وامتلك عدة مهارات الاتصال والتواصل واللغة وغيرها . وامتلك من الخبرة 17 عام موزعة ما بين (12) عام في القطاع العام (5) أعوام في القطاع الخاص<br />\r\nاسعى في الحصول على وظيفة افضل من اجل التطوير للأفضل في مجال الموارد البشرية والبحث والتطوير الإدارة ، والعمل على إعطاء الدورات التدريبة</p>', NULL, 0, 0, 1, 1, NULL, 'instructor', NULL, NULL, 0, NULL, '57.1667075085.jpeg', NULL, '1667075085.jpeg', NULL, '10.1666033563.jpg', '5.1666120261.jpeg', '67.1667075827.docx', 1, NULL, NULL, '2022-10-02 00:27:36', '2023-01-31 01:36:48'),
