(1347, 172, '2023-02-20 13:38:50', 'Dr.Mahmoud Kamal', NULL, 'mahokamo48@gmail.com', '$2y$10$m4dsy4C6txu.WHYURONDh.9kYC78NImTtM.BjnJ4.54WspI1gnZ7e', NULL, NULL, NULL, NULL, NULL, NULL, '00966557219500', '1671447304.jpg', NULL, 'Egyptian', '<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Enthusiastic, flexible, and motivating ESL instructor who creates teaching activities in accordance with the needs and levels of his students. I am an EFL teacher with about 20 years of experience. I have a bachelor&#39;s degree, a special diploma, a master&#39;s degree, and a Ph.D. degree in the same field. I have a CELTA certificate and a TEFL course, an IT course, and Scottish school placements from Strathclyde University, Scotland, UK. I have my published thesis in the international journal of Elementary Education, science publishing Group in June 2017. I have a university teaching experience at Albaha university for 2 years. Concerning my hobbies, I like teaching young learners and I use chants, rhymes, and short stories written by me to encourage them to communicate fluently.</p>\r\n\r\n<p>&nbsp;</p>', NULL, 0, 0, 1, 1, NULL, 'instructor', NULL, NULL, 0, NULL, '100.1671447635.pdf', NULL, '1671447635.pdf', '32.1671448577.pdf', '26.1671448577.pdf', '47.1671448577.pdf', '95.1671448759.pdf', 1, NULL, NULL, '2022-12-19 16:25:49', '2023-02-20 13:38:50'),
