(1384, 101, NULL, 'hfgg hfgh', 'hfggh', 'h@yahoo.com', '$2y$10$29cHgbYuVyk/hiDk3Owp6.l54QZVYTL6tWJraa8.4zgk0Per7Chji', 'Wker', 'Wakra, Ezdan 37', 'الوكرة', 'hfgg', 'hfgh', NULL, '55546832', NULL, NULL, NULL, NULL, NULL, 2, 2, 1, 1, NULL, 'student', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, '2022-12-24 01:57:24', '2022-12-24 01:57:24'),
(1385, 211, '2023-03-12 16:05:20', 'siba nzzeeer alhakeem', NULL, 'sibaalhakeem@gmail.com', '$2y$10$VWsHPp1PZ/qB2nhYHOModeAme1eyi642hJs8IXNtUNPFVrWJeS14C', NULL, NULL, NULL, NULL, NULL, NULL, '933884184', '1671873517.jpg', NULL, 'عربية سورية', '<h2><big><span style=\"font-size:16px\"><span style=\"color:#000080\"><span style=\"background-color:#D3D3D3\">صبا نذير الحكيم. مدرب دولي أسخر ما أملك من إحساس بالمسؤلية لتطوير التدريب و التخطيط السليم لفتح آفاق الإبداع و صنع قرارات جريئة و تحديد الأهداف و تطوير الذات لرفع كفاءات و إنتاجيات الأفراد و فتح أبواب الفرص و التميز.&nbsp;</span></span></span></big>مدرب دولي معتمد من كلية كنغستون البريطانية لإدارة الأعمال و مدرب دولي معتمد في&nbsp;البورد الألماني للتدريب و الاستشارات و مدرب معتمد من الجمعية الوطنية للشباب و التنمية التابعة لوزارة الشؤون الإجتماعية والعمل. و مدرب دولي معتمد لدى المؤسسة الدولية للبروتوكول و الإتكيت. مدرب دولي معتمد من النادي الدولي للتدريب. و المنسق العام للبورد الألماني بسوريا. و مدير مشاريع و عضو بمبادرة&nbsp;الجيل القادم لمؤسسة الجيل القادم. خريجة أدب إكليزي. حاصلة على دبلوم اعلام. دكتوراه فخرية و عضو&nbsp;بمؤسسة ترجمان العرب. دكتوراه فخرية مشتركة من الأكاديمية الدولية للسلام و الدفاع عن حقوق الإنسان و جمعية نساء رائدات. دكتوراه&nbsp;فخرية من المؤسسة العالمية للمرأة العربية. سفيرة السلام و الثقافة العربية لعام 2021.&nbsp;</h2>\r\n\r\n<h2>&nbsp;</h2>\r\n\r\n<h2>&nbsp;</h2>', NULL, 0, 0, 1, 1, NULL, 'instructor', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, '2022-12-24 02:08:32', '2023-03-12 16:05:20'),
