(1572, 101, '2023-03-22 11:37:55', 'Maha Mustafa Alotaibey', NULL, 'mhaaltyby85@gmail.com', '$2y$10$j528DGeb3bbm0WzWWjcsNeDUOaebxl9Cb625V6pIxJz0SgEkSBh7y', NULL, NULL, NULL, NULL, NULL, NULL, '009627876231120', NULL, NULL, 'اردنية', '<p>حاصلة على شهادة ماجستير نظم معلومات حاسوبية سنة 2007 &ndash;امتياز.</p>\r\n\r\n<p dir=\"RTL\">لدي خبرة طويلة في التدريس كمحاضرة نظم معلومات حاسوبية في الجامعات، والكليات ،والمراكز الثقافية&nbsp; وفي المدارس بالاضافة الى خبرتي الادارية&nbsp;&nbsp;كمساعدة ادارية ورئيسة قسم الجودة..وحصولي على دورات في التسويق الالكتروني ،وتصميم نظم المعلومات الحاسوبية rational rose .&nbsp;</p>\r\n\r\n<p dir=\"RTL\">&nbsp;ومن الجهة الأخرى حصلت على ماجستير مهني في علوم&nbsp; الصحة النفسية ،و دبلوم العلوم الاسرية ،وحصولي على دورات في العلاج السلوكي المعرفي والعلاج الجمعي والسيكودراما ،خاضعة لتدريب متخصص في&nbsp; الاصلاح والارشاد الاسري من جامعة الشرق الااوسط والقضاء الشرعي الاردني .</p>\r\n\r\n<p dir=\"rtl\">مدرب معتمد من&nbsp; المركز الكندي والأكاديمية العربية للتدريب .</p>\r\n\r\n<p dir=\"rtl\">أعطيت العديد من الدورات والمحاضرات النظرية والعملية&nbsp; في مجال الحاسوب والتعليم المعتمد على قدرات العقل ،بالاضافة الى الدعم النفسي والتربوي للطلاب .بالاضافة لاعطاء الدروس الخصوصية لجميع المراحل الدراسية&nbsp;&nbsp;لمادة الحاسوب والرياضيات من الصف الرابع&nbsp; للتاسع .</p>', NULL, 0, 0, 1, 1, NULL, 'instructor', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, '2023-02-11 22:59:12', '2023-03-22 11:37:55'),
