(1926, 101, '2023-03-08 21:20:48', 'ناصر بطاينة', 'ناصر فيصل بطاينة', 'bataynehnaser@gmail.com', '$2y$10$xfkT6ZWRxTJjMdvLXHUr9OGoc.rAOzFNachedAGdgUg0Zq.m5IlAu', 'عمان', 'ماركا', 'عمان', 'ناصر', 'بطاينة', NULL, '0780875103', NULL, NULL, NULL, NULL, NULL, 2, 2, 1, 1, NULL, 'student', 0, 'free', 0, NULL, NULL, '123', NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, '2023-03-08 21:11:42', '2023-03-08 21:20:48'),
(1927, 101, '2023-03-22 16:32:20', 'ناصر فيصل بطاينة', NULL, 'naserbatayneh@outlook.com', '$2y$10$I5yDi/LiXsSYQrmyn.EK7u1Xz6XGIKM6nkhPM64xMWX2QHMrGGzmO', NULL, NULL, NULL, NULL, NULL, NULL, '0780875103', '1678300304.jpg', NULL, 'الاردنية', '<p style=\"text-align:justify\"><span style=\"font-size:22px\">الاستاذ ناصر بطاينة خريج مدرسة ثانوية اربد الفرع العلمي وحاصل على شهادة&nbsp;البكالوريوس اللغة الانجليزية وادابها وحاليا طالب ماجستير تخصص اللغويات في جامعة ال البيت بانتظار مناقشة الرسالة فقط وبتقدير امتياز. عملت في تدريس اللغة الانجليزية لطلاب التوجيهي منذ عام 2010 ولغاية الان. حاصل على عدد كبير جدا من الدورات داخل الاردن وخارجها وخصوصا في الولايات المتحدة الامريكية وتايوان. وعملت مترجما فوريا لدى شركة داينكورب الامريكية. وقمت بترجمة عدة افلام الى اللغة الانجليزية. بالاضافة لاخراج وانتاج عدة افلام قصيرة وثائقية وهادفة تناقش قضايا وتحديات الاطفال. والان اعمل كمدرس لغة انجليزية لطلاب المرحلة الثانوية والتوجيهي لدى مدرستي العزيزة التي افتخر واعتز بها دائما والتي خرجت عدد كبير جدا من الاطباء والمهندسين ومختلف التخصصات الجامعية&nbsp;وهي روضة ومدارس العلوم التطبيقية. كما انني اشعر بالفخر والاعتزاز بانضمامي لمعلمي&nbsp;منصة النمط والتي تعمل على تقديم كل ماهو مفيد ونافع لابنائنا طلبة التوجيهي ضمن احدث المواصفات والتقنيات التعليمية العالمية. وفي النهاية اتمنى لكم جميعا التوفيق باذن الله تعالى.&nbsp;</span></p>', NULL, 0, 0, 1, 1, NULL, 'instructor', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '13.1678299440.jpg', 1, NULL, NULL, '2023-03-08 21:25:55', '2023-03-22 16:32:20'),
