(1979, 188, '2023-03-14 21:38:26', 'محمد سعيد عبده الجعار', NULL, 'mrmohammadsaeed@yahoo.com', '$2y$10$mI10/WGJ5BBxsndoSnuaFuTctzgm.77IOdbJuCX4/UOHXOL9v0OfC', NULL, NULL, NULL, NULL, NULL, NULL, '00201005303733', '1678618168.png', NULL, 'مصري', '<p>&middot;&nbsp;<strong>بكالوريوس تربية نوعية - قسم معلم حاسب آلي - بتقدير جيد جدا -من جامعة المنوفية - 2007.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>.</strong>&nbsp;<strong>سنوات الخبرة في مجال التعليم والتدريب</strong>&nbsp;/14<strong>&nbsp;سنة</strong>&nbsp;<strong>في مصر والسعودية</strong>.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&middot;&nbsp;محاضر أكاديمي على منصات التعليم الفتوح (رواق- مهارة).</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;</strong>&middot;&nbsp;<strong>درع التميز في برنامج معلم مايكروسوفت المبدع الخبير</strong>.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&middot;&nbsp;<strong>زميل معلم مايكروسوفت الخبير ضمن 300 معلم على مستوى العالم.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&middot;&nbsp;<strong>اختياري لبرنامج معلم مايكروسوفت المبدع الخبير على مستوى العالم.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&middot;&nbsp;<strong>شهادة معلم مايكروسوفت المبدع الخبير من مجتمع مايكروسوفت التعليمي.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&middot;&nbsp;<strong>تكريم من وزارة التعليم وشركة مايكروسوفت للتميز في برنامج المعلم الخبير.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&middot;&nbsp;<strong>المركز الأول على الفرع الرابع في مسابقة القرآن الكريم في دورتها الرابعة.</strong></p>\r\n\r\n<p>&nbsp;</p>', NULL, 0, 0, 1, 1, NULL, 'instructor', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '55.1678618230.pdf', 1, NULL, NULL, '2023-03-12 15:45:50', '2023-03-14 21:38:26'),
