(14, 372, 'جودة الرعاية الصجية', NULL, 'جودة-الرعاية-الصجية', 'تاهيل المتدرب على فهم معنى الجودة وكبفية تطبيقها بالمجال الصحى', 'جميع العاملين بالقطاع الصحى', 'نشأة الجودة- تعريفات الجودة- رواد الجودة  تطور الجودة- تطبيق الجودة فى المنشئات الصحية', '2020-11-06', '8.00 - 9.30', '3', 0, 0, '1666123670.jpg', 5, 'https://us06web.zoom.us/j/88473542898?pwd=eDd6a2hJN29MZ1EzMEZYcFVRNDNNdz09', NULL, NULL, '2022-10-19 01:07:50', '2022-11-09 09:31:27'),
(15, 372, 'الإسعافات الاولية والتعامل مع الحالات الطارئة', NULL, 'الإسعافات-الاولية-والتعامل-مع-الحالات-الطارئة', 'كيف تتعامل مع مصاب  لحين وصول الإسعاف أو المساعدة  كيف احمية فى اللحظات الأولى للاصابة', 'جميع فئات المجتمع', 'تعريف الإسعافات الأولية وأهميتها لحياة المصاب  من هو المسعف    مكونات حقيبة الإسعافات   التعامل مع حالات النزيف  \r\nالكسور \r\nالغرق \r\nالاختناق وغيرها', '2022-12-04', '6.30 - 8.00', '3', 0, 0, '1668610008.jpg', 5, 'https://us06web.zoom.us/j/84667618629?pwd=VnpmVGptN2MxMUE4eUk0OU85akgrUT09', NULL, NULL, '2022-10-19 01:15:46', '2022-12-08 21:27:12'),
(17, 156, 'مهارات النجاح الشخصي وتحقيق الأهداف', 'Skills of personal success and achieving goals', 'مهارات-النجاح-الشخصي-وتحقيق-الأهداف', 'تعرض الدورة مهارات التفكير وتعريفه وانماطه ومهارات الذكاء وطرق التفكير بطرق ابداعية ومعادلة النجاح للوصول للهدف الشخصي النهائي وهو النجاح والسعادة', 'كل من يطمح بتطوير مهارته الشخصية (الفكرية والعملية)', '1- مهارات التفكير\r\n2- مهارات الذكاء\r\n3- معادلة النجاح', '2022-10-23', '6.30 - 8.00', '3', 0, 0, '1666171154.PNG', 5, NULL, NULL, NULL, '2022-10-19 14:19:14', '2023-02-23 13:32:47'),
(18, 129, 'تعلم برنامج الباوربوينت', NULL, 'تعلم-برنامج-الباوربوينت', 'كيفية انشاء عرض تقديمي مميز يصاحبه صوت وفيديو باستخدام البرنامج', 'جميع المهتمين باستخدام البرنامج - طلبه - موظفين - مدرسين', 'اعداد عرض متكامل وكيفية تنسيقة  - اضافة تأثيرات للعرض - اضافة ملف صوت مصاحب للعرض كخلفية موسيقية - اضافة ملف فيديو - التحكم في طريقة العرض - تحويل العرض في النهاية لملف فيديو', '2022-11-09', '6.30 - 8.00', '3', 0, 0, '1666521001.png', 5, 'https://us06web.zoom.us/j/84655943260?pwd=ZEJhamZrV2NDcUQxOXY3NnlTdnF4QT09', NULL, NULL, '2022-10-23 15:30:01', '2022-11-12 15:14:22'),
(19, 783, 'إدارة الوقت', NULL, 'إدارة-الوقت', 'إدارة الوقت هى مفتاح التقدم والنجاح للأفراد والمؤسسات، مهم جدا تدريب الطلاب والخريجين والعاملين على كيفية الاستغلال الامثل للوقت', 'كل الفئات', '١-تعريف إدارة الوقت\r\n٢-كيف يمكنك أن تكون أكثر نظاما وتوفيرا لوقتك\r\n٣-أهم مهارات إدارة الوقت\r\n٤-أبرز القوانين في إدارة الوقت\r\n٥-خطوات تحسين إدارة الوقت', '2022-11-25', '8.00 - 9.30', '3', 0, 0, '1666768281.JPG', 5, 'https://us06web.zoom.us/j/82029715655?pwd=dHFZUjRkV1dQNU11NWFTQUd6WUZhUT09', NULL, NULL, '2022-10-26 12:11:21', '2022-11-29 11:28:18'),
(20, 33, 'تنمية الثقة بالنفس', 'Develop self-confidence', 'تنمية-الثقة-بالنفس', 'كيف تزيد ثقتك بنفسك وتتحرر من مخاوفك', 'عامة الناس', 'طرق تنمية الثقة بالنفس \r\nتمارين لزيادة الثقة بالنفس \r\nالتحرر من المخاوف', '2022-10-29', '6.30 - 8.00', '3', 0, 0, '1666860486.jpg', 5, 'https://www.youtube.com/channel/UCmIUDtINL8fQN5Or5TgDrkA', NULL, NULL, '2022-10-27 13:48:06', '2023-03-20 00:23:16'),
(21, 514, 'اساسيات المحاسبة المالية', NULL, 'اساسيات-المحاسبة-المالية', 'بعد إنتهاء هذه الدورة يتوقع أن تكون ملماً بالاتي:- \r\n- طبيعة المحاسبة المالية وما يميزها عن الفروع الأخرى\r\n - القوائم المالية الرئيسية\r\n- مستخدمو القوائم المالية وطبيعة البيانات التي يحتاجونها\r\n- البيانات التي تقدمها القوائم المالية ومدى الفائدة التي يتوقع الحصول عليها من القائمة', '- خريجي تخصصات المحاسبة والإدارة والمالية.\r\n- العاملون الجدد في الأقسام المحاسبية والمالية.\r\n- المهتمون في هذا المجال', '* مقدمة\r\n* معايير المحاسبة\r\n* نظرية القيد المزدوج والقيد المفرد\r\n* القوائم المالية الرئيسية\r\n* مستخدمو القوائم المالية وطبيعة البيانات\r\n* البيانات التي تقدمها القوائم المالية ومدى فائدتها\r\n* تصنيف بنود القوائم المالية', '2022-11-18', '8.00 - 9.30', '3', 0, 0, '1666907856.jpg', 5, 'https://us06web.zoom.us/j/86036199114?pwd=N1RzN285YnFBWGJLejdQTkVVcTN1QT09', NULL, NULL, '2022-10-28 02:57:36', '2022-11-21 08:30:10'),
(25, 948, 'أساسيات البرمجة بلغة Java', NULL, 'أساسيات-البرمجة-بلغة-java', 'نهدف إلى الوصول إلى الإدراك الحقيقي لمعنى البرمجة وكيفية توظيفها في الحياة .\r\nسنستخدم لغة java لتوضيح أساسيات البرمجة', 'أي شخص فالكورس تأسيسي من تحت الصفر', 'ما هي البرمجة؟\r\nأهم الأسئلة الشائعة عن البرمجة والتوظيف والإختصاصات.\r\nشرح تقصيلي لأساسيات كتابة كود بلغة Java\r\n1-أنواع البيانات و المتغيراتز\r\n2- بنى التحكم (الشروط والحلقات)', '2022-12-25', '8.00 - 9.30', '3', 0, 0, '1668176165.png', 5, 'https://us06web.zoom.us/j/87921209786?pwd=Z1pPbWpqVDVFRHlmMExvcThyUXVlQT09', NULL, NULL, '2022-11-02 23:37:38', '2023-01-09 10:20:33'),
(26, 156, 'تحويل الانشطة والواجبات الى العاب الكترونية تفاعلية', NULL, 'تحويل-الانشطة-والواجبات-الى-العاب-الكترونية-تفاعلية', 'تحويل الانشطة والواجبات وأوراق العمل الى العاب الكترونية تفاعلية\r\nيمكن استخدامها داخل الحصة الدراسية لتحقيق\r\n1- الاهداف\r\n2- متعة التعلم\r\n3- ادخال التكنولوجيا في التعليم\r\n4- تلعيب التعليم', 'المعلمين والمعلمات\r\nالمدربين والمدربات\r\nاساتذة الجامعات\r\nكل من يعمل في التعليمي', 'أدوات التدريس الفعالINSERT INTO `marquees` (`id`, `name`, `type`, `created_at`, `updated_at`) VALUES
