(365, 709, 18, 198, NULL, 'صعوبات التعلم لدى الاطفال', NULL, 'موضوع صعوبات التعلم لدى الاطفال من عدة جوانب', 'الدورة تضم اربعة محاور اساسية:\r\n١- ما المقصود بصعوبات التعلم؟\r\n٢- مؤشرات دالة على وجود صعوبات تعلم\r\n٣- انواع صعوبات التعلم لدى الاطفال\r\n٤- تشخيص - علاج - تعامل مع ذوي صعوبات التعلم\r\nوقبل كل محور سنشاهد جزء من فيلم ايشان', 'مشاهدة مقاطع الفيديو واجراء بعض الانشطة', NULL, NULL, '2022-10-26', '20221026092221.jpg', 'صعوبات-التعلم-لدى-الاطفال', 1, 0, 0, 'صعوبات التعلم - مؤشرات دالة على وجود صعوبات تعلم\r\n انواع صعوبات التعلم لدى الاطفال\r\n تشخيص - علاج - تعامل مع ذوي صعوبات التعلم\r\n ايشان', NULL, '2022-10-26 14:22:21', '2022-10-31 17:40:06'),
(366, 416, 15, 135, NULL, 'اساسيات البرمجة بلغة بايثون (للمبتدئين)', NULL, 'هذه الدورة مصممة لمن يود ان يدخل الى عالم البرمجة حيث ترسم له الطريق الصحيح من حيث البداية وارشاده الى المسار الذي يجب ان يتبعه للوصول للنتيجة التي يرغب بها', 'كورس يهدف الى تعليم اساسيات البرمجة التي من خلالها يستطيع الشخص ان يتعلم اللغات الاخرى بسهولة .هدف هذا الكورس هو رسم مسار صحيح وتعليمك الاساسيات الموجودة في جميع لغات البرمجة وفهم ماهية البرمجة وكيفية عملها من الصفر .الفئة المستهدفة في هذا الكورس هم المبتدئين الذين لا يمتلكون اي فكرة في هذا المجال.الفائدة التي سيحصل عليها الطالب عند الانتهاء من هذا الكورس هي1- إمكانية كتابة الكود2-معرفة بعض العبارات الأساسية وكيفية عملها3- التعامل مع الأرقام والسلاسل4-زيادة معرفتك بالدوال5-التعامل مع التعليقات6-استكشاف الأخطاء واصلاحها 7-امكانية تعلم لغات الأخرى وفهم صيغ بنائها', 'لا شيء', NULL, NULL, '2022-10-28', '20221028124151.jpg', 'اساسيات-البرمجة-بلغة-بايثون-للمبتدئين', 1, 0, 0, 'بايثون , python , بايثون للمبتدئين , لغة بايثون , بايثون من الصفر , اساسيات البرمجة , تعلم لغة بايثون , البرمجة , برمجيات', NULL, '2022-10-28 17:41:51', '2022-10-30 12:32:44'),
(367, 372, 9, 206, NULL, 'مدارس بلا عدوى', NULL, 'تعريف بالصحة والعدوى المدرسية وكيفية الحماية', 'تعريف الصحة وحماية طلبة المدارس من العدوى جميع المجتمع لابد من فهم كيفية حماية ابناءنا  من العدوى المدرسية', 'فهم آلية العدوى وكيفية حماية الطلبة \r\nاهمية التغذية السليمة', NULL, NULL, '2022-10-31', '1667246553.png', 'مدارس-بلا-عدوى', 1, 0, 0, 'منع عدوى المدارس وتطعيم الطلبة  والإجراءات الاحترازية لحمايتهم', NULL, '2022-10-31 23:47:32', '2022-11-01 10:27:32'),
(368, 284, 27, 256, NULL, 'تنظيم الوقت وادارة الضغوط', NULL, 'دورة تنظيم الوقت والتعامل مع الضغوط هي دورة تساعدك على التعامل مع الوقت بشكل جيد وتقسيم المهام ومعرفة اسباب الضغوط وسبل التعامل معاها', 'تعريف الضغوط   والآثار الناجمة عنها  \r\n2- تحديد أسباب الضغوط في العمل\r\n3- التعرف على طرق ادارة الوقت بفعالية\r\n4- التعرف على السلوكيات اللازمة للتعامل مع ضغوط العمل والحد منها\r\n \r\nاما الفئه المستهدفه هي الموظفون والطلاب وكل من يعاني من الضغوط وعدم معرفة تنظيم الوقت وكيفة التعامل مع الضغوط', 'لا شيء', NULL, NULL, '2022-10-31', '20221031221038.jpg', 'تنظيم-الوقت-وادارة-الضغوط', 1, 0, 0, 'التنميه البشريه ، فن ادارة الوقت ن التعامل مع الضغوط', NULL, '2022-11-01 03:10:38', '2022-11-01 23:41:30'),
(370, 615, 27, 186, NULL, 'تعلم أن تكون قائدا', NULL, 'كيف تكون قائدا ناجحا ؟؟', 'على المتدرب ان يتعرف فى نهاية الدورة التدريبية على :- \r\nمفهوم القيادة - مفهوم الادارة - اساليب القيادة - اساليب الادارة - انماط القيادة - انماط الادارة - التباين والاتكامل بين القيادة والادارة - النظريات الحديثة القيادة', 'دافع للتعلم الذاتى - التنمية المهنية', NULL, NULL, '2022-11-02', '20221102070610.png', 'تعلم-أن-تكون-قائدا', 1, 0, 0, 'القيادة الناجحة - النظريات الحديثة للقيادة', NULL, '2022-11-02 12:06:10', '2022-11-02 14:22:07'),
(372, 763, 12, 110, NULL, 'قواعد الاملاء للطلاب', NULL, 'شرح قواعد املائية لطلابنا', 'يوضح الكورس قواعد مهمة للطلاب في الاملاء من التاء المربوطة/التاء المفتوحة /ا لهاء/المد وانواعه/اللام الشمسية والام القمرية واسماء الاشارة  والتنوين وانواعه/           مع تدريبات وانشطة تفيد الطلاب في مختلف انحاء الدول العربية  ونستكمل الكورس ايضا ونضيف اليه الاسماء الموصولة والهمزات وطريقة كتابتها   وغير ذلك من المهارات الخاصة بالاملاء', 'لا يوجد', NULL, NULL, '2022-11-03', '20221103071552.jpg', 'قواعد-الاملاء-للطلاب', 1, 0, 0, 'الاملاء الصحيحة /التفوق بالقواعد النحوية / التميز في فهم وادراك وكتابة الهمزة ومعرفة انواعها', NULL, '2022-11-03 12:15:52', '2022-11-13 01:21:40'),
(373, 948, 15, 135, NULL, 'أساسيات الدخول إلى البرمجة باستخدام ++C', NULL, 'التأهيل الحقيقي لأي مبرمج لتصبح قادر على الغوص في البرمجة', 'دورة تأسيسية للدخول للمجال البرمجي نشرح بها بعض الركائز الأساسية التي سنبني عليها مبرمج ناجح . سنطلع على أهم الأسس والأسئلة الأشهر التي يجب على الجميع معرفتها قبل تعلم لغة برمجة:1- معنى البرمجة.2- مفهوم ++C.و والمتغيرات. 4- أمثلة عملية تدريبية.', 'الوقت وحب التعلم والمواظبة والاستمرارية', NULL, NULL, '2022-11-25', '1669360153.jpeg', 'أساسيات-الدخول-إلى-البرمجة-باستخدام-c', 1, 0, 0, 'البرمجة - مدخل للبرمجة - تأسيس التطوير البرمجي', NULL, '2022-11-04 13:30:55', '2022-11-30 22:13:34'),
(374, 514, 35, 265, NULL, 'إدارة رأس المال العامل', NULL, 'يعتبر رأس المال العامل مؤشراً على مدى كفاءة المؤسسة في إدارة عملياتها وما تملكه من سيولة نقدية، وذلك من خلال حساب الوقت الذي تحتاجه المؤسسة لتحويل صافي رأس المال العامل إلى سيولة نقدية', '* الأهداف التدريبية:-\r\n- وصف طبيعة رأس المال العامل والتعريف بعناصره ومكوناته الرئيسية.\r\n- التعريف بأهداف إدارة رأس المال العامل.\r\n- توضيح مفهوم دورة تحويل النقدية وأهميتها وعناصرها وطريقة تقيمها.\r\n- التعرف على أساليب إدارة الذمم المدينة والمخزون والذمم الدائنة والاستثمارات قصيرة الأجل.\r\n\r\n* محتويات الدورة:-\r\n- مقدمة\r\n- إدارة رأس المال العامل\r\n- إدارة النقدية\r\n- إدارة الذمم المدينة\r\n- إدارة المخزون السلعي\r\n- إدارة الذمم الدائنة\r\n- إدارة الاستثمارات قصيرة الأجل في الأوراق المالية\r\n\r\n* الفئة المستهدفة:-\r\n- خريجي تخصصات المالية والمحاسبة.\r\n- العاملين في الدوائر المالية واقسام المحاسبة.\r\n- كل المهتمين في هذا المجال.', '* المعرفة بأساسيات المحاسبة المالية.\r\n* المعرفة ببنود قائمة المركز المالي.', NULL, NULL, '2022-11-04', '20221104224429.jpg', 'إدارة-رأس-المال-العامل', 1, 0, 0, 'إدارة الموجودات المتداولة، إدارة الالتزامات المتداولة', NULL, '2022-11-05 03:44:29', '2022-11-16 09:34:13'),
(377, 308, 9, 88, NULL, 'صمم نظامك الغذائى بنفسك', NULL, 'مهارة تصميم نظام غذائى صحى', 'هذه الدورة تستهدف كل الفئات من جميع الاعمار بهدف إكسابهم مهارة تصميم نظام غذائى سليم على أسس علمية صحيحة من خلال معرفة مفهوم التغذية السليم والتعرف على كبفية حساب مؤشر كتلة الجسم ، كيفية حساب السعرات الحرارية ومفهوم ميزان الطاقة ، التعرف على الهرم الغذائى والعناصر الغذائية ، التعرف على العادات الغذائيةالخاطئة وطرق تجنبها ، قراءة البطاقات الغذائية ، أمراض سؤ التغذية والوقاية منها ، السمنة وأسبابها ومضاعفاتها ، انظمة غذائية لإنقاص الوزن من3الى5كجم فى أسيوع', 'لايوجد', NULL, NULL, '2022-11-06', '20221106230450.jpg', 'صمم-نظامك-الغذائى-بنفسك', 1, 0, 0, 'إنقاص الوزن ، التغذية السليمة ، العادات الصحية الخاطئة ، التخلص من السمنة ، الهرم الغذائى ، مؤشر كتلة الجسم ، ميزان الطاقة ، حساب السعرات الحرارية ، نظام ريجيم صحى ، نظام للتخلص من الدهون', NULL, '2022-11-07 05:04:50', '2022-11-07 19:45:14'),
(378, 534, 36, 322, NULL, 'فهم مادة الفيزياء', NULL, 'شرح وفهم مادة الفيزياء من خلال استخدام الوسائل التعليميه', 'شرح مادة الفيزياء وحل اسئله الفصل والتعرف على الاسئله الوزاريه', 'فهم مادة الفيزياء', NULL, NULL, '2022-11-07', '20221107143138.jpg', 'فهم-مادة-الفيزياء', 1, 0, 0, 'فهم مادة الفيزياء', NULL, '2022-11-07 20:31:38', '2022-11-08 15:37:07'),
