(380, 346, 6, 205, NULL, 'فن اختيار شريك الحياة (رحلة الى حياة اسرية سعيدة)', 'How to choose a partner', 'فن اختيار شريك الحياة الخطوة الاولى والاهم لبناء اسرة سعيدة مستقرة .', 'رحلة الى حياة اسرية سعيدة\r\nبرنامج تدريبي يحتوي خمس دورات تدريبية\r\nالدورة الاولى (فن اختيار شريك الحياة)\r\nاهدافها : التعرف على دوافع الزواج/الوقوف على معايير اختيار الزوج والزوجة/ التعرف على اوجه الخلاف بين شخصية الرجل والمرأة/التعرف على اسرار الزواج الناجح\r\nالفئة المستهدفة : الشباب المقبلين على الزواج / الازواج الجدد / الاباء والامهات / العاملين في المجال التربوي والاسري', 'قلم ودفتر', NULL, NULL, '2023-02-28', '1667990865.jpg', 'فن-اختيار-شريك-الحياة-رحلة-الى-حياة-اسرية-سعيدة', 1, 0, 0, '#الاسرة #الزواج #الشباب #الحياة_الزوجية #تربية #الحياة_الاسرية', NULL, '2022-11-08 15:23:14', '2023-02-28 22:41:30'),
(381, 778, 27, 184, NULL, 'كتابة سيرة ذاتية احترافية Writing CV and Resume', NULL, 'بنهاية هذا الكورس سيكون لديك سيرة ذاتية مميزة تمكنك من الحصول على فرص قابلات عمل اكثر عند تقديمك للوظائف.', 'كيف سيساعدك هذا الكورس؟\r\n\r\nسوف يساعدك هذا الكورس على كتابة سيرة ذاتية مميزة والحصول على المزيد من فرص مقابلات العمل من خلال دراسة المواضيع التالية:\r\n\r\n\r\n فهم عقلية مسئولى التوظيف وطرق اختيارهم ومراجعتهم للسيرة الذاتية لكى تتمكن من اقناعه بمؤهلاتك - \r\n\r\n- كيف تعرض مؤهلاتك بطريقة مقنعة ومميزة لمسئولى التوظيف \r\n\r\n- طرق كتابة السيرة الذاتية التى تظهرك كمحترف وتترك انطباع جيد عنك\r\n\r\n- طرق العرض والتقديم لكل مقطع فى السيرة الذاتية وافضل الاشكال المستخدمة للعرض\r\n\r\n- كيف تبنى انطباع جيد عن مسئولى التوظيف والتعيين وتقدم نفسك كأنسب شخص للوظيفة\r\n\r\n- الاخطاء الشائعة فى السيرة الذاتية وكيفية تجنبها\r\n\r\n- ما الذى يجب ان تكتبه فى الايميل المرسل به سيرتك الذاتية\r\n\r\n- كيف تقوم بالتقدم للوظائف بطريقة مميزة تمكنك من الوصول للمقابلة الشخصية\r\n\r\n\r\n\r\nلماذا يجب ان تدرس هذا الكورس؟\r\n\r\n- اذا كنت تتقدم لمئات الوظائف دون الحصول على استجابة او فرص لمقابلات العمل وتريد حلا لهذا\r\n\r\n- اذا لم تكن واثق فى طريقة كتابة سيرتك الذاتية وتريد سيرة ذاتية اكثر احترافا وتميزا\r\n\r\n- اذا كنت تريد ان تتتعلم كيف تقوم بكتابة مؤهلاك بشكل مقنع ومميز\r\n\r\n- اذا كنت تريد ان تقدم نفسك كانسب شخص للوظيفة وتضمن حصولك على فرص مقابلات عمل اكثر\r\n\r\n\r\nلمن هذا الكورس:\r\n\r\nهذا الكورس مصمم للاشخاص الذين لديهم مؤهلات اساسية تخص مجال عملهم ويريدون تعلم كيفية عرض هذه المؤهلات بشكل احترافى فى السيرة الذاتية سواء كانوا موظفين او حديثى التخرج او طلبة وهذا الكورس لن يفيدك اذا لم يكن لديك اى مؤهلات او ليس لديك اى معلوما تسابقة عن السيرة الذاتية.', 'لا شيء فقط التركيز والتطبيق المستمر', NULL, NULL, '2022-11-09', '20221109175524.png', 'كتابة-سيرة-ذاتية-احترافية-writing-cv-and-resume', 1, 0, 0, 'التنمية البشرية، تطوير الذات، التطوير المهني، سيرة ذاتية، CV،', NULL, '2022-11-09 23:55:24', '2022-11-10 11:10:02'),
(382, 615, 27, 256, NULL, 'ادارة الوقت', NULL, 'كيف تدير وقتك', 'ادارة الوقت - كيف تنظم وقتك -مضيعات الوقت - مصفوفة الاولويات -', 'فئة الشباب الطموح - ذوى الرغبة فى النجاح', NULL, NULL, '2022-11-10', '20221110145656.png', 'ادارة-الوقت', 1, 0, 0, 'الوقت - اهمية الوقت - استراتيجيات ادارة الوقت - مشتتات الوقت', NULL, '2022-11-10 20:56:56', '2022-11-10 23:36:23'),
(384, 330, 36, 322, NULL, 'الأرض مجال الإنسان', NULL, 'من المذهل أن نعرف أننا نعيش ضمن كوكب كروي يدور حول نفسه وحول الشمس ، ونحن لا نشعر  ، كوكب يضجّ بالحياة ومجالات عديدة ، الأرض كوكب الكائنات الحية.', 'تهدف هذه الدورة إلى تعريف المتعلمين الصغار الذين تتراوح أعمراهم بين (8-12سنة) على كوكبهم كوكب الحياة الوحيد (الأرض) ودوراته بالإضافة إلى رفيقه القمر، مجالات الحياة ضمنه، اليابسة والمياه وغيرها، وذلك من خلال فيديوهات تعليميّة قصيرة وهادفة تُبعد عن الطلاب الملل ، وتنقسم هذه الدورة إلى 10 دروس تعليمية وهي : \r\n- الدرس الأوّل : الأرض كوكب كروي الشكل . \r\n- الدرس الثاني : دورة الأرض حول نفسها (مدتها،اتجاهها).\r\n- الدرس الثالث: دورة الأرض حول الشمس .\r\n- الدرس الرابع : القمر تابع لكوكب الأرض . \r\n- الدرس الخامس : السنة العاديّة والسنة الكبيسة . \r\n- الدرس السادس : خريطة العالم (مفتاحها،وقراءتها)\r\n- الدرس السابع : القارّات . \r\n- الدرس الثامن : المحيطات والبحار . \r\n- الدرس التاسع : أغلفة الأرض . \r\n- الدرس العاشر : الطقس والمناخ .', 'لا شيء', NULL, NULL, '2022-11-11', '20221111095209.jpg', 'الأرض-مجال-الإنسان', 1, 0, 0, 'الأرض،الإنسان،الكواكب،القمر،الليل،النهار،مدة،الفضاء،الشمس،جغرافيا،بدر،هلال،مناخ،طقس،أغلفة،خريطة،شمال،جنوب،فصول،كروي،مفتاح_الخريطة،شرق،غرب،رائد،نجم،عنوان،مجال،سنة،يوم،ساعة،مدار،محور،تروبوسفير،كبيسة،عادية،مياه،بحر،محيط،يابسة،قارات،مالح،متجمد،أنشطة،حياة،تربة،دول،وردة_الإتجاهات،مسار،حركة،دورة_الأرض،كامل،يعكس،اختلاف،مدة،حيوان،نبات.', NULL, '2022-11-11 15:52:09', '2022-11-11 22:16:53'),
(386, 534, 36, 322, NULL, 'شرح مادة الفيزياء', NULL, 'شرح مادة الفيزياء', 'شرح مادة الفيزياء وحل اسئله الفصل والتعرف على الاسئله الوزاريه', 'الاستماع الى محاضرة', NULL, NULL, '2022-11-15', '20221115125820.jpg', 'شرح-مادة-الفيزياء', 1, 0, 0, 'فهم مادة الفيزياء', NULL, '2022-11-15 18:58:20', '2022-11-16 02:02:28'),
(387, 1105, 18, 199, NULL, 'الحساب الذهني', NULL, 'الحساب الذهنى بالأبيكاس', 'دورة حساب ذهنى بأستخدام العداد اليابانى السوربون للمدربين واولياء الأمور لتعليم الأطفال من 5 سنوات الى 18 سنه الجمع والطرح والضرب والقسمه بسهولة ودقه من فوائد الحساب الذهنى تقوية الذاكرة والثقة بالنفس وزيادة التركيز والتخيل والابداع واتخاذ القرار وتنمية مهارات الأستماع وسرعه ودقه فى العمليات الحسايه', 'تحميل العداد السوربون من جوجل بلاى', NULL, NULL, '2022-11-16', '20221115134137.jpeg', 'الحساب-الذهني', 1, 0, 0, 'الحساب الذهنى  UC-Math', NULL, '2022-11-15 19:41:37', '2022-11-16 20:50:30'),
(389, 709, 18, 198, NULL, 'انماط التعلم', NULL, 'الدورة عبارة عن شرح مفصل لمفهوم انماط التعلم مع امثلة على تطبيقها', 'تعريف انماط التعلم\r\nمتى ظهرت انماط التعلم؟ نموذج VARK\r\nانماط التعلم السبعة: مميزات وعيوب كل نمط\r\nانماط التعلم وانواع الذكاء\r\nانماط التعلم ومقياس هيرمان\r\nقبعات التفكير الست وتطبيقها وفقا لانماط التعلم المختلفة \r\nكيف يمكنني كمعلم شرح درس مراعيا انماط التعلم المختلفة؟', 'nothing', NULL, NULL, '2022-11-26', '20221118120557.jpg', 'انماط-التعلم', 1, 0, 0, 'انماط التعلم \r\nVARK \r\nلتعلم وانواع الذكاء\r\nانماط التعلم ومقياس هيرمان\r\nقبعات التفكير الست \r\nالتعليم المتمايز\r\nصعوبات التعلم', NULL, '2022-11-18 18:05:57', '2022-11-27 16:15:43'),
(392, 712, 15, 250, NULL, 'كيف تتعامل مع موقع ميكروسوفت ؟', 'How to deal with Microsoft', 'كيف تتعامل مع موقع ميكروسوفت ؟', 'كيف تفعل البريد الالكترونى ؟ \r\nكيف تدخل موقع  ? microsoft educator center \r\n  كيف تقدم دورة تدريبية من خلال  edutarck \r\n كيف تحصل على الشهادة ؟', 'جهاز كمبيوتر او لابتوب  - بريد الكترونى مفعل', NULL, NULL, '2023-02-25', '20221120195502.PNG', 'كيف-تتعامل-مع-موقع-ميكروسوفت', 1, 0, 0, 'كيف تتعامل مع موقع ميكروسوفت ؟', NULL, '2022-11-21 01:55:02', '2023-02-25 15:38:54'),
(393, 308, 27, 182, NULL, 'مفاتيح التأثير على الآخرين (فن صناعة الكاريزما)', NULL, 'أسرار الحصول على الشخصية الكاريزمية', 'اليرنامج يستهدف جميع الفئات من الجنسين بهدف إكسابهم مهارات التأثير على الآخرين وأسرار تحقيق الشخصية الكاريزمية \r\nبحيث يكون المشارك فى نهاية البرنامج لديه المعرفة الكاملة بما يلى :\r\nمستويات التفكير \r\nأسرار ومقومات التثير على الآخرين \r\nالمظاهر العامة والخاصة للذكاء الإجتماعى\r\nدور الأسرة فى تنمية الذكاء الإجتماعى \r\nمهارات التواصل الفعال (لفظى وغير لفظى )\r\nمفهوم ومواصفات الشخصية الكاريزمية وطريقة الحصول عليها', 'لايوجد', NULL, NULL, '2022-11-21', '20221121001302.jpg', 'مفاتيح-التأثير-على-الآخرين-فن-صناعة-الكاريزما', 1, 0, 0, 'الكاريزما ، التواصل الفعال ، التأثير على الآخرين ، الذكاء الإجتماعى ، الشخصية الجذابة ، أسرار الكاريزما', NULL, '2022-11-21 06:13:02', '2022-11-22 01:12:44'),
(394, 662, 22, 176, NULL, 'القيام بما يهم في أوقات الضغط النفسي.', NULL, 'بغض النظر عن أسباب الضغوط النفسية التي تعيشها إلا أن نتائج الضغوط على صحتنا النفسية والجسدية قد تكون وخيمة وخطيرة إذا لم يتم التعامل معها بطريقة ايجابية.\r\n\r\n إذا مررت في تجربة أو حدث شعرت به بضغوط نفسية وتتمنى أن تتعلم كيف تدير الضغوطات وتتعامل بشكل أفضل مع مشاعرك ومشاعر الآخرين، هذه الدورة مقدمة لك.\r\n\r\nمن منا لم يمر بلحظات بحياته كانت تحوي الكثير من الضغوطات النفسية؟\r\n\r\n من منا لم يتمنى لو كان يمتلك القدرة على إدارة الضغوط والتحكم بمشاعره وانفعالاته؟ \r\n\r\nمن منا لم يتمنى أن يصبح محاوراً أفضل ويمتلك علاقات قوية مع الاخرين؟', 'بغض النظر عن أسباب الضغوط النفسية التي تعيشها إلا أن نتائج الضغوط على صحتنا النفسية والجسدية قد تكون وخيمة وخطيرة إذا لم يتم التعامل معها بطريقة ايجابية.\r\n\r\n إذا مررت في تجربة أو حدث شعرت به بضغوط نفسية وتتمنى أن تتعلم كيف تدير الضغوطات وتتعامل بشكل أفضل مع مشاعرك ومشاعر الآخرين، هذه الدورة مقدمة لك.\r\n\r\nإذا كنت تعاني من الضغط النفس ، فلست وحدك من تعاني,فهناك,في هذه اللحظة آخرون كثيرون في مجتمعك وفي شتى أنحاء العالم يعانون أيضا من الضغط النفسي .\r\n\r\nسنساعدك على  تعلم المهارات العملية للتعامل مع الضغط النفسي.\r\n\r\nسنرافقك طوال هذا الكتاب ونعلمك المهارات التي تحتاج إليها .\r\n\r\nاستمتع  برحلتك في تعلم كيف تفعل ما يهم حقا في أوقات الضغط !', 'كمبيوتر / انترنت.', NULL, NULL, '2022-11-21', '20221121084053.jpg', 'القيام-بما-يهم-في-أوقات-الضغط-النفسي', 1, 0, 0, 'ألانفعال – التحكم – السيطرة – العصبية – غضب – مشاعر سيئة – ظنون – عزلة – كره – انطواء – نوم – عنف أسري – اساءة للغير – عدم التركيز - ألاستسلام – القاء اللوم – أحكام قاسية – ذكريات بشعة – أفكار عن المستقبل – أفكار قلق تجاه أنفسنا وألأخرين الشعور بالذنب – وسواس – أفكار غير منطقية – شكوك – اكتئاب -  مشاجرات – مجادلات – خلافات – انسحاب ,/أو بعد عن ألأخرين – نوم في السرير –الانعزال .', NULL, '2022-11-21 14:40:53', '2022-11-21 15:12:58'),
(395, 308, 9, 88, NULL, 'أسرار التغذية الصحية عند الأطفال', NULL, 'مفهوم التغذية الصحيحة للطفل ومكونات الوجبة المتوازنة', 'الفئة المستهدفة هى جميع الأمهات والآباء والجد والجدة والزوجات حديثى الزواج والحوامل والبنات فى سن الزواج والإنجاب وجميع المهتمين بالتغذية الصحية لأطفالهم وفى نهاية الدورة يصبح المشاركون على علم تام بمفاهيم التغذية السليمة والمجوعات الغذائية - الفيتامينات وأهميتها والعناصر الغذائية التى تحتوى عليها - الأغذية المفيدة للأطفال وأنواع الإستفادة منها - 10 أطعمة يجب الإحتراس من تقديمها للأطفال - جدول الوزن الطبيعى للأطفال فى الأعمار المختلفة - سمنة الأطفال وعلاقتها بمرض السكرى والأعراض الواجب الإنتباه إليها - الهرم الغذائى للطفل - مكونات الوجبة المتوازنة للأطفال - حيل لتقديم العناصر الغذائية المفيدة للطفل وطريقة ترغيبه فيها', 'لايوجد', NULL, NULL, '2022-11-22', '20221122003725.jpg', 'أسرار-التغذية-الصحية-عند-الأطفال', 1, 0, 0, 'الوجبة المتوازنة للطفل ، الهرم الغذائى للطفل ، سمنة الأطفال ، إعداد وجبات الأطفال بطريقة محببة ، الوزن الطبيعى للطفل ، الفيتامينات الهامة للطفل ، أطعمة تمد الطفل بالطاقة ، أطعمة معززة للذكاء ، أطعمة مفيدة للدماغ ووظائف المخ ، أطعمة تقوى النظر ، أطعمة تقوى المناعة', NULL, '2022-11-22 06:37:25', '2022-11-22 23:59:59'),
(396, 341, 1, 2, NULL, 'Basics of  Adobe After Effects', NULL, 'After Effects is a motion graphics and special effects software that allows you to animate texts and objects', 'After Effects is a motion graphics and special effects software that allows you to animate texts and objects, use greenscreens to add or subtract objects and elements, and develop unique transitions to your visual media creations. Users can create their original graphics using Adobe Photoshop or Illustrator or redesign one of the many available templates to create their vision. When users combine the editing power of After Effects with the capacities of Cinema 4D Lite included with every subscription, these artists can add new textures and dimensions to their visual media.', 'You will need a Computer with a Higher RAM Capacity , Adobe After Effects installed .', NULL, NULL, '2022-11-24', '20221124074016.png', 'basics-of-adobe-after-effects', 1, 0, 0, 'Motion,Graphics,Adobe,AfterEffects', NULL, '2022-11-24 13:40:16', '2023-02-27 14:23:29'),
(397, 284, 27, 184, NULL, 'تحديد الاهداف', NULL, 'تحديد الاهداف والية الوصول الى الاهداف', 'تهدف الدوره الى اكساب الفرد المعرفه والاليه الصحيحه للوصول الى هدفه\r\nعناصره: مفهوم تحديد الاهداف - نموذج اسمارت - الاهداف الواضحه - انواع الاهداف- معوقات تحقيق الاهداف وكيفية مواجهتها', 'لا شيء', NULL, NULL, '2023-01-19', '20221124160753.jpg', 'تحديد-الاهداف', 1, 0, 0, 'تنميه بشريه - ادارة الذات - تحديد الاهداف', NULL, '2022-11-24 22:07:53', '2023-01-20 00:40:33'),
(398, 283, 9, 206, NULL, 'القيادة المرورية الأمنة', NULL, 'القيادة المرورية الأمنة', 'القيادة الأمنة تهدف إلي تحقيق السلامة المرورية لقائد المركبة وللأخرين، وتسمي القيادة الدفاعية أيضا بمعني ماهي الخطوات الوقائية التي يجب إتخاذها لمنع الحادث المروري.إستخدام حزام الأمان أثناء القيادة،عدم تجاوز السرعة القانونية،التأكد من صلاحية الإإطارات،القيادة في الأجواء الشتوية وتحت الثلوج، القيادة في الضباب،عدم القيادة تحت تأثير المخدرات،عدم التحدث في المحمول أثناء القيادة،عدم إستخدام ألة التنبيه دون سبب،الكشف الدوري علي محرك السيارة والزيوت،إرتداء واقي الرأس لقائدي الموتوسيكلات----هذة الدورة تستهدف جميع الفئات العمرية', 'لاشيئ', NULL, NULL, '2022-11-27', '20221127205109.jpg', 'القيادة-المرورية-الأمنة', 1, 0, 0, 'القيادة الأمنة-القيادة الدفاعية- إستخدام حزام الأمان-القيادة الجنونية-القيادة تحت تأثير المخدر-التحدث في المحمول أثناء القيادة-القيادة تحت الأمطار والثلوج- القيادة في الضباب-السلامة المرورية-الحوادث المرورية-إستخدام ألة التنبيه دون سبب-القيادة الواعية-', NULL, '2022-11-28 02:51:09', '2022-12-18 08:21:42'),
(399, 230, 18, 199, NULL, 'مهارة الإتصال التعليمي', NULL, 'الإتصال التعليمي وتنميو مهارات التواصل عند الأطفال', 'يتعرف المتدرس على مفهون التواصل، عناصر عملية الإتصال، والإتصال التعليمي، إضافة إلى  تنمية مهارات التواصل لدى الأطفال من خلال تطبيقات عملي في الصف، تستهدف هذه الدورة المعلمين', 'لا شيء', NULL, NULL, '2022-11-28', '20221128084713.JPG', 'مهارة-الإتصال-التعليمي', 1, 0, 0, 'مهارات الإتصال، الأطفال، الصف', NULL, '2022-11-28 14:47:13', '2022-11-29 15:04:49'),
(400, 346, 6, 205, NULL, 'اسرار الحياة الزوجية ( رحلة الى حياة اسرية سعيدة)', 'Secrets of married life', 'التعريف باسرار الحياة الزوجية', 'صورة العرض يجب أن يكون حجم صورة العرض ( العرض 1280 الطول 720 بيكسل ) ، صورة العرض هي بوست غلاف دورتك والذي يظهر بالصفحة الرئيسية ، لا تضع كلمات على الصورة ، فقط ضع صورة أو تصميم مناسب لموضوع دورتك لجذب انتباه الطلاب المشتركين', 'لاشيء', NULL, NULL, '2023-02-28', '20221129141316.jpg', 'اسرار-الحياة-الزوجية-رحلة-الى-حياة-اسرية-سعيدة', 1, 0, 0, '#الزواج #الحياة_الاسرية #الرجال #النساء #العائلة', NULL, '2022-11-29 20:13:16', '2023-02-28 22:42:18'),
(401, 296, 35, 262, NULL, 'برناج تدريب المدربين - الأهداف والأساليب التدريبية', NULL, 'كيف اختار الأسلوب التدريبي المناسب لكل هدف من أهداف التدريب', 'يهدف البرنامج الى اعانة المدربين في اختيار الأساليب التدريبية المناسبة لكل نوع من أنواع الأهداف التدريبية ( معارف - اتجاهات - مهارات ) و التفرقة بين الاساليب التدريبية والمساعدات التدريبية ومهارات المدرب الشخصية', 'لا يوجد', NULL, NULL, '2022-11-30', '20221130144936.jpg', 'برناج-تدريب-المدربين-الأهداف-والأساليب-التدريبية', 1, 0, 0, 'TOT  - الاساليب التدريبية - الاهداف التدريبية - مهارات التدريب - مهارات المدرب - قياس الاثر - الكشف - الانشاء - الخطة التدريبية', NULL, '2022-11-30 20:49:36', '2022-11-30 22:38:37'),
(404, 346, 6, 205, NULL, 'دستور العلاقات الزوجية (رحلة الى حياة اسرية سعيدة)', 'Constitution of the marital relationship', 'لكل علاقة قانون ومن اقدس العلاقات والمؤسسات هي مؤسسة الزواج لذا وجب علينا ان نوضح كيف تصيغ دستور لعلاقت الزوجية', 'كل علاقة ترتبط بعقد لابد لها من دستور او قانون ينظم هذه العلاقة الوةاج علاقة بين طرفين بينهما عقد فلابد ان نصيغ دستور لهذه العلاقةالمحتويات : - مفهوم الحياة الزوجيةـ مفاهيم خاطئة حول الحياة الزوجية.ـ اسرر الزواج الناجحـ نصائح لزواج ناجح وسعيد.- شروط للزواج الناجح.ـ الحقوق الزوجيةالفئة المستهدفة كل المتازوجون وكل من هم مقبلون على الزواج', 'لا شيء', NULL, NULL, '2023-02-28', '20221203102351.jpg', 'دستور-العلاقات-الزوجية-رحلة-الى-حياة-اسرية-سعيدة', 1, 0, 0, '#الاسرة #الحياة_الاسرية #العلاقة_الزوجية #الزواج #الرجال #النساء #الحوار #الاتصال_والتواصل #حياة_اسرية_سعيدة', NULL, '2022-12-03 16:23:51', '2023-03-07 14:47:34'),
(405, 346, 6, 205, NULL, 'فن حل الخلافات الزوجية (رحلة الى حياة اسرية سعيدة)', 'solutions to marital problems', 'التعرف على المشكلات الاسرية واسبابها وطرق التعامل معها لعلاجها', 'ليس هناك حياة مثالية، أو خالية من المنغصات والمشكلات، وخصوصا الحياة الزوجية، وهذا بحد ذاته ظاهرة صحية تبين ثقة الزوجين في اظهار اختلافهم في الرأي، ولكن ينبغي أن يكون هناك منهجية واضحة في التعامل مع تلك الخلافات واتقان مواجهتها والتغلب عليها بالحكمة والصبر والعقلانية، ليس ضعفاً وإنما حفاظاً على العلاقة الزوجية، وصيانتها، وحمايتها من التفكك والضياع.', 'لا شيء', NULL, NULL, '2023-02-28', '20221206165927.jpeg', 'فن-حل-الخلافات-الزوجية-رحلة-الى-حياة-اسرية-سعيدة', 1, 0, 0, 'الاسرة الزواج الحياة الاسرية الخلافات الزوجية حلول المشاكل', NULL, '2022-12-06 22:59:27', '2023-02-28 22:44:00'),
(406, 319, 36, 322, NULL, 'العلوم للمرحلة الابتدائية', NULL, 'المخلوط وانواعه وطرق عمل المخلوط وطرق الفصل', 'التفوق الدرسي\r\nمعلم اونلاين مع الشرح الكافي للدرس وعرض عملي \r\nواجبات', 'كمبيوتر او فون', NULL, NULL, '2022-12-15', '1670424327.jfif', 'العلوم-للمرحلة-الابتدائية', 1, 0, 0, 'علوم #المخلوط #التبخر # الترشيح', NULL, '2022-12-07 19:53:40', '2022-12-15 22:52:37'),
(408, 296, 35, 262, NULL, 'الادارة الاستراتيجية ( الأهمية والتطور )', NULL, 'لماذا الادارة الاستراتيجية وما هي أهميتها و تاريخ تطورها وتأثيها على بيئة الأعمال', 'هذا البرنامج هو واحد من أربعة برامج أفدمها في الادارة الاستراتيجية لتغطية المعارف الاساسية والمهارات اللازمة للادارة الاستراتيجية \r\nوفي البرنامج الاول اتطرق الى :-\r\nمفهوم وأهمية الادارة الاستراتيجية ، والتطور التاريخي والعلمي والعملي لهذه الادارة الهامة جدا ،والتي تكتسب أهميتها من قدرتها على توجيه المنظمات ومتابعة وتقييم الأداء من خلال ادوات الادارة الاستراتيجية والعناصر الرئيسية لها من رؤية ، ورسالة ، وغايات وقيم ، وأهداف ، وأدوات تحليلية و رقابية', 'لا يوجد', NULL, NULL, '2022-12-10', '20221210190436.jpg', 'الادارة-الاستراتيجية-الأهمية-والتطور', 1, 0, 0, '#أهمية_الادارة_الاستراتيجية\r\n#أمفهوم_الادارة_الاستراتيجية\r\n#تطور_الادارة_الاستراتيجية\r\n#تأثير_الادارة_الاستراتيجية\r\n#مدخل_الادارة_الاستراتيجية', NULL, '2022-12-11 01:04:36', '2022-12-11 23:00:38'),
(409, 346, 6, 59, NULL, 'فن تربية الابناء (رجلة الى حياة اسرية سعيدة)', 'Raising children', 'كيف تربي ابنائنا ؟', 'تربية الابناء هي اهم واعظم وظيفة يقوم بها الاهل\r\nلان التربية هي عبارة عن استثمار انت ك اب او ام بحاجة ليكون لديكم فكرة عن التربية حتى تتمكنا من تربية ابنائكم بطريقة صحيحة وتقدكون نموذج بناء للمجتمع\r\nالقئة المستهدغة الاهل وكل من يعمل مع الاطفال سواء معلم او مدرب رياضي \r\nمحتويات الدورة :\r\n_ مفهوم التربية.\r\n_ العوامل المؤثرة في التربية .\r\n_انماط شخصيات الاطفال وكيفية التعامل معها.\r\n_ استقلالية شخصية الطفل.\r\n_ الاساليب الخاطئة في تربية الابناء\r\n_صفات المربي الناجح .', 'لا شيء', NULL, NULL, '2023-02-28', '20221215162517.jpg', 'فن-تربية-الابناء-رجلة-الى-حياة-اسرية-سعيدة', 1, 0, 0, '#التربية #الطفل #المربي #الاستقلالية #الشخصية #انماط_الشخصية #فن_التعامل', NULL, '2022-12-15 22:25:17', '2023-02-28 22:44:47'),
(413, 709, 27, 188, NULL, 'اليابان والحياة الافضل', NULL, 'الدورة عبارة عن بحث مفصل حول تطور الثقافة والادارة والتعليم في اليابان', 'الدورة عباىو عن 3 محاور اساسية: \r\n-ادارة وتنمية الموارد البشرية في اليابان\r\n-التعليم في اليابان\r\n-دروس من التراث الياباني', 'لا شيء', NULL, NULL, '2022-12-24', '20221224093942.jpg', 'اليابان-والحياة-الافضل', 1, 0, 0, 'اتنمية الموارد البشرية في اليابان\r\nالتعليم في اليابان\r\nالتراث الياباني\r\nاليابان', NULL, '2022-12-24 15:39:42', '2023-01-13 21:03:34'),
