(416, 1385, 1, 2, NULL, 'التصميم ببرنامج كانفا', NULL, 'تحتاج بعض الذوق و المعرفة ببرنامج كانفا لتدخل عالم التصميم و الابداع', 'برنامج كانفا احد ابسط و اهم برامج التصميم التي تساعدك للابداع و خلق لوحة فنية بلمستك الخاصه و بخطوات سهله يمكن للجميع اتباعها و قد يستطيع الاطفال الابداع في التصميم لكثرة الخيارات و سهولة التعامل مع القوالب الموجودة', 'يمكن التصميم من الموبايل و يفضل جهاز حاسوب لسهولة التعامل', NULL, NULL, '2023-01-04', '20221225165030.jpg', 'التصميم-ببرنامج-كانفا', 1, 0, 0, 'كانفا , تصميم , منشور فيسبوك , منشور انستغرام , تصميم دعوة , سيرة ذاتية , تصميم فيديو', NULL, '2022-12-25 22:50:30', '2023-01-05 19:17:10'),
