(421, 948, 15, 135, NULL, 'C# Basic', NULL, 'التأسيس الصحيح لمطوري #C', 'دورة أساسيات باتطوير بلغة C# لتكون جزء من سلسلة شروحات لدورات خاصة بمطوري #C وتشمل:\r\n1- التعريف بالبرمجة وباللغة.\r\n2- المتغيرات وأنواع البيانات.\r\n3- بنى التحكم.\r\n4- المصفوفات.\r\n5- التوابع.\r\n6- تمارين شاملة.', 'الإلتزام بالشروحات والصبر على التعلم بالإضاة لتنصيب برنامج VS2015', NULL, NULL, '2022-12-30', '20221230083553.png', 'c-basic', 1, 0, 0, '#C - أساسيات البرمجة - سلسلة شروحات C#', NULL, '2022-12-30 14:35:53', '2022-12-31 14:02:31'),
(422, 296, 35, 262, NULL, 'الادارة الاستراتيجية ( التوجهات وطرق بناء الخطط الاستراتيجية )', NULL, 'الاهداف والتوجهات والأهداف وطريق بناء الخطط الاستراتيجيه للمؤسسات', 'الادارة الاستراتيجية تعمل على توجيه المؤسسة والعاملين بها من خلال وضع خطة استراتيجية واضحة الاهداف وواضحة التوجهات\r\nوفي هذه المجموعة سنتطرق الى \r\nالاهداف الاستراتيجية للمؤسسات\r\nالتوجهات الاستراتيجية للمؤسسات\r\nطرق بناء الخطط الاستراتيجيه للمؤسسات', 'لا يوجد', NULL, NULL, '2023-01-01', '20230101183958.jpg', 'الادارة-الاستراتيجية-التوجهات-وطرق-بناء-الخطط-الاستراتيجية', 1, 0, 0, '#التخطيط_الاستراتيجي \r\n#طرق_بناء_الخطط\r\n#الخطة_الاستراتيجية\r\n#طرق_التخطيط\r\n#الاهداف_الاستراتيجية\r\n#التوجهات_الاستراتيجية', NULL, '2023-01-02 00:39:58', '2023-01-03 10:03:56'),
(424, 1414, 35, 308, NULL, 'برنامج الأمين للمحاسبة والمستودعات', NULL, 'تأهيل المتدربين عملياً بأسس العمل المحاسبي', 'أهداف الدورة \r\n1-قدرة المتدرب على دخول سوق العمل.\r\n2-الحصول على خبرة عملية واسعة في علم المحاسبة.\r\n3-استخدام البرنامج الأمين للمحاسبة والمستودعات الأكثر انتشاراً للحصول  على فرصة أكبر في سوق العمل بواسطة مدرب مختص..\r\n4-أن يكون موظفاً في إحدى المحلات التجارية المستخدمة لهذا البرنامج.\r\n5-من الممكن أن يقوم بالتسويق لهذا البرنامج من خلال الخبرة التي يكتسبها في نهاية الدورة خاصة.\r\n6-من خلال المتابعة والمثابرة في احتراف البرنامج.\r\nمحاور دورة برنامج الأمين للمحاسبة والمستودعات\r\n1-تعريف بالمحاسبة ومسك الدفاتر والقيود المزدوجة.\r\n2-تنصيب البرنامج مع انشاء الملفات واختيار دليل الحسابات.\r\n3-بطاقات المجموعات وبطاقات الحساب.\r\n4-سند القيد الافتتاحي وعمليات السندات.\r\n5-عمليات الفواتير والمستودعات.\r\n6-تقاير الحسابات.\r\n7-مطابقة أرصدة الحسابات.\r\n8-التقارير الختامية والتدوير الأرصدة\r\nالفئة المستهدفة:\r\nرجال الأعمال والعاملون لديهم ، والراغبين بتعلم أسس العمل المحاسبي بأسلوب مبسط وكافة العاملين في المجال المحاسبي بهدف تنمية مهاراتهم وكذلك المهتمون بموضوع الدورة', 'لابتوب منزل عليه برنامج الأمين للمحاسبة والمستودعات', NULL, NULL, '2023-01-03', '20230103134115.jpg', 'برنامج-الأمين-للمحاسبة-والمستودعات', 1, 0, 0, 'برنامج الأمين ، للمحاسبة والمستودعات', NULL, '2023-01-03 19:41:15', '2023-01-10 23:23:43'),
(425, 1385, 27, 200, NULL, 'تدريب مدربين محترفين C-TOT', NULL, 'تساهم الدوره باكساب المتدربين مهارات التدريب الاحترافي', 'الهدف العام :اعداد المدرب المتميز /\r\nالمحتويات :  تحديد الاحتياجات التدريبيه / تصميم الحقيبه / الاساليب التدريبية / الانماط الشخصيه / فن الالقاء / لغة الجسد/ مهارات حياة\r\nالفئة المستهدفه: كل شخص يسعى لتطوير ذاته او اعماله\r\nكل الاشخاص من عمر 18 فما فوق', 'موبايل او لابتوب و متابعه', NULL, NULL, '2023-01-24', '20230113092001.jpg', 'تدريب-مدربين-محترفين-c-tot', 1, 0, 0, 'تنمية بشرية . تطوير الذات . تدريب مدربين . TOT-  تحديد اهداف', NULL, '2023-01-13 15:20:01', '2023-01-25 15:07:23'),
(426, 296, 35, 262, NULL, 'الادارة الاستراتيجية ( صياغة الرؤية والرسالة و القيم )', NULL, 'صياغة الرؤية والرسالة و القيم', 'الرؤية المستقبلية أو الرؤية الإستراتيجية\r\nهي عبارة عن التطلع المستقبلي الذي يحدد توجه ورغبة المنظمة نحو تحقيق جوانب نجاح وتميز مرغوبة مستقبلا. \r\nمن أهم خصائص الرؤية المستقبلية:\r\nأن تتصف بالوضوح.\r\nأن تكون ذات معنى ومغزى للسوق الذي تعمل به المنظمة.\r\nأن تتطلع إلى المستقبل وأن تأخذ الماضي في اعتبارها.\r\nأن تتسم بالاستقرار النسبي والاحتواء على قدر من التحدي.\r\n أن تستهدف حفز العاملين، وأيضا العملاء.\r\nأن تتصف بالإيجاز والتعبير عن التفوق والتقدم المستمر.', 'لا يوجد', NULL, NULL, '2023-01-29', '20230129190959.jpg', 'الادارة-الاستراتيجية-صياغة-الرؤية-والرسالة-و-القيم', 1, 0, 0, '#الرؤية #الرسالة #القيم #الادارة_الاستراتيجية #الصياغة_الاستراتيجية', NULL, '2023-01-30 01:09:59', '2023-02-01 07:32:41'),
(427, 372, 9, 206, NULL, 'كن انت المنقذ وتعلم الإسعافات الاوليه', NULL, 'نتعرف على الحالات الطارئة  وكيفية التصرف معها', 'تعلم الإسعافات الاوليه يعطيك المبادئ والاسس الاولية لتكون انت المنقذ لحياة شخص مصاب أو تقليل الم أو تجنيبة المضاعفات التى تحدث لو تم التعامل معه بطريقة خاطئة', 'مشاهدة جميع الفديوهات تعطيك قدر من المعلومات التى تساعدك فى التعامل مع الحالات الطارئة', NULL, NULL, '2023-02-04', '20230204172646.jpg', 'كن-انت-المنقذ-وتعلم-الإسعافات-الاوليه', 1, 0, 0, 'الإسعافات الأولية وإنقاذ الحياة', NULL, '2023-02-04 23:26:46', '2023-02-16 14:18:19'),
(428, 33, 27, 200, NULL, 'تقوية الشخصية', 'Personal strengthening', 'الدورة تعلمك طرق وتمارين عملية لتمتلك شخصية قوية أو تزيد من قوة شخصيتك من أجل العيش بسعادة \r\nثق بنفسك وتحرر من مخاوفك وخجلك \r\n\r\n\r\nقم بتطبيق الطرق والتمارين لكي تحصل على شخصية قوية وتحظى على اهتمام واحترام الاخرين', 'أهداف الدورة :\r\n1- التعرف الى الطرق والتمارين الذهنية والسلوكية من أجل تطوير الشخصية\r\n2- الحصول على شخصية قوية تتصف بالجرأة والحزم والثقة\r\n3- الحصول على احترام الاخرين والشعور بالأهمية\r\n4- التخلص من المخاوف المختلفة ورفع الثقة بالنفس\r\n5- تحويل التفكير السلبي الى إيجابي\r\n6- السيطرة على المشاعر والانفعالات العاطفية من أجل تقوية الشخصية\r\n7- تحقيق الأهداف في الحياة والنجاح في المجال الصحي والنفسي والمادي والاجتماعي\r\n8- تنمية طرق التفكير\r\n9- تنمية الذكاء العاطفي', 'لا شيء', NULL, NULL, '2023-02-22', '20230212103545.png', 'تقوية-الشخصية', 1, 0, 0, 'تقوية الشخصية', NULL, '2023-02-12 16:35:45', '2023-02-23 03:07:10'),
(429, 1572, 15, 132, NULL, 'البرمجة السحابية', 'cloud computing', 'مقدمة للحوسبة السحابية cloud من حيث مفهومها ،انواعها،فوائدها،تحدياتها،مستقبلها في عالم التكنلوجيا', 'هذه الدورة تعتبر مقدمة للحوسبة السحابية من حيث مفهومها وأهميتها ومستقبلها في عالم التقنية بالاضافة الى متطلباتها والتحديات التي تواجهها ،مع طرح أمثلة عنها في عالم التقنية والتحدث عن انواعها بنوع من التفصيل ،مع الحديث عن المستقبل المهني لها في الوطمن العربي والعالم في السنوات القادمة ،لذا يستطيع اي مهتم بالحوسبة السحابية حضور هذه الدورة من دون الحاجة الى متطلبات خاصة', 'رغبة في التعلم .لا يوجد متطلبات سابقة.', NULL, NULL, '2023-02-20', '20230213132833.jpeg', 'البرمجة-السحابية', 1, 0, 0, 'الكلاود ،الحوسبة السحابية ،cloud ,cloud computing', NULL, '2023-02-13 19:28:33', '2023-02-26 15:09:12'),
(430, 1425, 29, 245, NULL, 'تكنولوجيا كيمياء صناعة الأسمنت', NULL, 'تتناول الدورة التركيب الكيميائي للأسمنت والمواد الخام والحصول عليها وأنواع وخواص الأسمنت وإختبارات جودة المنتج النهائي', 'وصف الدورة\r\n\r\nتتناول دورة \" تكنولوجيا كيمياء صناعة الأسمنت \" شرح تفصيلي لصناعة الأسمنت علي طول خط الإنتاج في مصانع الأسمنت ومعرفة المعايير الواجب توافرها في الأماكن المطلوبة لإنشاء مصنع أسمنت ومعرفة المواد الخام وتركيبها الكيمياءي ونسب مكوناتها وكيفية الحصول عليها من تفجير المحاجر وإعداد المواد الخام لتكون جاهزة لتمر بمراحل الصناعة علي طول خط الإنتاج ، كما تناقش الدورة الالات والمعدات والأجهزة الموجودة بالمصنع ووظيفة كل معدة من المعدات ، ويركز المحاضر علي أنواع الأسمنت ومكونات وخواص وإستخدامات كل نوع منها ثم يبين لنا التركيب الكيميائي للمواد الأولية وللأسمنت كمنتج نهائي في نهاية خط الإنتاج ، ويوضح أيضا إختبارات الجودة للمنتج في صورته النهائية بفيديوهات تم تصويرها بداخل معامل الجودة تتيح للطالب معرفة خطوات إجراء الإختبار بشكل عملي بعد معرفة الأساس العلمي النظري لكل إختبار والجهاز المستخدم في إجراؤه ثم حساب النتائج لتحديد جودة المنتج ، وفي النهاية يلقي المحاضر الضوء علي ربط مجال صناعة الأسمنت بالبيئة والمخاطر الصحية الناتجة عن هذه الصناعة والتي تضر بصحة العاملين فيها والإجراءات المتخذة للحد من هذه الملوثات بعد التعرف علي أشكالها ومصادرها ثم نختم الدورة بمجال صناعة الأسمنت في مصر ويستشهد المحاضر في محاضراته بفيديوهات مسجلة من مهندسين إنتاج في مصانع عديدة بالوطن العربي وهم علي خط الإنتاج لتقريب الصورة والمشهد للطالب ليدرس المحتوي النظري ويري بعينه كيف يتم تطبيق ذالك داخل المصانع\r\n\r\nدراسة علمية شيقة وممتعة للمهتمين بهذا المجال الذي يعتبر عصب الحضارات والنمو والإعمال والتشييد!\r\n\r\nمحتوي الدورة :\r\n\r\n.........................................................................................\r\n\r\n1- Introduction\r\n\r\n(1) الفيديو الترويجي لكورس صناعة الأسمنت\r\n\r\n(2) محتوي الدورة\r\n\r\n.........................................................................\r\n\r\n2- مقدمة عن الأسمنت\r\n\r\n(3) مقدمة تعريفية بالأسمنت\r\n\r\n(4) المعايير والمواصفات المطلوبة لإختيار الأماكن المناسبة لإنشاء مصانع الأسمنت\r\n\r\n(5) مصادر الوقود\r\n\r\n.........................................................................................\r\n\r\n3- مما يتكون الأسمنت ؟\r\n\r\n(6) مكونات الأسمنت\r\n\r\n(7) التركيب الكيميائي للأسمنت\r\n\r\n..................................................................................................\r\n\r\n4- أنواع الأسمنت\r\n\r\n(8) الأسمنت البورتلاندي مبكر المقاومة العالية\r\n\r\n(9) الأسمنت البورتلاندي منخفض الحرارة\r\n\r\n(10)الأسمنت البورتلاندي الأبيض\r\n\r\n(11)الأسمنت البورتلاندي الحديدي ( المحتوي علي خبث الحديد )\r\n\r\n(12) الأسمنت عالي الألومينا\r\n\r\n(13) الأسمنت المخلوط ( الكرنك )\r\n\r\n(14) أنواع أخري من الأسمنت ( المقاوم للكبريتات والمقاوم للجراثيم وأسمنت سيناء )\r\n\r\n...............................................................\r\n\r\n5- خواص الأسمنت\r\n\r\n(15) نعومة الأسمنت\r\n\r\n(16) الكثافة النوعية أو الوزن النوعي للأسمنت\r\n\r\n(17) الشك والتصلد\r\n\r\n(18) ثبات حجم الأسمنت\r\n\r\n(19) مقاومة الأسمنت\r\n\r\n...............................................................................\r\n\r\n6- طرق ومراحل خطوات صناعة الأسمنت\r\n\r\n(20) الخطوات العامة لصناعة الأسمنت\r\n\r\n(21) الفرق بين الطريقة الرطبة والطريقة الجافة في مراحل صناعة الأسمنت\r\n\r\n(22) مراحل صناعة الأسمنت علي طول خط الإنتاج في المصنع\r\n\r\n(23) خطوات صناعة الأسمنت البورتلاندي\r\n\r\n(24) ملخص ومخطط شامل لخطوات صناعة الأسمنت\r\n\r\n.........................................................................\r\n\r\n7- الأجهزة والمعدات المستخدمة في صناعة الأسمنت\r\n\r\n(25) الكسارات\r\n\r\n(26) سكة التغذية وأسلوب النقل داخل المصنع\r\n\r\n(27) ذراع التكديس وضمان التجانس بين المكونات\r\n\r\n(28) الطواحين وفكرة عملها لسحق المواد\r\n\r\n(29) صوامع المواد الخام\r\n\r\n(30) المسخن البدئي أو المكلسن ( PREHEATER )\r\n\r\n(31) الفرن الدوار\r\n\r\n(32) مبرد الكلينكر\r\n\r\n(33) كسارة الجبس وصوامع الكلينكر والأسمنت\r\n\r\n(34) ماكينة التعبئة الآلية\r\n\r\n..................................................................\r\n\r\n8- كيمياء صناعة الأسمنت\r\n\r\n(35) كيمياء صناعة الأسمنت والتفاعلات الكيميائية للمواد بداخل فرن الإحتراق\r\n\r\n.................................................................\r\n\r\n9- إختبارات جودة الأسمنت في معامل مصانع الأسمنت\r\n\r\n(36) مقدمة عن أهمية إختبارات الجودة وآليات تطبيقها\r\n\r\n(37) إختبار تعيين نعومة الأسمنت بإستخدام منخل رقم 170\r\n\r\n(38) إختبار قياس الكثافة النوعية للأسمنت\r\n\r\n(39) إختبار تحديد نسبة الماء اللازمة للحصول علي عجينة أسمنتية ذات قوام قياسي\r\n\r\n(40) إختبار تحديد زمن الشك الإبتدائي والنهائي بجهاز فيكات\r\n\r\n(41) إختبار تقدير ثبات الحجم وتمدد الأسمنت بطريقة لوشاتيليله\r\n\r\n(42) إختبار تحديد مقاومة الأسمنت\r\n\r\n(43) إختبار تحديد مقاومة الشد للمونة الأسمنتية\r\n\r\n......................................................................\r\n\r\n10- الأسمنت والبيئة\r\n\r\n(44) الأسمنت ومصادر تلوث البيئة والمخاطر الصحية المصاحبة لها\r\n\r\n(45) الإجراءات المتخذة للحد من ملوثات الهواء\r\n\r\n(46) الإجراءات المتخذة للحد من ملوثات الماء\r\n\r\n(47) الإجراءات المتخذة للحد من ملوثات التربة\r\n\r\n.............................................................................\r\n\r\n11- صناعة الأسمنت في مصر\r\n\r\n(48) أنواع وخواص الأسمنت الذي يتم إنتاجه في مصر\r\n\r\nالفئة المستهدفة\r\n\r\n(1) طلبة كليات العلوم قسم الكيمياء الخاصة والكيمياء التطبيقية\r\n\r\n(2) طلبة كليات الهندسة الكيميائية\r\n\r\n(3) الخريجين المقبلين علي العمل في قطاع صناعة الأسمنت\r\n\r\n(4) العاملين في مجال صناعة الأسمنت', 'لا توجد متطلبات', NULL, NULL, '2023-02-14', '20230214233704.jpg', 'تكنولوجيا-كيمياء-صناعة-الأسمنت', 4, 0, 0, 'صناعة الاسمنت وكيمياء الاسمنت cement industry', NULL, '2023-02-15 05:37:04', '2023-02-28 23:46:40'),
(431, 296, 35, 262, NULL, 'الادارة الاستراتيجية ( التحليل والرقابة )', NULL, 'الوظيفة الاخيرة من وظائف الادارة وهي المتابعة والتحليل والتقييم \r\nفي هذا البرنامج نتعرض لهذه الوظيفة في شكلها الاستراتيجي', 'تعرضنا في برامج سابقة للتخطيط الاستراتيجي بشكل مفصل وتعرفنا على طرق بناء الخطط الاستراتيجية وطرق بناء الاداوات الاستراتيجية \r\nنتعرف في هذا البرنامج على الادوات الاستراتيجية لتحليل نقاط القوة والضعف والفرص والتهديدات SWOT \r\nو ايضا ادوات وطرق متابعة الاداء ومستوى سير الخطط الاستراتيجية', 'لا يوجد', NULL, NULL, '2023-02-20', '20230220153328.JPG', 'الادارة-الاستراتيجية-التحليل-والرقابة', 1, 0, 0, '#الادارة_الاستراتيجية\r\n#SWOT\r\n#المتابعة\r\n#التقييم\r\n#التحليل', NULL, '2023-02-20 21:33:28', '2023-02-21 08:02:28'),
(433, 33, 27, 187, NULL, 'التواصل مع الناس بدون خوف', 'Communicate with people without fear', 'مهارات التواصل والتحدث أمام الناس بدون خوف أو خجل', 'مهارات التواصل والتحدث أمام الناس بدون خوف أو خجل', 'لا شيء', NULL, NULL, '2023-02-24', '20230224121015.png', 'التواصل-مع-الناس-بدون-خوف', 1, 0, 0, 'الخوف، مهارات التواصل', NULL, '2023-02-24 18:10:15', '2023-02-25 18:51:21'),
(434, 965, 12, 110, NULL, 'من دروس النحو والصرف والإملاء', 'Grammar, grammar and spelling lessons', 'اللغة العربية', 'شرح مفصل لبعض دروس النحو والصرف والإملاء باللغة العربية، وأشياء أخرى لها علاقة بتجويد القرآن الكريم', 'معرفة القراءة والكتابة والأمور المسبقة لفهم القواعد', NULL, NULL, '2023-02-26', '20230226092321.jpg', 'من-دروس-النحو-والصرف-والإملاء', 1, 0, 0, 'اللغة العربية والتجويد / النحو والصرف والإملاء', NULL, '2023-02-26 15:23:21', '2023-03-10 19:51:03'),
(436, 1572, 27, 182, NULL, 'أنا وتقديري لذاتي', 'Me and my self esteem', 'رحلة في تقديرنا لذواتنا لنحقق السعادة والرضا من خلال تعزيز تقديرنا لذواتنا وتعزيز تقدير الذات لمن حولنا وخاصة الأطفال', 'توضح  هذه الدورة أنا وتقديري لذاتي  عن ما عن مفهوم تقدير الذات  وهل هو حاجة إنسانية ملحة أم لا؟ وما الفرق بين تقدير الذات والثقة بالنفس وأهمية تقدير الذات وتأثيرها على تعزيز ثقتنا بأنفسنا ،ونذكر معا  أهم صفات أصحاب ذوات التقدير الذاتي المرتفع وصفات أصحاب تقدير الذات المنخفض وسنقوم بقياس ما مستوى تقديرنا  لذواتنا. وكيف  تتم مراحل تكوين تقدير الذات وخصائصها؟ وكيف نعزز تقديرنا لذاتنا، وكيف نعزز تقدير الذات لدى الأطفال بطرق علمية وعملية شيقة .', 'رغبتك بتنمية نفسك وتقديرك لذاتك', NULL, NULL, '2023-03-05', '20230305103937.png', 'أنا-وتقديري-لذاتي', 1, 0, 0, 'تنمية بشرية ،تقدير الذات،تعزيز الثقة بالنفس،الشعور بالرضا والسعادة', NULL, '2023-03-05 16:39:37', '2023-03-05 17:57:32'),
(437, 1572, 15, 135, NULL, 'اساسيات لغة HTML5', 'HTML5', 'اساسيات لغة تصميم المواقع HTML5', 'كما نعلم اليوم لا نستطيع الاستغناء عن الإنترنت ولا عن صفحات الويب في جميع مجالات حياتنا. وتعتبر لغة HTML 5 أساسية لأي اصفحةويب ، كما أنها تعتبر لغة سهلة وبسيطة للتعلم. فكان لا بد لنا. من تخصيص دورة خاصة لهذه اللغة الأساسية التي تعد مفتاح لبرمجة الويب \r\nسنتحدث في هذه الدورة. كمقدمة عن لماذا نتعلم اليوم هذه اللغة وما هي مميزاتها ؟ . \r\n ,ما هي المميزات الإضافية التي قدمتها هذه اللغة في إصدارها  الجديد؟  \r\nوما هي المكونات الأساسية لهذه اللغة من عناصر وخصائص و وسوم وكيف نتحكم بالعناوين الرئيسية والفقرات وتغيير الألوان وأنواع الخطوط. وكيف نضيف كومندز  أو تعليقات في ال الكود الخاص بنا وباستخدام هذه اللغة آكيف نضيف قائمة على صفحة الويب  وفي المستويات القادمة سنتحدث عن الجداول ونضيف صور والتعديل على الصور وإضافة روابط والتعامل مع النماذج وغير ذلك بنوع من التفصيل.لنتعرف على  المميزات الخطيرة و الرهيبة لهذا الأصدار الجديد،وراعيت  في هذه الدورة الأشخاص الذين ليس لديهم أدنى فكرة عن ال HTML .', 'للمبتدئين والراغبين في تعلم برمجة صفحات الويب', NULL, NULL, '2023-03-06', '20230306184259.png', 'اساسيات-لغة-html5', 1, 0, 0, 'برمجة،تصميم مواقع ،برمجة مواقع النت، HTML,HTML5', NULL, '2023-03-07 00:42:59', '2023-03-07 02:48:05');

