(37, 321, 'تدريب المدربين TOT', NULL, 'تدريب-المدربين-tot', 'تهدف الدورة الي معرفة الاساليب الفنية المتنوعية للتدريب وسمات المدرب ومهارات الاتصال وبيئة التدريب', 'الجامعين والخريجين والمهتمون بالتدريب والقائمين علي التدريب', 'مفاهيم التدريب  ومكونات نظام التدريب والحقيبة التدريبيية\r\nسمات المدرب  الناجح ومهارات الاتصال الفعال\r\nمهارات العرض الفعال\r\nبيئة التدريب \r\nاستراتيجيات التدريب', '2022-11-18', '6.30 - 8.00', '5', 0, 0, '1668095976.jpg', 5, 'https://us06web.zoom.us/j/86029080310?pwd=Z0FOdGZtbUVMQVBJZFFiVjh4eFVFQT09', NULL, NULL, '2022-11-10 21:59:36', '2022-11-25 12:14:00'),
(38, 778, 'مهارات الباحثين عن العمل', NULL, 'مهارات-الباحثين-عن-العمل', 'كيف تدخل إللى سوق العمل بقوة.\r\nسوف تتعلم في هذه الدورة ما يلي:\r\n1/ إنشاء حساب علي مواقع التوظيف مثل linked in\r\n2/ طرق البحث عن الوظائف وكيفية التقديم عليها\r\n3/كتابة السيرة الذاتية (CV) بإحترافية\r\n4/اجتياز مُقابلة العمل ( Interview )', 'كل من يريد التطوير من مسارة الوظيفي \r\nالطلاب للتهيئة الي سوق العمل\r\nالخريجين المُقبلين علي سوق العمل', '1/ إنشاء حساب علي مواقع التوظيف مثل linked in\r\n2/ طرق البحث عن الوظائف وكيفية التقديم عليها\r\n3/كتابة السيرة الذاتية (CV) بإحترافية\r\n4/اجتياز مُقابلة العمل ( Interview )', '2022-12-07', '8.00 - 9.30', '3', 0, 0, '1668178326.png', 5, 'https://us06web.zoom.us/j/89283131299?pwd=V1NVWTZJeC9CMndzSExvWGNTZmtBZz09', NULL, NULL, '2022-11-11 20:52:06', '2022-12-11 11:00:29'),
(39, 662, 'سلامة وصحة الغذاء', 'Food safety and health', 'سلامة-وصحة-الغذاء', 'دوراتنا التدريبية جذابة وسهلة الفهم ، مما يساعد الحضور على الاحتفاظ و تطبيق ما تعلموه.\r\nدورة نظافة الأغذية هي المستوى الأساسي في سلامة الأغذية التي يأخذ المشاركون من خلالها كل شيء.\r\nمفاتيح أساسية لسلامة الأغذية بما في ذلك المبادئ والأخطار ومسببات الأمراض.\r\nبالإضافة إلى التسمم الغذائي وطرق الوقاية والمشاركين ستكون قادرة على الكشف عن المخاطر في الغذاء.', 'خبراء سلامة الغذاء ، مدققو الطعام ، خبراء الطعام ، موظفو مطعم الطهاة ، علماء الأحياء ، الكيميائيين ، علماء الأحياء الدقيقة،  و كل من لديه اهتمام بالموضوع فالغذاء يخصنا جميعا \r\nأخصائيو التغذية وأخصائيو التغذية والكيمياء الحيوية ومدراء المطاعم\r\nموظفو ISO ومهنيو الرعاية الصحية وطلاب جودة الطعام\r\nالطلاب ، مراقبو وزارة الصحة ، موظفو وزارة الصحة\r\nأي شخص يعمل في مجال تقديم الطعام أو الضيافة أو التصنيع بما في ذلك تجهيز الأغذية والفنادق والمطاعم والمطابخ المدرسية ومطابخ المستشفيات. النوادل وموظفي صناعة المواد الغذائية أصحاب أو مديري أو قادة الفرق أو المديرين أو المديرين التنفيذيين في المطاعم أو الضيافة أو الصناعة التحويلية.\r\nكبار الموظفين ومدربي الصحة الغذائية ورؤساء الطهاة ومصممي دورات الطعام والطهاة التنفيذيين والمدققين الداخليين', 'سلامة الغذاء\r\nمخاطر الغذاء\r\nالأخطار المادية\r\nالمخاطر الكيميائية\r\nمخاطر مسببات الحساسية\r\nالمخاطر البيولوجية\r\nبكتيريا\r\nعوامل النمو البكتيرية\r\nمنطقة الخطر\r\nانتقال التلوث\r\nفيفو\r\nقواعد سلامة الغذاء\r\nالفريزر\r\nثلاجة\r\nمعايير التخزين\r\nالصحة الغذائية\r\nالنظافة الشخصية\r\nمدة صلاحية الطعام في الفريزر\r\nحرق المجمد\r\nتسمم غذائي\r\nعملية إعادة التسخين\r\nالآفات', '2023-02-15', '8.00 - 9.30', '3', 0, 0, '1668187111.jpg', 5, 'https://us06web.zoom.us/j/89567669597?pwd=Zlo2SDVaTlZBUGpEbjR1R1d6SkRWZz09', NULL, NULL, '2022-11-11 23:18:31', '2023-02-23 14:58:28'),
(41, 129, 'المهارات الرقمية الأساسية', NULL, 'المهارات-الرقمية-الأساسية', 'إطلاله على دورة التحول الرقمي - مساعدة المتدربين في معرفة النقاط الرئيسية لمحاور الدورة الخمسة من خلال التعامل مع جهاز الكمبيوتر وبرامج الأوفيس وتطبيقات الانترنت', 'جميع الفئات التي تهتم باستخدام الحاسب الآلي والانترنت', '1- نظام التشغيل ويندوز 10\r\n2- مايكروسوفت وورد\r\n3- مايكروسوفت باوربوينت\r\n4- مايكروسوفت اكسيل\r\n5- الانترنت وتطبيقات جوجل المميزة', '2022-12-13', '6.30 - 8.00', '5', 0, 0, '1668281301.png', 5, 'https://us06web.zoom.us/j/82916718038?pwd=UGh6RUxWTWYyUXE4bWJTcU9iVFNDUT09', NULL, NULL, '2022-11-13 00:47:41', '2022-12-17 08:44:29'),
(43, 230, 'مهارة التعلّم الذاتي', NULL, 'مهارة-التعلم-الذاتي', 'التعلّم الذاتي مهارة من مهارات القرن ال 21، مهارة نحتاجها الآن، حيث برزت أهميته بالتزامن مع التطور الثوري للمعلومات والإتصالات، في هذه الدورة ستتمكن من التغلّب على تحديات التعلم الذاتي من خلال التطرق إلى أهم المهارات التي تحتاجها لبناء خططك التعليمية الناجحة', 'كل من يرغب في التطور الذاتي', 'ما هي مهارات القرن ال 21؟\r\nمفهوم التعلّم الذاتي\r\nلماذا يجب أن تمتلك مهارة التعلّم الذاتي. (مبررات، أهداف، أهمية)\r\nمقارنة بين التعليم التقليدي والتعلم الذاتي\r\nكيف أتعلّم ذاتيًا؟ (كيف تختار؟ خطط التعلّم الفعّال)\r\nالتغلب على عوائق التعلّم الذتي (مشكلات تطبيقية والعوامل المؤثرة)\r\nاستراتيجيات التعلّم الذاتي (طرق، وسائل، ومصادر)\r\nدور ومسؤولية كل من الأهل، المعلمين، المجتمع في تعزيز التعلّم الذاتي.', '2023-06-04', '8.00 - 9.30', '3', 0, 0, '1669015278.png', 0, NULL, NULL, NULL, '2022-11-21 13:21:18', '2023-02-16 23:52:59'),
(44, 230, 'مهارات التواصل الفعّال', 'Effective communication skills', 'مهارات-التواصل-الفعال', 'إنّ نجاح الإنسان في عمله وحياته مرهون بقدرته على الإتصال، من خلال هذه الدورة سيتم توضيح طبيعة الإتصال الفعّال، تقديم المكونات الأساسية للإتصال وعرض أفكار وأستراتيجيات لتوظيفها بعملية الإتصال', 'كل من يسعى إلى تحسين مهارات التواصل في الحياة', 'مفاهيم حول التواصل\r\nخارطة التواصل\r\nأنواع التواصل\r\nمعيقات التواصل والحلول\r\nمهارات الإتصال والتواصل الفعّال\r\nارشادات الإتصال الفعال\r\nتطبيقات المعارات اللازمة للتواصل بفعالية\r\nالإقناع والتأثير وكيفية التعامل مع الشخصيات الصعبة\r\nلغة الجسد (المظهر، الألوان، أنماط التفكير)', '2023-05-25', '8.00 - 9.30', '3', 0, 0, '1669016935.jpg', 1, NULL, NULL, NULL, '2022-11-21 13:48:55', '2023-03-18 17:02:27'),
(45, 799, 'إكتشف ذاتك و نسختك الأصلية', NULL, 'إكتشف-ذاتك-و-نسختك-الأصلية', 'رحلة إكتشاف الذات رحلة عميقة و شيقة متطلبة في الكثير من الأحيان جهد لكن نتائجها مبهرة..\r\nإكتشاف الذات في الحقيق هي  أول خطوة للنجاح الشخصي و العملي و الاجتماعي و أول خطوه لتحقيق التوازن النفسي و الراحة النفسية\r\nأهدف الدورة :\r\n*أهمية الوعي و دوره في تحسين حياتنا اليومية \r\n*تمكين المشاركين من إكتساب اساليب و تقنيات محددة لإكتشاف الذات\r\n*  تمكين المشاركين من معرفة طرق التحكم في الذات', 'الأشخاص المهتم بالتطوير الذاتي', '*مدخل لأهمية الوعي الذاتي\r\n*إكتساب تقنيات التعامل مع الجوانب المظلمة للذات\r\n*اساسيات التوازن النفسي و تجلياته على جميع المستويات الحياتية\r\n*معرفة شغفك الذاتي\r\n*أساسيات تحقيق السلام الداخلي', '2023-01-12', '6.30 - 8.00', '3', 0, 0, '1669563933.jpg', 4, NULL, NULL, NULL, '2022-11-27 21:45:33', '2022-11-29 11:26:07'),
(54, 662, 'التسويق الالكتروني الحديث', 'Modern e-marketing', 'التسويق-الالكتروني-الحديث', 'التسويق الرقمي', 'كل شخص يسعى لآكتساب مهارة مهنة حديثة مربحة لا حدود أو مدة زمنية لها ومطلوبة حدودها السما.', 'افضل و انجح طرق للتسويق الرقمي بتكنولوجيا رقمية عالية و حديثة.', '2023-03-05', '8.00 - 9.30', '3', 0, 0, '1671557568.jpg', 5, 'https://us06web.zoom.us/j/89133739433?pwd=SDgrQXlSUVZXUU9RZjFpWVRMN0FGUT09', NULL, NULL, '2022-12-20 23:32:48', '2023-03-08 15:46:20'),
(55, 129, 'أساسيات برامج الوورد والاكسيل', 'Fundamentals of MS-Word and MS-Excel', 'أساسيات-برامج-الوورد-والاكسيل', 'استخدام برامج الوورد والاكسيل  - إخراج مستندات الوورد بشكل تنسيقي مميز -اجراء العمليات الحسابية واستخدام الدوال وتحليل البيانات في برنامج الاكسيل .', 'جميع الفئات التي تتعامل مع برامج الوورد والاكسيل والباوربوينت - أعمال السكرتارية وإدارة الأعمال وإدارة الملفات وإدخال البيانات -إجراء العمليات الحسابية وتحليل البيانات - تصميم العروض التقديمية - مشروعات الطلبه في المدارس والجامعات', 'أولاً : برنامج الوورد\r\n- التعريف بالبرنامج وكيفية التعامل معه وأهم الضوابط.\r\n- كتابة نص وتنسيقه .\r\n- الهوامش واتجاه الصفحة ورأس وتذييل الصفحة والترقيم للصفحات والفقرات  وإدراج الرموز.\r\n- إدراج صورة كعلامة مائية والكتابة فوقها.\r\n- إدراج الجداول .\r\n-الاستبدال .\r\n- عمليات النسخ والقص واللصق ونسخ العمليات التنسيقية.\r\n- حماية المستند.\r\n- تحويل الملفات لصيغة pdf\r\n\r\nثانياً : برنامج الاكسيل:-\r\n- اجراء العمليات الحسابية واستخدام الدوال وتحليل البيانات\r\n- التنسيق الشرطي .\r\n- حماية البيانات .', '2023-03-15', '8.00 - 9.30', '3', 0, 0, '1674995853.png', 5, 'https://us06web.zoom.us/j/81230648281?pwd=eUFoYjlkZ0NhRTJaMk53bThZU2M3QT09', NULL, NULL, '2022-12-25 18:09:08', '2023-03-18 11:19:34'),
(57, 1414, 'برنامج الأمين للمحاسبة والمستودعات', 'Al-Ameen program for accounting and warehouses', 'برنامج-الأمين-للمحاسبة-والمستودعات', 'قدرة المتدرب على دخول سوق العمل من خلال المتابعة والمثابرة في احتراف البرنامج', 'خريجي الجامعات والمعاهد التجارية', '1-تعريف بالمحاسبة ومسك الدفاتر والقيود المزدوجة \r\n2- تتصيب البرنامج مع إنشاء الملفات واختيار دليل الحسابات. \r\n3-بطاقات المجموعات وبطاقات الحساب \r\n4- سند القيد الافتتاحي وعمليات السندات \r\n5- عمليات الفواتير والمستودعات \r\n6-تقارير الحسابات \r\n7-مطابقة أرصدة الحسابات \r\n8-التقارير الختامية والتدوير الارصدة', '2023-05-11', '8.00 - 9.30', '3', 0, 0, '1672398932.jpg', 1, NULL, NULL, NULL, '2022-12-30 17:15:32', '2023-03-18 17:03:53'),
(58, 284, 'ادارة الموارد البشريه', NULL, 'ادارة-الموارد-البشريه', 'معرفة مهام عمل مسؤول الموارد البشريه- ايضا اجتياز المقابله بنجاح وايضا عمل سي في بشكل احترافي', 'خريجين وطلاب جامعين وموظفين يسعون لشغل هذا المنصب', 'مقدمه عن إدارة الموارد البشرية\r\n-تحليل وتصميم وتوصيف الوظائف\r\n-تخطيط الاحتياجات من الموارد البشريه\r\n-التوظيف\r\n-تصميم الأجور\r\n-التدريب\r\n-تقيم أداء العاملين\r\n-اجتياز المقابله\r\n-عمل السي في بشكل احترافي', '2023-03-12', '8.00 - 9.30', '3', 0, 0, '1676498110.jpg', 5, 'https://us06web.zoom.us/j/83662115230?pwd=Wk14OG9CYXdhSkNjWmZyZnhZZVIxZz09', NULL, NULL, '2023-01-12 18:36:08', '2023-03-15 09:33:25'),
(60, 284, 'ادارة المشاريع الاحترافية', 'Project Management Professional', 'ادارة-المشاريع-الاحترافية', 'هذه الدوره تهدف الى فهم اساسيات عمل المشاريع وكل ما يحتاجه المشروع من تنظيم وهيكله ودورة الحياه الخاصه بالمشروع والجوده والعاملين حتى يتسنى لك الالمام بكل جوانب المشروع بشكل احترافي', 'الموظفين بالقطاعات الخاصه والموظفين المعنيين بادارة المشروعات وكل من يبحث عن أساسيات لعمل مشروع خاص به، طلاب تخصص ادارة الاعمال والخرجين ومن لديهم شغف بهذا المجال', '- منهجية إدارة المشروع\r\n- دورة حياة المشروع\r\n- عمليات إدارة المشروع\r\n- كيفية إدارة نطاق المشروع\r\n- كيفية ادارة وقت المشروع\r\n- ادارة تكاليف المشروع\r\n- ادارة الجوده الخاصه بالمشروع\r\n- ادارة الموارد البشريه بالمشروع\r\n- ادارة الاتصالات\r\n- ادارة المخاطر\r\n-ادارة التوريدات\r\n- ادارة المعنيين بالمشروع', '2023-05-03', '8.00 - 9.30', '3', 0, 0, '1676498139.jpg', 1, NULL, NULL, NULL, '2023-01-23 05:26:24', '2023-03-18 20:09:26'),
(63, 156, 'مهارات النجاح الشخصي وتحقيق الأهداف', 'Skills of personal success and achieving goals', 'مهارات-النجاح-الشخصي-وتحقيق-الأهداف', 'تعرض الدورة مهارات التفكير وتعريفه وانماطه ومهارات الذكاء وطرق التفكير بطرق ابداعية ومعادلة النجاح للوصول للهدف الشخصي النهائي وهو النجاح والسعادة', 'كل من يطمح بتطوير مهارته الشخصية (الفكرية والعملية)', '1- مهارات التفكير\r\n2- مهارات الذكاء\r\n3- معادلة النجاح', '2023-02-19', '8.00 - 9.30', '3', 0, 0, '1676174979.PNG', 5, 'https://us06web.zoom.us/j/84170253417?pwd=ZnRLWEplV0xXd3c3SEJjN0h1Y0ZyZz09', NULL, NULL, '2023-02-12 10:09:39', '2023-02-23 14:23:36'),
(67, 1572, 'اساسيات لغة برمجة ++c', 'c++  programming', 'اساسيات-لغة-برمجة-c', 'تعليم اساسيات لغة برمجة ++c', 'طلاب الجامعات،طلاب الصف اول ثانوي ،المبتدئين في البرمجة', 'الطباعة على شاشة المتغيرات\r\nالمتغيرات وانواع البيانات\r\nجمل الادخال\r\nالتعابير الحسابية \r\nالتعابير العلائقية والمنطقية \r\nجملة الاختيار الشرطية \r\nجملة التكرار', '2023-05-16', '8.00 - 9.30', '5', 0, 0, '1677753054.png', 1, NULL, NULL, NULL, '2023-03-02 16:30:54', '2023-03-18 16:34:15'),
(68, 1572, 'هل أنا مكتئب', '? AM I depressed', 'هل-أنا-مكتئب', 'لمعرفة اسباب الاكتئاب والوقاية منه وهل علي مراجعة أخصائي نفسي ؟', 'الجميع', 'تعريف الاكتئاب\r\nاسبابه؟\r\nطرق الوقاية منه \r\nمقياس نفسي للاكتئاب', '2023-06-01', '8.00 - 9.30', '3', 0, 0, '1677754951.jpg', 0, NULL, NULL, NULL, '2023-03-02 17:02:31', '2023-03-02 17:02:31'),
(69, 514, 'إدارة المخاطر المالية', 'Financial risk management', 'إدارة-المخاطر-المالية', '1- التعريف بمفهوم المخاطرة وعلاقتها بالإدارة المالية\r\n 2- توضيح أهم أنواع المخاطر المالية، وكيفية المبادلة مع العوائد\r\n 3- بيان أهم الأساليب المستخدمة في قياس المخاطر المالية\r\n4- التعريف بمفهوم إدارة المخاطر والأسس التي تقوم عليها', 'العاملين في المجال المالي والمحاسبي، المهتمين في مجال المخاطر المالية، خريجي التخصصات المالية والإدارة.', '- مقدمة\r\n- مفهوم المخاطرة\r\n- علاقة المخاطرة بالإدارة المالية\r\n- اهم أنواع المخاطر التي تواجه الشركات\r\n- المبادلة بين العائد والمخاطرة\r\n- طرق مقياس المخاطر المالية\r\n- إدارة المخاطر', '2023-05-21', '8.00 - 9.30', '3', 0, 0, '1677960165.jpg', 1, NULL, NULL, NULL, '2023-03-05 02:02:45', '2023-03-20 14:55:24'),
(70, 514, 'إدارة المستودعات', 'stores management', 'إدارة-المستودعات', 'دورة تدريبية متخصصة في إدارة المخازن والمستودعات، ومن أهدافها:-\r\n•	أن يتعرف المتدرب على مفهوم إدارة المستودعات وأهميتها.\r\n•	أن يتعرف المتدرب على مهام العاملون في مجال المستودعات\r\n•	أن يدرك المتدرب الوصف الوظيفي لمهنة مدير مخازن ومستودعات\r\n•	أن يتعرف المتدرب على أنواع المخازن\r\n•	أن يتعرف المتدرب على  أهمية التخطيط والرقابة على المخزون \r\n•	أن يدرك المتدرب طرق أمن وسلامة المستودعات', '•	مدراء المستودعات والمخازن.\r\n•	أمناء المستودعات والمخازن\r\n•	العاملون في حقل المشتريات والتخزين.\r\n•	أخصائي الاستيراد والتصدير.\r\n•	محاسب التكاليف والمخازن.\r\n•	مدراء المشتريات والتخزين والتخطيط والتطوير والإنتاج.', 'الوحدة التدريبية الأولى: مفهوم وأهمية إدارة المستودعات  \r\nالوحدة التدريبية الثانية: إجراءات وأنظمة التخزين\r\nالوحدة التدريبية الثالثة: مراقبة المخزون وسلامة المستودعات', '2023-06-07', '8.00 - 9.30', '3', 0, 0, '1678219350.jpg', 0, NULL, NULL, NULL, '2023-03-08 02:02:30', '2023-03-08 02:02:30'),
(71, 129, 'أساسيات البرامج المكتبية ( الوورد - الإكسيل - الباوربوينت )', 'Microsoft Office ( Word - Excel - PowerPoint )', 'أساسيات-البرامج-المكتبية-الوورد-الإكسيل-الباوربوينت', 'التعرف على أساسيات برامج ( الوورد - الإكسيل - الباوربوينت ) وإجادة التعامل مع هذه البرامج', 'الفئة المستهدفة ( جميع الأعمار - وكل المهتمين بادخال البيانات واعمال السكرتارية وإدارة الملفات)', 'برنامج الوورد :- \r\nاجراء العمليات التنسيقية - ادراج الجداول  - ادراج الصور والرسومات التوضيحية - الطباعة - حماية المستند - الهوامش واعدادات الصفحة - تحويل ملف الوورد لصيغة pdf -  الاستبدال وتبديل حالة أحرف اللغة الإنجليزية - اهم الاختصارات في البرنامج .\r\nبرنامج الإكسيل :-\r\n كيفية انشاء العمليات الحسابية -استخدام الدوال المختلفة في تحليل البيانات - شرح قاعدة if البسيطة والمركبة ومشتقات الدالة - التنسيق الشرطي - حماية المستند - تعقب التغييرات - الرسم البياني .\r\nبرنامج الباوربوينت:-\r\nالتحكم في خلفية العرض  بطرق عديدة - إضافة التأثيرات المختلفة على جميع أجزاء العرض - اضافة ملف صوت والتحكم فيه - اضافة ملف فيديو والتحكم فيه - تنفيذ حلقة مستمرة من العرض - تحويل العرض الى ملف فيديو.', '2023-06-11', '8.00 - 9.30', '5', 0, 0, '1679306311.jpg', 0, NULL, NULL, NULL, '2023-03-20 14:58:31', '2023-03-20 14:58:31');

